(53, 586667688165, 77395198181, 'https://cdn.shopify.com/s/files/1/0550/8526/9221/articles/blog-3_540x_f9e4e6fd-7b6c-4b80-9fee-04a960f72ddf.jpg?v=1633926136', 'Hospital Infectious Waste', '<p>You can go down the premium route and invest in some lovely cashmere or knitted pieces that will last you way beyond the lockdown period. Designers and the high street are full of great layering options, whether it’s a dress over trousers or a cropped cardigan over joggers.</p>\n<p>With the Government’s new restrictions, including steering clear of the office if you can, you might be staying at home a little longer than planned. So, while it’s still nice to dress up as part of a ‘normal’ routine, there’s never been a better time to invest in the best loungewear you can find.<br><br>In fact it’s one of the top trends for autumn, with retailers such as Vestiaire and Net-A-Porter seeing an increase in sales for loungewear of up to 70%.<br><br>As the nights draw in and the weather gets colder, the mood lifting qualities of joggers or a cashmere hoodie are undeniable. One step away from being in your actual pyjamas or nightwear of choice, loungewear can be both chic and comfortable, and that right there is the key.<br><br>For spring/summer 2020, it was all about the knitted cycling shorts paired with an oversized shirts, and the autumn trends are also leaning to the oversized.</p>', 'hospital-infectious-waste', 185, '1', '2021-11-27 09:32:33', '2021-11-27 09:32:33'),
(54, 586667655397, 77395198181, 'https://cdn.shopify.com/s/files/1/0550/8526/9221/articles/blog-2_540x_1c770c96-6328-41da-b866-16fd40ebad85.jpg?v=1633926096', 'Blood Pressure Machine', '<p>Searching for online style inspiration, it’s easy to fall down the black hole of Insta-hell. When you finally look up from your phone, you realise you’ve spent two whole days scrolling through feeds – and you’re still in your dressing gown, with no idea what to wear (we’ve all been there). Which sort of defeats the point.</p>\n<p>Well never fear, we’ve done the hard search for you. From our favourite UK influencers to the best missives from Milan and the coolest New Yorkers, read on for our definitive guide to the best fashion blogs, and for even more inspiration, do head to our separate<span> </span>black fashion influencer<span> </span>round-up.</p>\n<h2>Edaowa Fashion</h2>\n<p><strong>Who:</strong><span> </span>Damilola, a style blogger based between Manchester and London.</p>\n<p><strong>Why:</strong><span> </span>From the classic (jeans and a blazer) to the not-so-classic (printed crop tops and colourful trousers), this page is all about taking sartorial risks.</p>', 'blood-pressure-machine', 185, '1', '2021-11-27 09:32:33', '2021-11-27 09:32:33'),
(55, 586667622629, 77395198181, 'https://cdn.shopify.com/s/files/1/0550/8526/9221/articles/blog-1_540x_4bc63760-4ca5-462f-b582-5c756ad5a3d0.jpg?v=1633925978', 'Seat Collection Inspiration', '<p><strong>Why:</strong><span> </span>From the classic (jeans and a blazer) to the not-so-classic (printed crop tops and colourful trousers), this page is all about taking sartorial risks.</p>\n<p>Searching for online style inspiration, it’s easy to fall down the black hole of Insta-hell. When you finally look up from your phone, you realise you’ve spent two whole days scrolling through feeds – and you’re still in your dressing gown, with no idea what to wear (we’ve all been there). Which sort of defeats the point.</p>\n<p>Well never fear, we’ve done the hard search for you. From our favourite UK influencers to the best missives from Milan and the coolest New Yorkers, read on for our definitive guide to the best fashion blogs, and for even more inspiration, do head to our separate<span> </span>black fashion influencer<span> </span>round-up.</p>', 'seat-collection-inspiration', 185, '1', '2021-11-27 09:32:33', '2021-11-27 09:32:33'),
