(221, 83704152263, 'about-1', '<div class=\"gryffeditor\">\n<div data-label=\"Row\" id=\"r-1570091916643\" class=\"gf_row gf_row-gap-0 gf_row-fluid gf_row-no-padding\" data-icon=\"gpicon-row\" data-id=\"1570091916643\" data-row-gap=\"0px\" data-extraclass=\"\"><div class=\"gf_col-md-12 gf_column\" id=\"c-1542787188922\" data-id=\"1542787188922\" style=\"min-height: auto;\"><div data-label=\"Hero Banner\" id=\"m-1570091916633\" class=\"module-wrap effect-zoom\" data-icon=\"gpicon-herobanner\" data-ver=\"1\" data-id=\"1570091916633\">\n<div class=\"module \" data-image=\"https://ucarecdn.com/109b0dd7-56cf-4584-a61c-dff15aaf9882/-/format/auto/-/preview/3000x3000/-/quality/lighter/\" data-height=\"auto\" data-effect=\"effect-zoom\" data-transition=\"0.5\" data-fixedmode=\"0\"><span data-index=\"1\" class=\"item-content align-middle\"><div data-label=\"Row\" id=\"r-1570091916616\" class=\"gf_row\" data-icon=\"gpicon-row\" data-id=\"1570091916616\"><div class=\"gf_col-md-12 gf_column\" id=\"c-1542787340914\" data-id=\"1542787340914\">\n<div data-label=\"Icon\" data-key=\"icon\" id=\"e-1618303499341\" class=\"element-wrap\" data-icon=\"gpicon-icon\" data-ver=\"1.0\" data-id=\"1618303499341\"><div class=\"elm gf-elm-center gf-elm-center-lg gf-elm-center-md gf-elm-center-sm gf-elm-center-xs\" data-exc=\"\"><div class=\"gf_icon-wrap\" style=\"color: rgb(255, 255, 255);\"><i class=\"gf_icon fa fa-quote-left\"></i></div></div></div>\n<div data-label=\"Text Block\" id=\"e-1570091916594\" class=\"element-wrap\" data-icon=\"gpicon-textblock\" data-ver=\"1\" data-id=\"1570091916594\"><div class=\"elm text-edit gf-elm-left gf-elm-center-md gf-elm-center-sm gf-elm-center-xs gf-elm-center-lg\" data-gemlang=\"en\" data-exc=\"\">\n<p>Our goal is to design modern heirlooms that tell the</p>\n<p>lost stories of South Asian history, while also nurturing and <span style=\"font-family: inherit; font-size: inherit; text-align: inherit; letter-spacing: 0px;\">empowering a community that appreciates it.</span></p>\n</div></div>\n<div data-label=\"Icon\" data-key=\"icon\" id=\"e-1618303449950\" class=\"element-wrap\" data-icon=\"gpicon-icon\" data-ver=\"1.0\" data-id=\"1618303449950\"><div class=\"elm gf-elm-center gf-elm-center-lg gf-elm-center-md gf-elm-center-sm gf-elm-center-xs\" data-exc=\"\"><div class=\"gf_icon-wrap\" style=\"color: rgb(255, 255, 255);\"><i class=\"gf_icon fa fa-quote-right\"></i></div></div></div>\n</div></div></span></div>\n<div class=\"gf_hero-bg-wrap\" style=\"background-image: inherit; background-size: inherit; background-position: inherit; transition: transform 0.5s ease-in-out 0s;\"><div class=\"gf_hero-bg\" style=\"background-image: inherit; background-size: inherit; background-position: inherit; transition: transform 0.5s ease-in-out 0s;\"></div></div>\n<div class=\"gf_hero-overlay\" style=\"background:#000;opacity:0.4\"></div>\n</div></div></div>\n<!--gfsplit--><div data-label=\"Row\" id=\"r-1570091916662\" class=\"gf_row\" data-icon=\"gpicon-row\" data-id=\"1570091916662\" data-extraclass=\"\">\n<div class=\"gf_column gf_col-md-6\" id=\"c-1542787611695\" data-id=\"1542787611695\" style=\"min-height: auto;\"><div data-label=\"Row\" id=\"r-1570091916625\" class=\"gf_row gf_row-gap-20\" data-icon=\"gpicon-row\" data-id=\"1570091916625\" data-row-gap=\"20px\" data-extraclass=\"\"><div class=\"gf_col-md-12 gf_column\" id=\"c-1542787683035\" data-id=\"1542787683035\" style=\"min-height: auto;\">\n<div data-label=\"Heading\" id=\"e-1570091916680\" class=\"element-wrap\" data-icon=\"gpicon-heading\" data-ver=\"1\" data-id=\"1570091916680\"><div class=\"elm text-edit gf-elm-center gf-elm-left-lg gf-elm-left-md gf-elm-left-xs gf-elm-left-sm\" data-gemlang=\"en\" data-exc=\"\"><h2>SINCE 2015</h2></div></div>\n<div data-label=\"Text Block\" id=\"e-1570091916638\" class=\"element-wrap\" data-icon=\"gpicon-textblock\" data-ver=\"1\" data-id=\"1570091916638\"><div class=\"elm text-edit gf-elm-left gf-elm-left-lg gf-elm-left-md gf-elm-left-sm gf-elm-left-xs\" data-gemlang=\"en\" data-exc=\"\">\n<p>Emerging from a friendship fueled by sushi and nostalgia, Aashna Singh and Sneha <span style=\"font-family: inherit; font-size: inherit; text-align: inherit; letter-spacing: 0px;\">Saksena launched OLIO in November 2015 as a destination for high quality, </span><span style=\"font-family: inherit; font-size: inherit; text-align: inherit; letter-spacing: 0px;\">differentiated design that celebrates made in India.</span></p>\n<p><br></p>\n<p>After three years of selling contemporary womenswear, the brand pivoted. OLIO jewels <span style=\"font-family: inherit; font-size: inherit; text-align: inherit; letter-spacing: 0px;\">was launched; an evolution that made way for a confluence of the ancient and the </span><span style=\"font-family: inherit; font-size: inherit; text-align: inherit; letter-spacing: 0px;\">modern, the old and the new.</span></p>\n</div></div>\n</div></div></div>\n<div class=\"gf_column gf_col-md-6\" id=\"c-1542787635624\" data-id=\"1542787635624\"><div data-label=\"Row\" id=\"r-1570091916555\" class=\"gf_row gf_row-gap-20\" data-icon=\"gpicon-row\" data-id=\"1570091916555\" data-row-gap=\"20px\" data-extraclass=\"\"><div class=\"gf_col-md-12 gf_column\" id=\"c-1542787763609\" data-id=\"1542787763609\" style=\"min-height: auto;\"><div data-label=\"Carousel\" data-key=\"carousel\" id=\"m-1618291119575\" class=\"module-wrap gf-carousel-loaded\" data-icon=\"gpicon-carousel\" data-ver=\"1.0\" data-id=\"1618291119575\">\n<div class=\"module main-slider owl-carousel owl-theme owl-loaded\" data-collg=\"2\" data-colmd=\"3\" data-colsm=\"3\" data-colxs=\"1\" data-marginlg=\"5px\" data-marginmd=\"5px\" data-marginsm=\"5px\" data-marginxs=\"5px\" data-dotslg=\"1\" data-dotsmd=\"1\" data-dotssm=\"1\" data-dotsxs=\"1\" data-navlg=\"1\" data-navmd=\"1\" data-navsm=\"0\" data-navxs=\"0\" data-navspeed=\"1200\" data-autoplay=\"0\" data-autoplaytimeout=\"5000\" data-autoplayhoverpause=\"1\" data-loop=\"0\">\