(241, 81579966663, 'grid-view', '<body>\r\n<p><span style=\"color: #5f6368; font-family: arial, sans-serif;\">grid-view</span><span style=\"color: #4d5156; font-family: arial, sans-serif;\"> let a single user listen to an audio source privately, in contrast to a loudspeaker, which emits sound into the open air for anyone nearby to hear.</span></p>\r\n</body>', 'grid-view', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
(242, 81579933895, 'headphone', '<body>\r\n<p>Headphones<span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px;\"> are small speakers that can be worn in or around your ears. Traditional </span>headphones<span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px;\"> have two </span>ear<span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px;\"> cups attached by a band that is placed over your </span>head<span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px;\">. Smaller </span>headphones<span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px;\">, often called earbuds or earphones, are placed inside the outer part of your </span>ear<span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px;\"> canal.</span></p>\r\n</body>', 'headphone', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
