(255, 84142784711, 'Privacy Policy clofoli', '<p><strong>Privacy Policy</strong></p>\n<p><strong>This Privacy Policy is effective as of Jul-__-2021</strong></p>\n<p>Your Beauty Plug (“Beauty Plug”, “we” or “us”) is engaged in the business of manufacturing and selling hair care products including hair oils and masks using purest natural and organic ingredients (“Services”) and Beauty Plug is firmly committed to protecting your privacy. You should understand what we do with data relating to you (“Personal Information”) which we collect when you visit our online portal (the “Website”) and how we use and disclose the information. We are committed to complying with all data protection laws as are applicable to us.</p>\n<p> </p>\n<p>By using our Website or by otherwise giving us your Personal Information you are accepting the practices described in this Privacy Policy. If you do not agree to this Privacy Policy, please do not use our Website or give us any of your personal information. We reserve the right to make changes to this Privacy Policy at any time. Any changes will be posted in this Privacy Policy. We encourage you to regularly review this Privacy Policy to make sure you are aware of any changes and how your data may be used.</p>\n<p> </p>\n<p>If you have any questions or comments about the Policy, please contact us by filing the form on our homepage. This Policy is incorporated into and is subject to the Terms of Service. Your use of Website and any Personal Information that you provide on the Website remains subject to the terms of this Website Privacy Policy and Beauty Plug’s Terms of Service. Please click on any of the following questions to be directed to the relevant answer in the main body of this Policy.</p>\n<p> </p>\n<p> </p>\n<p><strong>HOW WE COLLECT YOUR PERSONAL INFORMATION</strong></p>\n<p> </p>\n<p><strong>WHY WE NEED TO COLLECT YOUR PERSONAL INFORMATION</strong></p>\n<p> </p>\n<p><strong>TO WHOM WE GIVE YOUR PERSONAL INFORMATION</strong></p>\n<p> </p>\n<p><strong>HOW LONG WE RETAIN YOUR PERSONAL INFORMATION</strong></p>\n<p> </p>\n<p><strong>HOW WE PROTECT YOUR PERSONAL INFORMATION</strong></p>\n<p> </p>\n<p><strong>CONTROLLING YOUR PERSONAL INFORMATION</strong></p>\n<p> </p>\n<p><strong>LINKS AND THIRD PARTIES</strong></p>\n<p> </p>\n<p><strong>CONTACT US</strong></p>\n<p> </p>\n<p> </p>\n<p><strong>HOW WE COLLECT YOUR PERSONAL INFORMATION</strong></p>\n<p>We may collect the following Personal Information relating to you:</p>\n<ul>\n<li>Account Information: You do not need to register to use our Website; however, during purchase of the products from our Website, we may receive or otherwise collect information that identifies you as a specific individual and can be used to contact or identify you (“Personal Information”). The types of information we receive and collect from you will be Name, email ID and address details.</li>\n</ul>\n<p> </p>\n<ul>\n<li>Device and location Information: The Website automatically collects certain technical information relating to the device you use to visit the Website. Specifically, we use cookies and similar technologies to help us understand your activity on the Website. A “cookie” is a small piece of data that a website can send to your browser, which may then be stored on your device. Data that we collect automatically includes your internet protocol (“IP”) address, location, your device’s identification information, and the actions taken on our Website (e.g., links that you click) as well as other sites that you may visit. Cookies are text files, containing small amounts of information, which are downloaded to your browsing device (such as a computer or smartphone) when you visit a website. Cookies can be recognized by the website that downloaded them — or other websites that use the same cookies. Beauty Plug will have access to cookies like session cookie, strictly necessary cookie, persistent cookie, targeting cookie and tailored content cookie which would help Beauty Plug know if the browsing device has visited them before.</li>\n<li>Payment Information: If you use the Service to make or receive payments, we will also collect certain financial information, such as credit card or other financial account information.</li>\n</ul>\n<p> </p>\n<ul>\n<li>Children Information: The Service is intended for users 16 and older. We do not knowingly collect Personal Information from anyone younger than age 16. If we become aware that a child younger than 16 has provided us with Personal Information, we will use commercially reasonable efforts to delete such information from our files. If you are the parent or legal guardian of a child younger than age 16 and believe that Beauty Plug has collected Personal Information from your child, please contact us.</li>\n<li>Anonymous Information: We sometimes collect anonymous information from visits to the Website. Anonymous information (or click stream data) refers to information that does not and will not directly or indirectly reveal your identity, e.g., aggregated data relating to all of our Website visitors. We may use this data to analyze trends and statistics and to help us provide you with a better experience using our Website. </li>\n</ul>\n<p>If you provide us with Personal Information of third parties (such as the details of your administrative assistant or your emergency contact), you agree to: (a) notify each individual before sharing their Personal Information with us, (b) explain that their Personal Information will be processed in accordance with this Privacy Policy, and (c) obtain their consent, where appropriate.</p>\n<p><strong>WHY WE NEED TO COLLECT YOUR PERSONAL INFORMATION</strong></p>\n<p>To the extent permitted by applicable law, we use your Personal Information for various purposes, such as to:</p>\n<ul>\n<li>provide you with the Products and information that you have requested.</li>\n<li>manage and maintain our relationship with you, including responding to an inquiry, question or comment made by you and providing you with other customer support.</li>\n<li>communicate important notices to you, such as information about changes to this Website Privacy Policy and Service updates.</li>\n<li>carry out analytics and market research and internal reporting to enable us to plan, develop and improve our Website, our Products and marketing activities. (For example, we may use your IP address to help diagnose problems with our server, to administer the Website, to refine the Website based on which features people use most often, to help identify Website users (such as you) and gather general demographic information about Website users.)</li>\n<li>inform you of our new Products that we think you will find valuable by sending promotional messages via email, SMS, phone, post and/or other similar communications means. (If you would prefer not to receive these communications, simply follow the unsubscribe instructions on the promotional communications that you receive.)</li>\n<li>create a profile about you to help us personalize our communications to you, including to ensure that you receive relevant marketing communications based on your actions on this particular Website or your geographic location based on your IP address.</li>\n<li>prevent and detect unlawful behavior, and protect or enforce our legal rights, for example defending us in case of legal disputes.</li>\n</ul>\n<p> </p>\n<p><strong>TO WHOM WE GIVE YOUR PERSONAL INFORMATION</strong></p>\n<p>We will not sell your Personal Information to anyone other than identified in this Privacy Policy. However, we may need to disclose your Personal Information to third parties in the following instances:</p>\n<ul>\n<li>Service providers: We will disclose your Personal Information to companies that provide services to us, such as companies that assist us in operating our Website and vendors that assist us with marketing campaigns. The service providers are required to keep your Personal Information confidential and are not permitted to use your Personal Information for any other purpose than to carry out the Products they are performing for us.</li>\n</ul>\n<p> </p>\n<ul>\n<li>Third parties to meet applicable legal requirements: We may need to disclose your Personal Information to a third party if it is necessary to comply with a legal obligation or the decision of a judicial authority, a public authority or a government body, or if disclosure is necessary for national security, law enforcement or other public interest.</li>\n</ul>\n<p> </p>\n<ul>\n<li>Business partners: We will disclose your Personal Information to our business partners if it is necessary for providing services to you, such as payment gateway, certain software and related Products. In addition, we may also share your Personal Information with our business partners engaged with us for promotion and marketing of our Services.</li>\n</ul>\n<p> </p>\n<ul>\n<li>Third parties in connection with a business sale: If we make a sale or transfer of assets, or are otherwise involved in a merger or business/asset transfer, we may transfer your Personal Information to one or more third parties as part of that transaction.</li>\n</ul>\n<p> </p>\n<ul>\n<li>Other third parties with your consent: We may also share your Personal Information with other third parties when you separately consent to such sharing.</li>\n</ul>\n<p> </p>\n<p> </p>\n<p><strong>HOW LONG WE RETAIN YOUR PERSONAL INFORMATION</strong></p>\n<p> </p>\n<p>Your Personal Information will be retained only for so long as reasonably necessary for the purposes set out in this Website Privacy Policy in accordance with applicable laws, including for the purposes of satisfying any legal, regulatory, accounting or reporting requirements.  Your information may persist in copies made for backup and business continuity purposes for additional time. If you choose to provide us with Personal Information, we encourage you to routinely update the data to ensure that we have accurate and up-to-date information about you.</p>\n<p> </p>\n<p> </p>\n<p><strong>HOW WE PROTECT YOUR PERSONAL INFORM', 'privacy-policy-clofoli', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
