(257, 79971713223, 'Product  Features', '<body>\r\n\r\n\r\n\r\n\r\n<p><span style=\"font-family: monoton, cursive;\">A <strong>product feature</strong> is a specific piece of <strong>functionality</strong> that has a corresponding benefit or set of benefits for the user. Benefits are the value that users gain from using that <strong>functionality</strong></span></p>\r\n\r\n</body>', 'product-features', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
(258, 79971516615, 'Product  Layout', '<body>\r\n\r\n\r\n\r\n\r\n<p><span style=\"font-family: monoton, cursive;\">In manufacturing engineering, a <strong>product layout</strong> refers to a <strong>production</strong> system where the work stations and equipment are located along the line of <strong>production</strong>, as with assembly lines. Usually,</span></p>\r\n\r\n</body>', 'product-layout', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
(259, 79971549383, 'Product Swatch', '<span>A </span><b>product description</b><span> is the marketing copy used to </span><b>describe</b><span> a </span><b>product\'s</b><span> value proposition to potential customers. A compelling </span><b>product description</b><span> provides customers with </span><b>details</b><span> around features, problems it solves and other benefits to help generate a sale</span>', 'product-swatch', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
