(262, 82162647239, 'Reviews', '<body>\r\n\r\n\r\n\r\n\r\n<div class=\"component-theme\">\r\n<div id=\"r--ryviu-theme\" class=\"r--default-theme\" style=\"background: transparent !important; padding: 0px; border: 0px solid #ffffff;\">\r\n<div class=\"header-v1 default-header\">\r\n<div class=\"r--header\">\r\n<div class=\"r--overview\">\r\n<div class=\"r--overview-left\">\r\n<div class=\"r--star-block r--star-850\">\n<span class=\"r--title-average\">Average</span> <span class=\"r--stars_average\">4.8</span>\r\n<div class=\"r--stars cpl\"><span class=\"r--total-view\"> 4 reviews</span></div>\r\n</div>\r\n<table class=\"r--rateList r--rate-850\">\r\n<tbody>\r\n<tr class=\"\">\r\n<td class=\"r--rate-name\">\r\n<div>Excellent</div>\r\n</td>\r\n<td class=\"r--rate-numeral\"><span class=\"r--total-bar-default\"><span class=\"r--bar_bak_gray\" style=\"width: 75%;\" data-width=\"75\"><span class=\"r--bar-active\" style=\"background-color: #fdbc00;\"><span class=\"r--rate-percent-default\" style=\"border-color: #d0d0d0;\"> 3 </span></span></span></span></td>\r\n</tr>\r\n<tr class=\"\">\r\n<td class=\"r--rate-name\">\r\n<div>Very Good</div>\r\n</td>\r\n<td class=\"r--rate-numeral\"><span class=\"r--total-bar-default\"><span class=\"r--bar_bak_gray\" style=\"width: 25%;\" data-width=\"25\"><span class=\"r--bar-active\" style=\"background-color: #fdbc00;\"><span class=\"r--rate-percent-default\" style=\"border-color: #d0d0d0;\"> 1 </span></span></span></span></td>\r\n</tr>\r\n<tr class=\"r--disable\">\r\n<td class=\"r--rate-name\">\r\n<div>Average</div>\r\n</td>\r\n<td class=\"r--rate-numeral\"><span class=\"r--total-bar-default\"><span class=\"r--bar_bak_gray\" style=\"width: 0%;\" data-width=\"0\"><span class=\"r--bar-active r--noneBack\" style=\"background-color: #fdbc00;\"><span class=\"r--rate-percent-default\"> 0 </span></span></span></span></td>\r\n</tr>\r\n<tr class=\"r--disable\">\r\n<td class=\"r--rate-name\">\r\n<div>Poor</div>\r\n</td>\r\n<td class=\"r--rate-numeral\