mages</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"r--unset-select r--sort-button r--filter-link r--flex-center el-popover__reference\" tabindex=\"0\" aria-describedby=\"el-popover-2079\">\n<span class=\"r--select\">Sort by: Latest </span> <img class=\"r--select r--icon-down\" src=\"https://cdn.ryviu.com/v/images/icon-down.svg\" width=\"8\" height=\"4\">\n</div>\r\n</div>\r\n<div class=\"r--filter\">\r\n<div id=\"el-popover-8334\" class=\"el-popover el-popper r--filter-popover r--item-filter\" style=\"display: none;\" tabindex=\"0\" role=\"tooltip\" aria-hidden=\"true\">\r\n<div class=\"r--wrapper-sortby\">\r\n<ul class=\"r--filter-list\">\r\n<li><label class=\"r--check-box\"><span class=\"label-input\">Excellent</span> <input type=\"checkbox\"></label></li>\r\n<li><label class=\"r--check-box\"><span class=\"label-input\">Very Good</span> <input type=\"checkbox\"></label></li>\r\n<li><label class=\"r--check-box\"><span class=\"label-input\">With photos</span> <input type=\"checkbox\"></label></li>\r\n<li><label class=\"r--check-box\"><span class=\"label-input\">With replies</span> <input type=\"checkbox\"></label></li>\r\n</ul>\r\n<div class=\"r--unset-select r--btn r--btn-clear r--button\">Clear</div>\r\n</div>\r\n</div>\r\n<div class=\"r--unset-select r--sort-button r--filter-link r--flex-center el-popover__reference\" tabindex=\"0\" aria-describedby=\"el-popover-8334\">\n<span class=\"r--select\">Filter</span> <img class=\"r--select r--icon-down\" src=\"https://cdn.ryviu.com/v/images/icon-down.svg\" width=\"8\" height=\"4\">\n</div>\r\n</div>\r\n</div>\r\n<div class=\"r--showing r--f-left\"><span class=\"r--text-showing\">Showing 1 - 4 of 4 reviews</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"r--body\">\r\n<div class=\"r--default-grid\">\r\n<div class=\"r--default-item r--first\">\r\n<div class=\"r--item-head\">\r\n<div class=\"r--author r--text-limit\" title=\"San\">\r\n<div class=\"r--avatar-default\" style=\"background: #2ea2db; color: #ffffff; border-radius: 50%; text-align: center; text-transform: uppercase; font-weight: normal;\">s</div>\r\n<span class=\"\">San</span>\n</div>\r\n<div class=\"r--stars-author\">\r\n<div class=\"r--star-head r--flex-center\">\r\n<div class=\"r--stars cpl r--flex-center\"><span class=\"r--stars-item\" style=\"width: 73px !important;\">&lt;span class=\"r-icon--star1\" style=\"</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</body>', 'reviews', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
(263, 79926952135, 'Sales Product', '<b>Selling</b><span> counterfeit </span><b>products</b><span> is </span><b>illegal</b><span> and a crime as per law. You can obtain </span><b>legal</b><span> permission from the </span><b>legal</b><span> owners of the </span><b>product</b><span> to </span><b>legally sell</b><span> the counterfeit or duplicate </span><b>products</b><span>. </span><b>Selling copy</b><span> of branded </span><b>items</b><span> is </span><b>illegal</b><span> in india and can be penalized with heavy compensations.</span>', 'testing', '1', 8, '2022-03-02 06:58:30', '2022-03-02 06:58:30'),
