(275, 84899954894, 'Size Chart', '<div class=\"model_wrapper\">\n<h2>Size Guide</h2>\n<p>All measurements are in inches </p>\n<table class=\"grid_top\" width=\"100%\">\n<thead class=\"table_sleeping\">\n<tr>\n<td></td>\n<td>Small</td>\n<td>Medium</td>\n<td>Large</td>\n</tr>\n<tr>\n<td>Chest</td>\n<td>42</td>\n<td>44</td>\n<td>46</td>\n</tr>\n<tr>\n<td>Length Shoulder Back</td>\n<td>28</td>\n<td>28.5</td>\n<td>29</td>\n</tr>\n<tr>\n<td>Shoulder</td>\n<td>20</td>\n<td>21</td>\n<td>22</td>\n</tr>\n<tr>\n<td>Sleeve Length</td>\n<td>8.5</td>\n<td>9</td>\n<td>9.5</td>\n</tr>\n<tr>\n<td>Sleeve Opening </td>\n<td>14</td>\n<td>15</td>\n<td>16</td>\n</tr>\n</thead>\n</table>\n<!--           <img class=\"size-chart-image\" src=\"https://cdn.shopify.com/s/files/1/0177/6159/9560/files/400x400_page-0001_copy_598x471_4c31152d-a2e4-40e8-b206-726f5218ff4f.jpg?v=1642490675\" title=\"My image\"> -->\n</div>', 'size-chart', '1', 8, '2022-03-02 09:14:45', '2022-03-02 09:14:45'),
(276, 85143027918, 'testing', '<div class=\"abt_flex2\">\n<div id=\"shopify-section-about-us\" class=\"shopify-section\">\n<div class=\"hingushub\">\n<div class=\"article-title \">\n<h1>HANDELSBETINGELSER</h1>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>1. KØB HOS HINGES HUS</h2>\n</div>\n<div class=\"article-section__content\">Der er ikke indgået en bindende købeaftale med Hinges Hus, før De har modtaget en ordrebekræftelse fra Hinges Hus.<br><br>Hinges Hus opbevarer ikke selve ordrebekræftelsen efter den er fremsendt til kunden.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>2. PRISER</h2>\n</div>\n<div class=\"article-section__content\">Alle priser er inkl. 25 % moms og i Danske kroner, hvor intet andet nævnes.<br><br>Priserne er kun gældende indenfor Danmarks grænser, ekskl. Færøerne og Grønland.<br><br>Der tages forbehold for:<br>\n<ul>\n<li>Valutaændringer</li>\n<li>Force majeure</li>\n<li>Leveringssvigt</li>\n<li>Afgiftsændringer</li>\n<li>Udsolgte varer og trykfejl</li>\n</ul>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>3. SALG GENERELT</h2>\n</div>\n<div class=\"article-section__content\">Den angivne pris ved bestillingstidspunktet, er den gældende bestillingspris.<br><br>Hinges Hus forbeholder sig ret til at påregne et bestillingsgebyr på DKK 25,00 inkl. moms, hvor bestillingen ikke er foretaget via Hinges Hus\'s hjemmeside.<br><br>En bestilling slettes, såfremt den ikke er afhentet senest 4 hverdage efter bestillingen.<br><br>Afhentningsvarer faktureres til den aktuelle pris på bestillingstidspunktet, og prisen ændres IKKE hverken ved prisfald eller stigning.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>4. SÆRLIGT OM BUTIKSALG</h2>\n</div>\n<div class=\"article-section__content\">Butikssalg: køb som er foretaget i vores butik på Hinges Hus.<br><br>Ved butikssalg er der INGEN kontant returret, da man har lejlighed til, at undersøge varen inden overdragelsen/risikoovergangen sker.<br><br>Varen skal tilbageleveres i original og ubrudt emballage, da varen efterfølgende skal kunne sælges som ny.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>5. LEVERING</h2>\n</div>\n<div class=\"article-section__content\">Der tages forbehold for udsolgte varer og udskudt leveringstid hos Hinges Hus\'s grossister.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>6. AFBESTILLINGER</h2>\n</div>\n<div class=\"article-section__content\">Ønsker De at afbestille eller annullere en allerede afgivet bestilling, bør det som udgangspunkt ske ved, at fremsende en e-mail med mærket \" Afbestilling \". Her bør bestillingstidspunkt samt ordrenummer fremgå.<br><br>Har De modtaget en ordrebekræftelse pr. e-mail kan denne returneres til afsender med teksten \" Afbestilling ! \" indsat i emnetekst. Afbestilling bør ske inden kl. 15.00 samme dag, som bestillingen er foretaget.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>7. BETALING</h2>\n</div>\n<div class=\"article-section__content\">De mulige betalingsmåder er:<br>\n<ul>\n<li>Dankort</li>\n<li>Diners Club</li>\n<li>Efter aftale (kun erhverv)</li>\n<li>Handelsfinans</li>\n<li>Kontant (kun butikssalg)</li>\n</ul>\n<br><br>Der er ikke mulighed for forudbetaling, idet kundens retsstilling her, er væsentlig dårligere end ved andre former for betaling.<br><br>Betalingsmåde \'EFTER AFTALE\' kan kun benyttes af virksomheder og offentlige institutioner, og kun såfremt De i forvejen har opnået en betalingsaftale med Hinges Hus. Ønsker De en sådan aftale kan det for private virksomheder ske på<span> </span><a href=\"mailto:info@hingeshus.dk\">info@hingeshus.dk</a><span> </span>og for offentlige virksomheder ske på<span> </span><a href=\"mailto:info@hingeshus.dk\">info@hingeshus.dk</a><br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>8. REKLAMATIONSRET</h2>\n</div>\n<div class=\"article-section__content\">Der ydes 2 års reklamationsret på produkter købt hos Hinges Hus. Forskellen på reklamationsret og garanti kan ses under Køberegler. Er der yderligere reklamationsret eller garanti, vil det fremgå særskilt af fakturaen.<br><br>Skulle varen mod forventning gå i stykker under reklamationsperioden, repareres denne vederlagsfrit på vort eller producentens værksted.<br><br>Skade på produktet som skyldes betjeningsfejl, håndteringsfejl, modifikationer eller groft misbrug fra brugerens side, er ikke dækket af reklamationsretten. Herunder hører også vaskefejl og unødvendig slidtage.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>9. ANVENDELSE AF REKLAMATIONSRETTEN</h2>\n</div>\n<div class=\"article-section__content\">Reklamation angående fejl og mangler skal meddeles Hinges Hus inden rimelig tid efter varens modtagelse.<br><br>Kunden opfordres på det kraftigste til, at afgive erklæring omkring produktets fejl eller mangel i forbindelse med reklamationen, idet undladelse kan betyde en forlængelse af afhjælpningsprocessen grundet fejlsøgning.<br><br>Varer der ikke indgår under reklamationsretten og/eller modtages uden forsvarlig emballage, vil blive omemballeret og der vil blive opkrævet et beløb svarende til Hinges Hus’s udgifter til nødvendig og forsvarlig emballering.<br><br>Varer der returneres på efterkrav eller som sendes uden porto nægtes modtaget af Hinges Hus.<br><br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>10. TILBAGESENDTE VARER SOM IKKE INDEHOLDER FEJL</h2>\n</div>\n<div class=\"article-section__content\">Ved tilbagesendelse af defekte eller forkerte varer til Hinges Hus, hvor fejl eller defekt, defineret og angivet af kunden, ikke konstateres, vil varen blive tilbagesendt til kunden inklusiv et testgebyr.<br><br>Testgebyret er DKK 200 pr. halve time inkl. moms. Testgebyret beregnes på baggrund af tid forbrugt i forbindelse med test og fejlsøgning.<br><br>Medsendes der tilbehør, skal antal og produktbeskrivelse medfølge. Medfølger der tilbehør, som ikke umiddelbart fremgår på det medsendte RMA skema (reklamationsskema), kan Hinges Hus ikke gøres ansvarlig for eventuel bortkomst af disse effekter.<br><br>Varer bør returneres med en fakturakopi hvor købstidspunktet for det reklamerede produkt fremgår, da varen ellers vil blive henlagt indtil der foreligger fakturakopi og evt. fejlmeddelelse på produktet.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>11. FORSVARLIG RETURNERING</h2>\n</div>\n<div class=\"article-section__content\">Alle produkter, der returneres til Hinges Hus skal være forsvarligt indpakket.<br><br>Hinges Hus anbefaler, at varen returneres via Post Danmark, og at varen sendes som pakkepost. På den måde er der mulighed for at spore pakken i Post Danmarks system og det fjerner dermed enhver tvivl om, hvorvidt varen er blevet udleveret til Hinges Hus. Yderligere har kunden mulighed for, at kunne efterlyse pakken såfremt udlevering ikke har fundet sted.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>12. ER DE I TVIVL</h2>\n</div>\n<div class=\"article-section__content\">Såfremt der måtte opstå tvivlsspørgsmål, anbefaler Hinges Hus, at De retter henvendelse til<span> </span><a href=\"mailto:info@hingeshus.dk\">info@hingeshus.dk</a><span> </span>eller på telefon 97321515.<br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>13. SÆRLIGE BESTEMMELSER FOR ERHVERVSDRIVENDE</h2>\n</div>\n<div class=\"article-section__content\">Der gælder de samme salgsbetingelser som for forbrugere, dog med følgende modifikation:<br><br>• Der er ingen fortrydelsesret for erhvervsdrivende, såfremt der er påsat logo eller på anden måde lavet modifikationer ved varen.<br><br>• Der gælder 1 års reklamationsret fra oprindelig fakturadato. Ombytning eller reparation medfører ikke, at der løber en ny 1 års reklamationsperiode<br><br>• Hinges Hus forbeholder sig ejendomsretten til varer købt på kredit, indtil den fulde købesum er erlagt<br> o Alle omkostninger i forbindelse med håndhævelse af ejendomsforbeholdet påhviler køberen.<br> o Der påløber renter fra forfaldsdatoen med 1% pr. påbegyndt måned.<br><br><br>\n</div>\n</div>\n<div class=\"article-section  \">\n<div class=\"article-section__heading\">\n<h2>14.  PERSONDATAPOLITIK</h2>\n</div>\n<div class=\"article-section__content\">Markedsføring:<br>Nyhedsbreve<br>Hvad bruger vi dine oplysninger til her på Hingeshus.dk?<br>Når du tilmelder dig vores nyhedsbrev, accepterer du, at vi bruger din e-mail adresse til at udsende nyhedsbreve, tilbud, konkurrencer, tips og gode råd og andet markedsføringsmateriale. Vi kan endvidere bruge din e-mail adresse til at udsende orienterende e-mails om vores forretning eller om vores nyhedsbrev.<br>Derudover anvender vi de indsamlede mailadresser i oftest anonymiseret form til markedsføring. Til udsendelse af e-mails bruger vi mailklienten MailChimp<br>MailChimp: 675 Ponce de Leon Ave NE, Suite 5000, Atlanta, GA 30308 USA<br><br><br>Webanalyse<br>For konstant at forbedre og optimere vores tilbud, anvender vi såkaldte tracking-teknologier. Til dette formål anvender vi tjenesteydelserne fra Google Analytics.<br><br>Google Analytics<br>Dette website benytter Google (Universal) Analytics, en webanalysetjeneste under Google Inc. (<a href=\"http://www.google.dk/\" target=\"\">www.google.dk</a>). Google (Universal) Analytics anvender metoder, som muliggør en analyse af din anvendelse af websitet, som for eksempel såkaldte „cookies“, tekstfiler, der gemmes på din computer. De genererede informationer om din anvendelse af dette website overføres som regel til en server hos Google i USA og gemmes der. På grund af aktiveringen af IP-anonymiseringen på dette website forkortes dermed IP-adressen før fremsendelse inden for medlemsstaterne i Den Europæiske Union eller ', 'testing', '1', 8, '2022-03-02 09:14:45', '2022-03-02 09:14:45'),
