(301, 81374380054, 'GDPR Compliance', '<style>\n    #form-gdpr-edit-account-request,\n    #form-gdpr-data-account-request,\n    #form-gdpr-personal-data-report-request,\n    #form-gdpr-delete-account-request {\n        display: none;\n    }\n    #gdpr_page button {\n      background-color: transparent;\n      border: 0;\n      border-bottom: 1px solid black;\n      padding: 0px;\n    }\n\n    /* Modal background */\n    #data-verification-background {\n      display: none;\n      position: fixed;\n      z-index: 1;\n      padding-top: calc(50vh - 83px);\n      left: 0;\n      top: 0;\n      width: 100%;\n      height: 100%;\n      overflow: auto;\n      background-color: rgb(0,0,0);\n      background-color: rgba(0,0,0,0.4);\n      opacity: unset;\n      z-index: 9999;\n    }\n    /* Modal Content */\n    #data-verification-modal {\n      background-color: #fefefe;\n      margin: auto;\n      padding: 16px;\n      border: 1px solid #888;\n      width: 38%;\n    }\n    /* Modal Close Button */\n    .data-verification-close {\n      color: #aaaaaa;\n      float: right;\n      font-size: 28px;\n      font-weight: bold;\n      line-height: 17px;\n    }\n    .data-verification-close:hover,\n    .data-verification-close:focus {\n      color: #000;\n      text-decoration: none;\n      cursor: pointer;\n    }\n    /* Checkbox Text */\n    #data-verification-container p{\n      display: inline-block;\n      padding-left: 5px;\n      vertical-align: top;\n      width: calc(100% - 45px);\n      cursor: pointer;\n    }\n    #data-verification-container a, #data-verification-container a:hover{\n      text-decoration: underline!important;\n      color: #4285f4;\n    }\n    /* Checkbox Icon */\n    #data-verification-icon {\n      cursor: pointer;\n      position: relative;\n      margin: auto;\n      width: 18px;\n      height: 18px;\n      -webkit-tap-highlight-color: transparent;\n      transform: translate3d(0, 0, 0);\n      margin-top: 2px;\n    }\n    #data-verification-icon:before {\n      content: \"\";\n      position: absolute;\n      top: -7px;\n      left: -7px;\n      width: 32px;\n      height: 32px;\n      border-radius: 50%;\n      background: rgba(34,50,84,0.03);\n      opacity: 0;\n      transition: opacity 0.2s ease;\n    }\n    #data-verification-icon svg {\n      position: relative;\n      z-index: 1;\n      fill: none;\n      stroke-linecap: round;\n      stroke-linejoin: round;\n      stroke: #c8ccd4;\n      stroke-width: 1.5;\n      transform: translate3d(0, 0, 0);\n      transition: all 0.2s ease;\n    }\n    #data-verification-icon svg path {\n      stroke-dasharray: 60;\n      stroke-dashoffset: 0;\n    }\n    #data-verification-icon svg polyline {\n      stroke-dasharray: 22;\n      stroke-dashoffset: 66;\n    }\n    #data-verification-icon:hover:before {\n      opacity: 1;\n    }\n    #data-verification-container:hover #data-verification-icon svg {\n      stroke: #4285f4;\n    }\n    #data-verification-icon.clicked svg {\n      stroke: #4285f4;\n    }\n    #data-verification-icon.clicked svg path {\n      stroke-dashoffset: 60;\n      transition: all 0.3s linear;\n    }\n    #data-verification-icon.clicked svg polyline {\n      stroke-dashoffset: 42;\n      transition: all 0.2s linear;\n      transition-delay: 0.15s;\n    }\n\n    /* Loading Element */\n    .loading {\n        display: none;\n        top:50vh;\n        left:50vw;\n        position:fixed;\n    }\n    .loading:not(:required):after {\n      content: \'\';\n      display: block;\n      font-size: 10px;\n      width: 1em;\n      height: 1em;\n      margin-top: -0.5em;\n      -webkit-animation: spinner 1500ms infinite linear;\n      -moz-animation: spinner 1500ms infinite linear;\n      -ms-animation: spinner 1500ms infinite linear;\n      -o-animation: spinner 1500ms infinite linear;\n      animation: spinner 1500ms infinite linear;\n      border-radius: 0.5em;\n      -webkit-box-shadow: rgba(255,255,255, 1) 1.5em 0 0 0, rgba(255,255,255, 1) 1.1em 1.1em 0 0, rgba(255,255,255, 1) 0 1.5em 0 0, rgba(255,255,255, 1) -1.1em 1.1em 0 0, rgba(255,255,255, 1) -1.5em 0 0 0, rgba(255,255,255, 1) -1.1em -1.1em 0 0, rgba(255,255,255, 1) 0 -1.5em 0 0, rgba(255,255,255, 1) 1.1em -1.1em 0 0;\n      box-shadow: rgba(255,255,255, 1) 1.5em 0 0 0, rgba(255,255,255, 1) 1.1em 1.1em 0 0, rgba(255,255,255, 1) 0 1.5em 0 0, rgba(255,255,255, 1) -1.1em 1.1em 0 0, rgba(255,255,255, 1) -1.5em 0 0 0, rgba(255,255,255, 1) -1.1em -1.1em 0 0, rgba(255,255,255, 1) 0 -1.5em 0 0, rgba(255,255,255, 1) 1.1em -1.1em 0 0;\n    }\n\n    /* Modal changes on mobile resolution*/\n    @media only screen and (max-width: 600px) {\n      #data-verification-modal {\n        width: 90%;\n      }\n    }\n\n    /* Animation */\n    @-webkit-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @-moz-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @-o-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n  </style>\n<div id=\"gdpr_page\" class=\"col-sm-12\">\n    <div class=\"text-center\">\n        The app used for assuring the GDPR/CCPA compliance of this site, collects your IP and the email address in order to process the data. For more check <a href=\"https://gdprcdn.b-cdn.net/pages/privacy_policy\" target=\"_blank\"> Privacy Policy</a><a>\n    </a>\n</div>\n    <h2>Data Rectification</h2>\n    <p>You can use the link below to update your account data if it is not accurate.</p>\n    <ul class=\"list-unstyled\">\n        <li><button id=\"btn-gdpr-edit-account-request\" aria-label=\"edit your account information\" aria-controls=\"form-gdpr-edit-account-request\" aria-expanded=\"false\">Edit your account information</button></li>\n    </ul>\n    <div id=\"form-gdpr-edit-account-request\">\n        <form>\n            <label for=\"form-gdpr-edit-account-request-email\">Enter your email to confirm your identity</label>\n            <input type=\"email\" name=\"email\" id=\"form-gdpr-edit-account-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\n            <input type=\"submit\" class=\"btn\" value=\"Submit\">\n        </form>\n    </div>\n    <h2>Data Portability</h2>\n    <p>You can use the links below to download all the data we store and use for a better experience in our store.</p>\n    <ul class=\"list-unstyled\">\n      <li><button id=\"btn-gdpr-requests-request\" aria-label=\"GDPR requests\" aria-controls=\"form-gdpr-data-account-request\" aria-expanded=\"false\">GDPR requests</button></li>\n      <li><button id=\"btn-gdpr-personal-information-request\" aria-label=\"personal information\" aria-controls=\"form-gdpr-data-account-request\" aria-expanded=\"false\">Personal information</button></li>\n      <li><button id=\"btn-gdpr-orders-request\" aria-label=\"orders\" aria-controls=\"form-gdpr-data-account-request\" aria-expanded=\"false\">Orders</button></li>\n    </ul>\n    <div id=\"form-gdpr-data-account-request\">\n        <form>\n            <label for=\"form-gdpr-data-account-request-email\">Enter your email to confirm your identity</label>\n            <input type=\"email\" name=\"email\" id=\"form-gdpr-data-account-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\n            <input type=\"submit\" class=\"btn\" value=\"Submit\">\n            <input type=\"hidden\" name=\"request_type\" value=\"\">\n        </form>\n    </div>\n    <h2>Access to Personal Data</h2>\n    <p>You can use the link below to request a report which will contain all personal information that we store for you.</p>\n    <ul class=\"list-unstyled\">\n      <li><button id=\"btn-gdpr-personal-data-report-request\" aria-label=\"request a report\" aria-controls=\"form-gdpr-personal-data-report-request\" aria-expanded=\"false\">Request a report</button></li>\n    </ul>\n    <div id=\"form-gdpr-personal-data-report-request\">\n        <form>\n            <label for=\"form-gdpr-personal-data-report-request-email\">Enter your email to confirm your identity</label>\n            <input type=\"email\" name=\"email\" id=\"form-gdpr-personal-data-report-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\n            <input type=\"submit\" class=\"btn\" value=\"Submit\">\n        </form>\n    </div>\n    <h2>Right to be Forgotten</h2>\n    <p>Use this option if you want to remove your personal and other data from our store. Keep in mind that <strong>this process will delete your account, so you will no longer be able to access or use it anymore</strong>.</p>\n    <ul class=\"list-unstyled\">\n      <li><button id=\"btn-gdpr-delete-account-request\" ', 'gdpr-compliance', '1', 8, '2022-03-24 11:47:58', '2022-03-24 11:47:58');
INSERT INTO `page_master` (`id`, `page_id`, `title`, `description`, `handle`, `status`, `store_user_id`, `created_at`, `updated_at`) VALUES
(302, 81539891222, 'Gift Orders', '\n    <script src=\"https://polyfill.io/v3/polyfill.min.js?features=default\"></script>\n    <link href=\"https://giftit-app.herokuapp.com/giftit-css\" rel=\"stylesheet\">\n    <link href=\"https://fonts.googleapis.com/css?family=Roboto:400,500\" rel=\"stylesheet\">\n    <script>\n        let autocomplete;\n        let address1Field;\n        let address2Field;\n        let postalField;\n\n        function initAutocomplete() {\n            address1Field = document.querySelector(\"#ship_address\");\n            address2Field = document.querySelector(\"#AddressAddress2New\");\n            postalField = document.querySelector(\"#AddressZipNew\");\n            // Create the autocomplete object, restricting the search predictions to\n            // addresses in the US and Canada.\n            autocomplete = new google.maps.places.Autocomplete(address1Field, {\n                fields: [\"address_components\", \"geometry\"],\n                types: [\"address\"],\n            });\n            address1Field.focus();\n            // When the user selects an address from the drop-down, populate the\n            // address fields in the form.\n            autocomplete.addListener(\"place_changed\", fillInAddress);\n        }\n\n        function fillInAddress() {\n            // Get the place details from the autocomplete object.\n            const place = autocomplete.getPlace();\n            let address1 = \"\";\n            let postcode = \"\";\n\n            // Get each component of the address from the place details,\n            // and then fill-in the corresponding field on the form.\n            // place.address_components are google.maps.GeocoderAddressComponent objects\n            // which are documented at http://goo.gle/3l5i5Mr\n            for (const component of place.address_components) {\n                const componentType = component.types[0];\n\n                switch (componentType) {\n                    case \"street_number\": {\n                        address1 = `${component.long_name} ${address1}`;\n                        break;\n                    }\n\n                    case \"route\": {\n                        address1 += component.short_name;\n                        break;\n                    }\n\n                    case \"postal_code\": {\n                        postcode = `${component.long_name}${postcode}`;\n                        break;\n                    }\n\n                    case \"postal_code_suffix\": {\n                        postcode = `${postcode}-${component.long_name}`;\n                        break;\n                    }\n                    case \"locality\":\n                        document.querySelector(\"#AddressCityNew\").value = component.long_name;\n                        break;\n\n                    case \"administrative_area_level_1\": {\n                        document.querySelector(\"#AddressProvinceNew\").value = component.long_name;\n                        break;\n                    }\n                    case \"country\":\n                        document.querySelector(\"#AddressCountryNew\").value = component.long_name;\n                        break;\n                }\n            }\n            address1Field.value = address1;\n            postalField.value = postcode;\n            // After filling the form with address components from the Autocomplete\n            // prediction, set cursor focus on the second address line to encourage\n            // entry of subpremise information such as apartment, unit, or floor number.\n            address2Field.focus();\n        }\n    </script>\n\n\n<div class=\"page-width\">\n    <div id=\"AddressNewForm\" class=\"form-vertical\">\n        <form action=\"https://giftit-app.herokuapp.com/update-address\" method=\"POST\" class=\"update-address\">\n            <h2>Address</h2>\n            <div class=\"giftit-gift-information\">\n                <div class=\"giftit-container\">\n                    <div class=\"giftit-input-item giftit-input-address\">\n                        <label for=\"AddressFirstNameNew\">First Name</label>\n                        <input type=\"text\" id=\"AddressFirstNameNew\" name=\"first_name\" autocomplete=\"given-name\" required>\n                    </div>\n                    <div class=\"giftit-input-item giftit-input-address\">\n                        <label for=\"AddressLastNameNew\">Last Name</label>\n                        <input type=\"text\" id=\"AddressLastNameNew\" name=\"last_name\" autocomplete=\"family-name\" required>\n                    </div>\n                </div>\n            </div>\n            <div class=\"giftit-gift-information\">\n                <div class=\"giftit-container\">\n                    <div class=\"giftit-input-item giftit-input-address\">\n                        <label for=\"AddressCompanyNew\">Company</label>\n                        <input type=\"text\" id=\"AddressCompanyNew\" name=\"company\" autocomplete=\"organization\">\n                    </div>\n                </div>\n            </div>\n            <div class=\"giftit-gift-information\">\n                <div class=\"giftit-container\">\n                    <div class=\"giftit-input-item giftit-input-address\">\n                        <label for=\"ship_address\">Ship To:</label>\n                        <input type=\"text\" id=\"ship_address\" name=\"ship_address\" autocomplete=\"off\" required>\n                    </div>\n                </div>\n            </div>\n            <div class=\"giftit-gift-information\">\n                <div class=\"giftit-container\">\n                    <div class=\"giftit-input-item giftit-input-address\">\n                        <label for=\"AddressAddress2New\">Apartment, suite, etc.</label>\n                        <input type=\"text\" id=\"AddressAddress2New\" name=\"address2\">\n                    </div>\n                </div>\n            </div>\n            <div class=\"giftit-gift-information\">\n                <div class=\"giftit-container\">\n                    <div class=\"giftit-input-item giftit-input-address\">\n                        <label for=\"AddressCityNew\">City</label>\n                        <input type=\"text\" id=\"AddressCityNew\" name=\"city\" required>\n                    </div>\n                    <div class=\"giftit-input-item giftit-input-address\">\n                        <label for=\"AddressCountryNew\">Country/Region</label>\n                        <select id=\"AddressCountryNew\" name=\"country\" required>\n                            <option value=\"Canada\">Canada</option>\n                            <option value=\"United States\">USA</option>\n                            <option value=\"Afganistan\">Afghanistan</option>\n                            <option value=\"Albania\">Albania</option>\n                            <option value=\"Algeria\">Algeria</option>\n                            <option value=\"American Samoa\">American Samoa</option>\n                            <option value=\"Andorra\">Andorra</option>\n                            <option value=\"Angola\">Angola</option>\n                            <option value=\"Anguilla\">Anguilla</option>\n                            <option value=\"Antigua &amp; Barbuda\">Antigua &amp; Barbuda</option>\n                            <option value=\"Argentina\">Argentina</option>\n                            <option value=\"Armenia\">Armenia</option>\n                            <option value=\"Aruba\">Aruba</option>\n                            <option value=\"Australia\">Australia</option>\n                            <option value=\"Austria\">Austria</option>\n                            <option value=\"Azerbaijan\">Azerbaijan</option>\n                            <option value=\"Bahamas\">Bahamas</option>\n                            <option value=\"Bahrain\">Bahrain</option>\n                            <option value=\"Bangladesh\">Bangladesh</option>\n                            <option value=\"Barbados\">Barbados</option>\n                            <option value=\"Belarus\">Belarus</option>\n                            <option value=\"Belgium\">Belgium</option>\n                            <option value=\"Belize\">Belize</option>\n                            <option value=\"Benin\">Benin</option>\n                            <option value=\"Bermuda\">Bermuda</option>\n                            <option value=\"Bhutan\">Bhutan</option>\n                            <option value=\"Bolivia\">Bolivia</option>\n                            <option value=\"Bonaire\">Bonaire</option>\n                            <option value=\"Bosnia &amp; Herzegovina\">Bosnia &amp; Herzegovina</option>\n                            <option value=\"Botswana\">Botswana</option>\n                            <option value=\"Brazil\">Brazil</option>\n                            <option value=\"British Indian Ocean Ter\">British Indian Ocean Ter</option>\n                            <option value=\"Brunei\">Brunei</option>\n                            <option value=\"Bulgaria\">Bulgaria</option>\n                            <option value=\"Burkina Faso\">Burkina Faso</option>\n                            <option value=\"Burundi\">Burundi</option>\n                            <option value=\"Cambodia\">Cambodia</option>\n                            <option value=\"Cameroon\">Cameroon</option>\n                            <option value=\"Canary Islands\">Canary Islands</option>\n                            <option value=\"Cape Verde\">Cape Verde</option>\n                            <option value=\"Cayman Islands\">Cayman Islands</option>\n                            <option value=\"Central African Republic\">Central African Republic</option>\n                            <option value=\"Chad\">Chad</option>\n                            <option value=\"Channel Islands\">Channel Islands</option>\n                            <option value=\"Chile\">Chile</option>\n                            <option value=\"China\">China</option>\n                            <option value=\"Christmas Island\">Christmas Island</option>\n                            <option value=\"Cocos Island\">Cocos Island</option>\n                            <option value=\"Colombia\">Colombia</option>\n                            <option value=\"Comoros\">Comoros</option>\n                            <option value', 'gift-orders', '1', 8, '2022-03-24 11:47:58', '2022-03-24 11:47:58'),
