(313, 81648844822, 'Order Confirmation Page', '<div class=\"section-title desktop-9 mobile-3 center-title\">\n    <h1>Confirmation Page</h1>\n</div>\n\n<div class=\"desktop-11 tablet-6 mobile-3 center-page\">\n    <div class=\"custom-class-page\">\n        <style>\n            <!--\n            .text-confirmation {\n                width: 100%;\n                max-width: 500px;\n                margin: auto;\n                text-align: center;\n                padding: 20px;\n                border-radius: 4px;\n            }\n\n            .text-confirmation a {\n                background-color: black;\n                color: white;\n                padding-top: 7px;\n                padding-bottom: 7px !important;\n                padding-left: 9px;\n                padding-right: 9px;\n                border-radius: 2px;\n                margin: auto;\n                display: block;\n                text-align: center;\n                width: 100%;\n                max-width: 200px;\n            }\n\n            h1 {\n                display: none;\n            }\n\n            -->\n        </style>\n        <div class=\"text-confirmation\">\n            <h2>Confirmed</h2>\n            <p>Thank you for being our valued customer. Your order is confirmed and will be dispatched shortly!</p>\n            <p></p>\n            <a href=\"/\" style=\"color: #fff;\"> Continue Shopping </a>\n        </div>\n        <script type=\"text/javascript\">// <![CDATA[\n            function getParameterByName(name, url) {\n                if (!url) url = window.location.href;\n                name = name.replace(/[[]]/g, \"\\$&\");\n                var regex = new RegExp(\"[?&]\" + name + \"(=([^&#]*)|&|#|$)\"),\n                    results = regex.exec(url);\n                if (!results) return null;\n                if (!results[2]) return \'\';\n                return decodeURIComponent(results[2].replace(/+/g, \" \"));\n            }\n\n            var orderId = getParameterByName(\"orderid\");\n            var xhr = new XMLHttpRequest();\n            xhr.open(\'GET\', \'https://ppsms.appsbymoose.com/order-confirmation?shop=\' + Shopify.shop + \'&orderid=\' + orderId);\n            xhr.onload = function() {\n                if (xhr.status === 200) {console.log(xhr.responseText);} else {console.log(\'error is response\');}\n            };\n            xhr.send();\n            // ]]>\n        </script>\n    </div>\n</div>', 'order-confirmation-page', '1', 8, '2022-03-24 11:47:58', '2022-03-24 11:47:58'),
(314, 81584029718, 'Order Status Lookup', '<!-- BEGIN STATUS SHERPA APP PAGE //-->\n<!-- This page was created and is managed by the Status Sherpa app you have installed.\n     To make changes to text or styling on this page, open the Status Sherpa app (you\n     can click the More Actions dropdown above or click Apps at far left to open the\n     Status Sherpa app) in your dashboard and click Settings. If you have removed the\n     Status Sherpa app, you can safely remove this page and be sure to also remove any\n     navigation links to this page in your Shopify configuration. //-->\n<style data-cfasync=\"false\">\n.sherpa-hidden-message{display:none !important;}\nbody[contenteditable=\"true\"] .sherpa-hidden-message,body#tinymce .sherpa-hidden-message{display:block !important;}\nbody[contenteditable=\"true\"] .sherpa-hidden-message *,body#tinymce .sherpa-hidden-message *{color:#2c6ecb !important;}\nbody[contenteditable=\"true\"] .sherpa-fieldset{border:0 !important;}\nbody[contenteditable=\"true\"] .sherpa-fieldset > label{display:block !important;}\nbody[contenteditable=\"true\"] .sherpa-fieldset#sherpa-fieldset-order-phone{display:none !important;}\n</style>\n<link rel=\"stylesheet\" href=\"https://sherpa-app-cdn.sinelabs.com/sherpa-app.min.css\">\n<style data-cfasync=\"false\">@media all and (min-width:750px){div#sherpa-wrap form#sherpa-order-form{width:50%;} }</style>\n\n<script defer data-cfasync=\"false\" type=\"text/javascript\">const sherpaConfig = {\'shop_hash\': \'be391d6c2b5fa8da639ccac923521b0a4bcedc45fd0241f8385edad3998e53c4\', \'proxy_url\': \'/a/status-sherpa/\', \'page\': {\'is_enabled\': 1, \'handle\': \'status-lookup\', \'fields\': [\'em\', \'no\']}, \'text\': {\'language\': \'en\', \'defaults\': {\'title\': \'Order Status Lookup\', \'intro\': \'Enter your order number and email address below to view an order summary and current status.\', \'seo_title\': \'Order Status Lookup\', \'seo_desc\': \'View your order summary and its current status using the simple lookup form on this page.\', \'label_em\': \'Order email\', \'label_no\': \'Order #\', \'label_dt\': \'Order date\', \'label_zp\': \'Order ZIP\', \'label_ph\': \'Order phone\', \'place_em\': \'name@email.com\', \'place_no\': \'#100\', \'place_dt\': \'\', \'place_zp\': \'\', \'place_ph\': \'\', \'tip_em\': \'\', \'tip_no\': \'\', \'tip_dt\': \'\', \'tip_zp\': \'\', \'tip_ph\': \'\', \'button\': \'Lookup order status\', \'required\': \'Required\', \'invalid\': \'Invalid\', \'success\': \'Order located - loading status page, or <a href=\"[url]\">click here</a>\', \'failure\': \'Matching order not found\', \'error\': \'There was a problem looking up your order, please try again later\'}, \'custom\': {}}, \'styling\': {\'intro_text_size\': \'\', \'label_text_size\': \'\', \'input_text_size\': \'\', \'button_text_size\': \'\', \'button_bgcolor\': \'\', \'button_color\': \'\', \'custom_css\': \'\', \'form_width_wide\': \'50%\'}, \'classes\': {\'wrap\': \'\', \'intro\': \'\', \'form\': \'\', \'label\': \'\', \'input\': \'\', \'button\': \'\'}};</script>\n<script defer data-cfasync=\"false\" type=\"text/javascript\" src=\"https://sherpa-app-cdn.sinelabs.com/sherpa-app.min.js\"></script>\n<div class=\"sherpa-hidden-message\">\n  <p><b>NOTE:</b>\n    This page was created and is managed by the Status Sherpa app you have installed.\n    To make changes to text or styling on this page, open the Status Sherpa app (you\n    can click the More Actions dropdown above or click Apps at far left to open the\n    Status Sherpa app) in your dashboard and click Settings. If you have removed the\n    Status Sherpa app, you can safely remove this page and be sure to also remove any\n    navigation links to this page in your Shopify configuration.</p>\n</div>\n<div id=\"sherpa-wrap\" class=\"\">\n  <div id=\"sherpa-intro\" class=\"\">Enter your order number and email address below to view an order summary and current status.</div>\n  <form id=\"sherpa-order-form\" class=\"\" novalidate>\n    <input type=\"hidden\" id=\"sherpa-ts\" name=\"ts\" value=\"\">\n    <input type=\"hidden\" id=\"sherpa-ht\" name=\"ht\" value=\"\">\n    \n    <fieldset class=\"sherpa-fieldset\">\n      <label for=\"sherpa-order-em\" class=\"sherpa-field-label sherpa-field-required \">Order email</label>\n      <span id=\"sherpa-order-em-error\" class=\"sherpa-field-error\"></span>\n      <input id=\"sherpa-order-em\" class=\"sherpa-field-input \" type=\"email\" name=\"em\" placeholder=\"name@email.com\" value=\"\" required>\n      <span id=\"sherpa-order-em-tip\" class=\"sherpa-field-tip\"></span>\n    </fieldset>\n    \n    \n    <fieldset class=\"sherpa-fieldset\">\n      <label for=\"sherpa-order-no\" class=\"sherpa-field-label sherpa-field-required \">Order #</label>\n      <span id=\"sherpa-order-no-error\" class=\"sherpa-field-error\"></span>\n      <input id=\"sherpa-order-no\" class=\"sherpa-field-input \" type=\"text\" name=\"no\" placeholder=\"#100\" value=\"\" required>\n      <span id=\"sherpa-order-no-tip\" class=\"sherpa-field-tip\"></span>\n    </fieldset>\n    \n    \n    \n    <fieldset id=\"sherpa-fieldset-order-phone\" class=\"sherpa-fieldset\">\n      <label>Order phone</label>\n      <input id=\"sherpa-order-ph\" type=\"text\" name=\"phone\" value=\"\">\n    </fieldset>\n    <fieldset id=\"sherpa-fieldset-order-button\" class=\"sherpa-fieldset\">\n      <input id=\"sherpa-order-button\" class=\"\" type=\"submit\" value=\"Lookup order status\">\n      <div id=\"sherpa-working\"></div>\n      <div id=\"sherpa-error-message\"></div>\n      <div id=\"sherpa-success-message\"></div>\n    </fieldset>\n  </form>\n</div>\n<!-- END STATUS SHERPA APP PAGE //-->\n', 'status-lookup', '1', 8, '2022-03-24 11:47:58', '2022-03-24 11:47:58'),
(315, 86338174998, 'Order Tracking Form', '<div id=\"order-lookup-by-hulkapps\">\n    <div class=\"container\">\n\n        <div class=\"page-loading\" style=\"display: none;\"><i class=\"fas fa-circle-notch fa-spin\"></i></div>\n\n        <section id=\"search-page\" class=\"find-order\" style=\"display: none;\">\n            <div class=\"heading\">\n                <h3 id=\"search-form-title\">order tracker</h3>\n            </div>\n            <div class=\"order-track-form\">\n                <div id=\"input-email\" class=\"input-wrap\">\n                    <label>email address </label>\n                    <input type=\"text\" class=\"order-track-input\" name=\"email\">\n                </div>\n                <div id=\"input-orderid\" class=\"input-wrap\">\n                    <label>order number</label>\n                    <input type=\"text\" class=\"order-track-input\" name=\"order_number\">\n                </div>\n                <button type=\"button\" class=\"btn\">find order</button>\n            </div>\n        </section>\n\n        <section id=\"orders-page\" class=\"order-list\" style=\"display: none;\">\n            <h3>We found multiple active orders from your account please choose orders below to see more details.</h3>\n            <div class=\"go-back\"><a href=\"#\"><i class=\"fas fa-angle-double-left\"></i> Back</a></div>\n            <table cellspacing=\"0\">\n                <thead>\n                <tr>\n                    <th>Order</th>\n                    <th>Order date</th>\n                    <th>Action</th>\n                </tr>\n                </thead>\n                <tbody>\n                </tbody>\n            </table>\n        </section>\n\n        <div id=\"result-page\" style=\"display: none;\">\n\n\n\n        </div>\n    </div>\n</div>\n', 'order-tracking-form', '1', 8, '2022-03-24 11:47:58', '2022-03-24 11:47:58'),
(316, 81563320342, 'Our stores', '<!-- <script src=\"https://code.jquery.com/jquery-2.2.4.min.js\" integrity=\"sha256-BbhdlvQf/xTY9gja0Dq3HiwQF8LaCRTXxZKRutelT44=\" crossorigin=\"anonymous\"></script> -->\r\n<script type=\"text/javascript\">\r\n    var loadScript = function(url, callback) {\r\n        var script = document.createElement(\"script\");\r\n        script.type = \"text/javascript\";\r\n        if (script.readyState) {\r\n            script.onreadystatechange = function() {\r\n                if (script.readyState == \"loaded\" || script.readyState == \"complete\") {\r\n                    script.onreadystatechange = null;\r\n                    callback()\r\n                }\r\n            }\r\n        } else {\r\n            script.onreadystatechange = callback;\r\n            script.onload = callback\r\n        }\r\n        script.src = url;\r\n        var x = document.getElementsByTagName(\'script\')[0];\r\n        x.parentNode.insertBefore(script, x)\r\n    };\r\n    if (typeof jQuery === \'undefined\') {\r\n        loadScript(\'//code.jquery.com/jquery-2.2.4.min.js\', function() {\r\n            initStoreLocator();\r\n            console.log(\'StoreLocator with a third-party jquery\');\r\n        });\r\n    } else if (typeof $ === \'undefined\') {\r\n        loadScript(\'//code.jquery.com/jquery-2.2.4.min.js\', function() {\r\n            initStoreLocator();\r\n            console.log(\'StoreLocator with a third-party jquery\');\r\n        });\r\n    } else {\r\n        jQuery(document).ready(function() {\r\n            initStoreLocator();\r\n        });\r\n    }\r\n</script>\r\n<script async=\"\" defer src=\"https://maps.googleapis.com/maps/api/js?key=AIzaSyAS7pCgpXPWQWYD3oC90eiwFbmGcTwdJcs&amp;libraries=geometry\"></script>\r\n<style><!--\n  .list-group-item {\n	  position: relative;\n	  display: block;\n	  padding: 10px 15px;\n	  margin-bottom: -1px;\n	  background-color: #fff;\n	  border: 1px solid #ddd;\n  }\n  .storepickup-content {\n   width:25%;\n   display: inline-block;\n  }\n  .loaded-map {\n	  display: inline-block;\n	  width: 75%;\n  }\n  #currency_widget_map {\n	width:100%;\n	height:100%;\n	min-height:550px;\n  }\n  .map-index {\n	margin-top: 20px;\n	  display: flex;\n  }\n  .storepickup-data .bfh-selectbox-options {\n	width: 100%;\n  }\n  .storepickup-data .bfh-selectbox-options ul {\n	max-width: none;\n  }\n  .storepickup-data .store-list {\n	max-height: 550px;\n	overflow: auto;\n  }\n  .storepickup-data .store-list .store-list-item {\n	cursor: pointer;\n	-webkit-transition: all ease-in-out 0.2s;\n	-moz-transition: all ease-in-out 0.2s;\n	-ms-transition: all ease-in-out 0.2s;\n	-o-transition: all ease-in-out 0.2s;\n	transition: all ease-in-out 0.2s;\n  }\n  .storepickup-data .store-list .store-list-item:hover {\n  cursor: pointer;\n  -moz-box-shadow: inset 0px 0px 20px -10px #000;\n  -webkit-box-shadow: inset 0px 0px 20px -10px #000;\n  box-shadow: inset 0px 0px 20px -10px #000;\n  background-color: #8ea6af;\n  background-position: 0 -15px;\n  }\n  .storepickup-data .store-list .store-list-item.active {\n	cursor: pointer;\n	-moz-box-shadow: inset 0px 0px 20px -10px #000;\n	-webkit-box-shadow: inset 0px 0px 20px -10px #000;\n	box-shadow: inset 0px 0px 20px -10px #000;\n	background-color: #1f90bb;\n	background-position: 0 -15px;\n  }\n\n  .storepickup-data .store-list .store-list-item:hover .store-name,\n  .storepickup-data .store-list .store-list-item.active .store-name,\n  .storepickup-data .store-list .store-list-item:hover p,\n  .storepickup-data .store-list .store-list-item.active p,\n  .storepickup-data .store-list .store-list-item:hover .store-office,\n  .storepickup-data .store-list .store-list-item.active .store-office,\n  .storepickup-data .store-list .store-list-item:hover .store-email,\n  .storepickup-data .store-list .store-list-item.active .store-email {\n	color: #ffffff!important;\n  }\n  .storepickup-data .store-list .store-list-item .store-name {\n	margin: 0;\n	padding: 5px 0 5px 0;\n	color: #34658e;\n	font-size: 18px;\n  }\n  .storepickup-data .store-list .store-list-item p {\n	margin: 0;\n	padding: 0;\n	font-size: 12px;\n	font-weight: 400;\n	color: #333;\n  }\n  .storepickup-data .store-list .store-list-item .store-office {\n	display: inline-block;\n	font-size: 12px;\n	font-weight: 500;\n	margin-right: 8px;\n	color: #333;\n  }\n  .storepickup-data .store-list .store-list-item .store-office:last-child {\n	margin-right: 0;\n	margin-top: 5px;\n  }\n  .storepickup-data .google-map-holder {\n	height: 500px;\n	position: relative;\n  }\n  .storepickup-data .google-map-holder #currency_widget_map {\n	display: inline-block;\n	position: absolute;\n	top: 0;\n	left: 0;\n	right: 0;\n	bottom: 0;\n	border: 1px solid #DBDBDB;\n	-webkit-border-radius: 3px;\n	-moz-border-radius: 3px;\n	border-radius: 3px;\n	-moz-background-clip: padding;\n	-webkit-background-clip: padding-box;\n	background-clip: padding-box;\n	-webkit-box-sizing: border-box;\n	-moz-box-sizing: border-box;\n	box-sizing: border-box;\n  }\n  .storepickup-data .gm-style img {\n	max-width: initial;\n	margin: auto;\n  }\n  .storepickup-data {\n      width:100%!important;\n      max-width:100%!important;\n  }\n  #infowindow-content {\n      display: none;\n    }\n    #currency_widget_map #infowindow-content {\n      display: inline;\n    }\n  @media (min-width: 320px) and (max-width: 480px) {\n	  .map-index {\n		  display:block!important;\n	  }\n      .storepickup-content {\n          max-height: 269px!important;\n      }\n	  .storepickup-content,.loaded-map  {\n			display: block;\n			float: left;\n			width: 100%;\n			padding: 10px;\n		  }\n	  .storepickup-data .store-list {\n		  margin: 0;\n	  }\n      #myInput {\n          width:100%!important;\n      }\n      .autocomplete-items {\n          width:100%!important;\n          left:0!important;\n      }\n  }\n  .store-office img {\n      margin-bottom: -5px;\n  }\n  @media (min-width: 1025px) {\n      .storepickup-content,.loaded-map  {\n          padding-right: 15px!important;\n      }\n  }\n  .storepickup-content {\n      overflow-y: scroll;\n      max-height: 550px;\n  }\n\n  .autocomplete {\n    position: relative;\n    display: inline-block;\n  }\n\n    input {\n      border: 1px solid transparent;\n      background-color: #f1f1f1;\n      padding: 10px;\n      font-size: 16px;\n    }\n\n    #myInput {\n      background-color: #f1f1f1;\n      width: 50%;\n    }\n\n    input[type=submit] {\n      background-color: DodgerBlue;\n      color: #fff;\n      cursor: pointer;\n    }\n\n    .autocomplete-items {\n      position: absolute;\n      border: 1px solid #d4d4d4;\n      border-bottom: none;\n      border-top: none;\n      z-index: 99;\n      /*position the autocomplete items to be the same width as the container:*/\n      top: 100%;\n      left: 25%;\n      right: 0;\n      text-align:left;\n      max-height: 540px;\n      overflow-y: scroll;\n      overflow: auto;\n      width: 50%;\n    }\n\n    .autocomplete-items div {\n      padding: 10px;\n      cursor: pointer;\n      background-color: #fff;\n      border-bottom: 1px solid #d4d4d4;\n      margin: 0 auto;\n    }\n\n    .store-locator-form {\n        overflow: visible;\n    }\n\n    /*when hovering an item:*/\n    .autocomplete-items div:hover {\n      background-color: #e9e9e9;\n    }\n    .gm-bundled-control-on-bottom {\n        visibility:visible !important;\n    }\n    @media only screen and (max-width: 989px)\n                       and (orientation: landscape) {\n\n                           #myInput {\n                               width:100%!important;\n                           }\n                           .autocomplete-items {\n                               width:100%!important;\n                               left:0!important;\n                           }\n                       }\n    /*when navigating through the items using the arrow keys:*/\n    .autocomplete-active {\n      background-color: DodgerBlue !important;\n      color: #ffffff;\n    }\n    .working_hours, .store-office {\n        align-items: center;\n        display: flex;\n        color: #000;\n    }\n    .storepickup-data>a, .site_url {\n        font-size: 12px!important;\n    }\n    .page-description:empty {\n      padding: 0px!important;\n    }\n    .page-description {\n      text-align: center;\n      padding: 0px 25% 10px 25%;\n      word-wrap: break-word;\n    }\n--></style>\r\n<style name=\"isense-storepickup\" type=\"text/css\"></style>\r\n<p class=\"page-description\"></p>\r\n<form class=\"store-locator-form\" autocomplete=\"off\">\r\n<div class=\"autocomplete\" style=\"text-align: center; width: 100%; margin: 0 auto;\"><input id=\"myInput\" type=\"text\" name=\"searchByName\"></div>\r\n</form>\r\n<div class=\"map-index row\">\r\n<div class=\"storepickup-content\"></div>\r\n<div class=\"loaded-map\">\r\n<div class=\"widget-map-holder\">\r\n<div id=\"currency_widget_map\"></div>\r\n<div id=\"infowindow-content\">\r\n<span id=\"store-name\" class=\"title\">test</span><br> <span id=\"store-address\" class=\"title\">test</span><br> <span id=\"store-phone\" class=\"title\">test</span><br> <span id=\"store-email\" class=\"title\">test</span>\r\n</div>\r\n</div>\r\n</div>\r\n<script type=\"text/map-styles\" id=\"store-map-styles\">// <![CDATA[\r\n[]\r\n// ]]></script>\r\n<script type=\"text/javascript\">\r\nvar initStoreLocator = function() {\r\n	  var stores = {}\r\n	  var defaultStore = null;\r\n	  var offices_map = null;\r\n      var detect_markers = false;\r\n      var detect_location = false;\r\n      var infowindow = null;\r\n      var marker = null;\r\n      var working_hour_text = (Shopify.locale == \'es\') ? \'Horas Laborales\': \'Working hours\';\r\n     // var search_placeholder_text = (Shopify.locale == \'es\') ? \'Buscar nuestras tiendas\': \'Search our stores\';\r\n      if(Shopify.locale == \'es\') {\r\n          var search_placeholder_text = \'Buscar nuestras tiendas\';\r\n      } else if(Shopify.locale == \'fr\') {\r\n          var search_placeholder_text = \'Trouver nos points de vente\';\r\n      } else if(Shopify.shop == \'jack-jill-dog-diapers.myshopify.com\') {\r\n        var search_placeholder_text = \'Search for a store near you enter city\';\r\n      }  else if(Shopify.shop == \'kevin-orthopedic.myshopify.com\') {\r\n        var search_placeholder_text = \'Search clinics or doctors\';\r\n      } else if(Shopify.shop == \'renolit-artyard.myshopify.com\') {\r\n        var search_placeholder_text = \'Finden Sie jetzt einen Partner in Ihrer Nähe\';\r\n      } ', 'our-stores', '1', 8, '2022-03-24 11:47:58', '2022-03-24 11:47:58'),
