(325, 79318450198, 'Recurring Payment', '<style>\n            .form{\n              padding: 20px;\n              text-align: center;\n              border: 1px solid #ccc;\n              border-radius: 3px;\n            }\n          \n            .form .input{\n              margin-bottom: 15px;\n            }\n          \n            .form .input label{\n              font-size: 17px; \n          \n            }\n          \n            .form .btn{\n              border-radius: 3px;\n              background: #3e82b0;\n              padding: 10px 18px;\n              color: white;\n              cursor: pointer;\n              text-align: center;\n              display: inline-block;\n              border: 1px solid #3e82b0; \n            }\n          \n          \n            .orders ul {\n              display: flex;\n              flex-direction: column;\n              font-size: 14px;\n              color: #333;\n              letter-spacing: 0.2px;\n              margin: 20px 0px;\n            }\n            .orders ul li {\n              list-style: none;\n              padding: 5px 10px;\n              cursor: pointer;\n              border-bottom: 1px solid #e4e4e4;\n            }\n            .orders ul li:hover {\n              background-color: #e4e4e4;\n            }\n            .orders ul li .order {\n              display: flex;\n              align-items: flex-start;\n              justify-content: space-between;\n            }\n            .orders ul li .order .left {\n              display: flex;\n            }\n            .orders ul li .order .left .img {\n              width: 90px;\n              margin-right: 10px;\n            }\n            .orders ul li .order .right-content {\n              text-align: right;\n            }\n            .orders ul li .order .right-content .badge {\n              margin: 0 0px 5px 0;\n            }\n            .orders ul li .order .right-content .fulfilment p {\n              border-radius: 18px;\n              padding: 4px 8px;\n              text-transform: uppercase;\n              font-size: 12px;\n              line-height: 12px;\n              border: 1px solid;\n              margin: 0 0px 5px 0;\n              color: #fff;\n              display: inline-block;\n            }\n            .orders ul li .order .right-content .fulfilment p.UNFULFILLED {\n              background-color: #d43f3a;\n            }\n            .orders ul li .order .label {\n              font-size: 17px;\n              display: flex;\n              justify-content: space-between;\n            }\n            .orders ul li .order .f-14 {\n              font-size: 14px;\n            }\n          \n            .overlay {\n              position: fixed;\n              top: 0;\n              bottom: 0;\n              left: 0;\n              right: 0;\n              background: rgba(0, 0, 0, 0.7);\n              transition: opacity 500ms;\n              visibility: hidden;\n              opacity: 0;\n          \n              &.active {\n                visibility: visible;\n                opacity: 1;\n                z-index: 1;\n              }\n          \n              .popup {\n                margin: 70px auto;\n                padding: 20px;\n                background: #fff;\n                border-radius: 5px;\n                width: 30%;\n                position: relative;\n                transition: all .4s ease-in-out;\n                max-width: 480px;\n          \n                @media screen and (max-width: 700px) {\n                  width: 70%;\n                }\n          \n                h2,\n                h3 {\n                  margin-top: 0;\n                  color: #333;\n                  font-family: Tahoma, Arial, sans-serif;\n                  margin-bottom: 20px;\n                  padding-right: 40px;\n                }\n          \n                .close {\n                  position: absolute;\n                  top: 20px;\n                  right: 30px;\n                  transition: all 200ms;\n                  font-size: 30px;\n                  font-weight: bold;\n                  text-decoration: none;\n                  color: #333;\n          \n                  &:hover {\n                    color: #337ab7;\n                  }\n                }\n          \n                .content {\n                  max-height: 30%;\n                  overflow: auto;\n                  padding-bottom: 20px;\n                }\n              }\n            }\n          \n            .custom-btn{\n              margin-right: 5px; \n            }\n          </style>\n          <div class=\"page-width\">\n            <div class=\"grid\">\n              <div class=\"grid__item medium-up--five-sixths medium-up--push-one-twelfth\">\n                <div class=\"rte\">\n                  <div class=\"recurring-content\">\n                    <div class=\"form\">\n                      <div class=\"input input-with-icon\">\n                        <label>Enter Your Email to get Subscription Contracts</label> <input name=\"customer_email\" id=\"customer_email\" type=\"email\">\n                      </div>\n                      <button class=\"btn\" onclick=\"getSubscriptionContracts()\">Submit</button>\n                    </div>\n                    <div class=\"orders\">\n                      <ul id=\"subscriptioList\"></ul>\n                    </div>\n                  </div>\n          \n                </div>\n              </div>\n            </div>\n          </div>\n          <script>\n            function getSubscriptionContracts(){\n              try {\n                let email = document.getElementById(\"customer_email\").value;\n          \n                let xmlHttp = new XMLHttpRequest();\n                xmlHttp.open(\"get\", \"https://recurring-payment-api.webrexstudio.com/getSubscriptionContract?email=\"+email, true);\n                xmlHttp.setRequestHeader(\"Content-Type\", \"application/json\");\n                xmlHttp.onreadystatechange = function () {\n                  try {\n                    if (xmlHttp.readyState == 4 && xmlHttp.status == 200) {\n                      appendContracts(JSON.parse(xmlHttp.responseText));\n                    } \n                  } catch (error) {\n                    console.log(\"Error:httpGetAsync-\", error);\n                  }\n                };\n                xmlHttp.send();\n              } catch (error) {\n                throw error;\n              }\n            }\n          \n            function appendContracts(data){\n              console.log(data.data, \"objjjjjj\")\n              for(let contract of data.data){\n                let contractLi = document.createElement(\"li\");\n          \n                let buttons = \"\";\n                if(contract.subscriptionData.status != \"ACTIVE\"){\n                  buttons += \'<button class=\"btn custom-btn\" onclick=\"updateContract(\'+contract.subscriptionContractId+\', \"active\")\"> Active </button>\'\n                }\n                if(contract.subscriptionData.status != \"CANCEL\"){\n                  buttons += \'<button class=\"btn custom-btn\" onclick=\"updateContract(\'+contract.subscriptionContractId+\', \"cancel\")\"> cancel </button>\'\n                }\n                if(contract.subscriptionData.status != \"PAUSE\"){\n                  buttons += \'<button class=\"btn custom-btn\" onclick=\"updateContract(\'+contract.subscriptionContractId+\', \"pause\")\"> Pause </button>\'\n                }\n          \n                contractLi.innerHTML = \'<div class=\"order\">\'\n          +\'<div class=\"left\">\'\n          +\'<div class=\"img\">\'\n          +\'<img src=\"\'+contract.subscriptionData.lines.edges[0].node.variantImage.originalSrc+\'\" alt=\"\">\'\n          +\'</div>\'\n          +\'<div class=\"left-content\">\'\n          +\'<div class=\"label\">\'\n          +\'<label for=\"\">\'+contract.subscriptionData.lines.edges[0].node.title +\' </label>\'\n          +\'  </div>\'\n          +\'  </div>\'\n          +\'  </div>\'\n          +\'<div class=\"right\">\'\n          +\'<div class=\"label\">\'\n          +\'<label for=\"\">Total: </label>\'\n          +\'<span>\'+ (parseFloat(contract.subscriptionData.deliveryPrice.amount) + parseFloat(contract.subscriptionData.lines.edges[0].node.currentPrice.amount)).toFixed(2) +\'</span>\'\n          +\'  </div>\'\n          +\'<div class=\"label\">\'\n          \n          +buttons\n          +\'  </div>\'\n          +\'  </div>\'\n          +\'  </div>\';\n          \n                document.getElementById(\"subscriptioList\").appendChild(contractLi);\n              }\n          \n            }\n          \n          \n            function updateContract(contractId, action){\n              try{\n          \n                let payload ={\n                  subscriptionContractId: contractId,\n                  action: action,\n                  shopUrl: Shopify.shop\n                }\n          \n                let xmlHttp = new XMLHttpRequest();\n                xmlHttp.open(\"post\", \"https://recurring-payment-api.webrexstudio.com/subscriptionContract\");\n                //       xmlHttp.setRequestHeader(\"Content-type\", \"application/x-www-form-urlencoded\");\n                xmlHttp.setRequestHeader(\"Content-Type\", \"application/json\");\n                xmlHttp.onreadystatechange = function () {\n                  try {\n                    if (xmlHttp.readyState == 4 && xmlHttp.status == 200) {\n                      appendContracts(JSON.parse(xmlHttp.responseText));\n                    } \n                  } catch (error) {\n                    console.log(\"Error:httpGetAsync-\", error);\n                  }\n                };\n                xmlHttp.send(JSON.stringify(payload));\n              } catch (error) {\n                throw error;\n              }\n            }\n          </script>', 'recurring-payment', '1', 8, '2022-03-24 11:47:58', '2022-03-24 11:47:58'),
