(357, 81374412822, 'CCPA Compliance', '<style>\n    #form-ccpa-edit-account-request,\n    #form-ccpa-data-account-request,\n    #form-ccpa-personal-data-report-request,\n    #form-ccpa-delete-account-request {\n        display: none;\n    }\n    #ccpa_page button {\n      background-color: transparent;\n      border: 0;\n      border-bottom: 1px solid black;\n      padding: 0px;\n    }\n\n    /* Modal background */\n    #data-verification-background {\n      display: none;\n      position: fixed;\n      z-index: 1;\n      padding-top: calc(50vh - 83px);\n      left: 0;\n      top: 0;\n      width: 100%;\n      height: 100%;\n      overflow: auto;\n      background-color: rgb(0,0,0);\n      background-color: rgba(0,0,0,0.4);\n      opacity: unset;\n      z-index: 9999;\n    }\n    /* Modal Content */\n    #data-verification-modal {\n      background-color: #fefefe;\n      margin: auto;\n      padding: 16px;\n      border: 1px solid #888;\n      width: 38%;\n    }\n    /* Modal Close Button */\n    .data-verification-close {\n      color: #aaaaaa;\n      float: right;\n      font-size: 28px;\n      font-weight: bold;\n      line-height: 17px;\n    }\n    .data-verification-close:hover,\n    .data-verification-close:focus {\n      color: #000;\n      text-decoration: none;\n      cursor: pointer;\n    }\n    /* Checkbox Text */\n    #data-verification-container p{\n      display: inline-block;\n      padding-left: 5px;\n      vertical-align: top;\n      width: calc(100% - 45px);\n      cursor: pointer;\n    }\n    #data-verification-container a, #data-verification-container a:hover{\n      text-decoration: underline!important;\n      color: #4285f4;\n    }\n    /* Checkbox Icon */\n    #data-verification-icon {\n      cursor: pointer;\n      position: relative;\n      margin: auto;\n      width: 18px;\n      height: 18px;\n      -webkit-tap-highlight-color: transparent;\n      transform: translate3d(0, 0, 0);\n      margin-top: 2px;\n    }\n    #data-verification-icon:before {\n      content: \"\";\n      position: absolute;\n      top: -7px;\n      left: -7px;\n      width: 32px;\n      height: 32px;\n      border-radius: 50%;\n      background: rgba(34,50,84,0.03);\n      opacity: 0;\n      transition: opacity 0.2s ease;\n    }\n    #data-verification-icon svg {\n      position: relative;\n      z-index: 1;\n      fill: none;\n      stroke-linecap: round;\n      stroke-linejoin: round;\n      stroke: #c8ccd4;\n      stroke-width: 1.5;\n      transform: translate3d(0, 0, 0);\n      transition: all 0.2s ease;\n    }\n    #data-verification-icon svg path {\n      stroke-dasharray: 60;\n      stroke-dashoffset: 0;\n    }\n    #data-verification-icon svg polyline {\n      stroke-dasharray: 22;\n      stroke-dashoffset: 66;\n    }\n    #data-verification-icon:hover:before {\n      opacity: 1;\n    }\n    #data-verification-container:hover #data-verification-icon svg {\n      stroke: #4285f4;\n    }\n    #data-verification-icon.clicked svg {\n      stroke: #4285f4;\n    }\n    #data-verification-icon.clicked svg path {\n      stroke-dashoffset: 60;\n      transition: all 0.3s linear;\n    }\n    #data-verification-icon.clicked svg polyline {\n      stroke-dashoffset: 42;\n      transition: all 0.2s linear;\n      transition-delay: 0.15s;\n    }\n\n    /* Modal changes on mobile resolution*/\n    @media only screen and (max-width: 600px) {\n      #data-verification-modal {\n        width: 90%;\n      }\n    }\n\n    /* Loading Element */\n    .loading {\n        display: none;\n        top:50vh;\n        left:50vw;\n        position:fixed;\n    }\n    .loading:not(:required):after {\n      content: \'\';\n      display: block;\n      font-size: 10px;\n      width: 1em;\n      height: 1em;\n      margin-top: -0.5em;\n      -webkit-animation: spinner 1500ms infinite linear;\n      -moz-animation: spinner 1500ms infinite linear;\n      -ms-animation: spinner 1500ms infinite linear;\n      -o-animation: spinner 1500ms infinite linear;\n      animation: spinner 1500ms infinite linear;\n      border-radius: 0.5em;\n      -webkit-box-shadow: rgba(255,255,255, 1) 1.5em 0 0 0, rgba(255,255,255, 1) 1.1em 1.1em 0 0, rgba(255,255,255, 1) 0 1.5em 0 0, rgba(255,255,255, 1) -1.1em 1.1em 0 0, rgba(255,255,255, 1) -1.5em 0 0 0, rgba(255,255,255, 1) -1.1em -1.1em 0 0, rgba(255,255,255, 1) 0 -1.5em 0 0, rgba(255,255,255, 1) 1.1em -1.1em 0 0;\n      box-shadow: rgba(255,255,255, 1) 1.5em 0 0 0, rgba(255,255,255, 1) 1.1em 1.1em 0 0, rgba(255,255,255, 1) 0 1.5em 0 0, rgba(255,255,255, 1) -1.1em 1.1em 0 0, rgba(255,255,255, 1) -1.5em 0 0 0, rgba(255,255,255, 1) -1.1em -1.1em 0 0, rgba(255,255,255, 1) 0 -1.5em 0 0, rgba(255,255,255, 1) 1.1em -1.1em 0 0;\n    }\n\n    /* Animation */\n    @-webkit-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @-moz-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @-o-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n</style>\r\n<div id=\"ccpa_page\" class=\"col-sm-12\">\r\n    <div class=\"text-center\">\r\n        The app used for assuring the GDPR/CCPA compliance of this site, collects your IP and the email address in order to process the data. For more check <a href=\"https://gdprcdn.b-cdn.net/pages/privacy_policy\" target=\"_blank\"> Privacy Policy</a><a>\r\n    </a>\n</div>\r\n    <h2>Data Rectification</h2>\r\n    <p>You can use the link below to update your account data if it is not accurate.</p>\r\n    <ul class=\"list-unstyled\">\r\n        <li><button id=\"btn-ccpa-edit-account-request\" aria-label=\"edit your account information\" aria-controls=\"form-ccpa-edit-account-request\" aria-expanded=\"false\">Edit your account information</button></li>\r\n    </ul>\r\n    <div id=\"form-ccpa-edit-account-request\">\r\n        <form>\r\n          <label for=\"form-ccpa-edit-account-request-email\">Enter your email to confirm your identity</label>\r\n          <input type=\"email\" name=\"email\" id=\"form-ccpa-edit-account-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\r\n          <input type=\"submit\" class=\"btn\" value=\"Submit\">\r\n        </form>\r\n    </div>\r\n    <h2>Data Portability</h2>\r\n    <p>You can use the links below to download all the data we store and use for a better experience in our store.</p>\r\n    <ul class=\"list-unstyled\">\r\n        <li><button id=\"btn-ccpa-requests-request\" aria-label=\"CCPA requests\" aria-controls=\"form-ccpa-data-account-request\" aria-expanded=\"false\">CCPA requests</button></li>\r\n        <li><button id=\"btn-ccpa-personal-information-request\" aria-label=\"personal information\" aria-controls=\"form-ccpa-data-account-request\" aria-expanded=\"false\">Personal information</button></li>\r\n        <li><button id=\"btn-ccpa-orders-request\" aria-label=\"orders\" aria-controls=\"form-ccpa-data-account-request\" aria-expanded=\"false\">Orders</button></li>\r\n    </ul>\r\n    <div id=\"form-ccpa-data-account-request\">\r\n        <form>\r\n            <label for=\"form-ccpa-data-account-request-email\">Enter your email to confirm your identity</label>\r\n            <input type=\"email\" name=\"email\" id=\"form-ccpa-data-account-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\r\n            <input type=\"submit\" class=\"btn\" value=\"Submit\">\r\n            <input type=\"hidden\" name=\"request_type\" value=\"\">\r\n        </form>\r\n    </div>\r\n    <h2>Access to Personal Data</h2>\r\n    <p>You can use the link below to request a report which will contain all personal information that we store for you.</p>\r\n    <ul class=\"list-unstyled\">\r\n      <li><button id=\"btn-ccpa-personal-data-report-request\" aria-label=\"request a report\" aria-controls=\"form-ccpa-personal-data-report-request\" aria-expanded=\"false\">Request a report</button></li>\r\n    </ul>\r\n    <div id=\"form-ccpa-personal-data-report-request\">\r\n        <form>\r\n            <label for=\"form-ccpa-personal-data-report-request-email\">Enter your email to confirm your identity</label>\r\n            <input type=\"email\" name=\"email\" id=\"form-ccpa-personal-data-report-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\r\n            <input type=\"submit\" class=\"btn\" value=\"Submit\">\r\n        </form>\r\n    </div>\r\n    <h2>Right to be Forgotten</h2>\r\n    <p>Use this option if you want to remove your personal and other data from our store. Keep in mind that <strong>this process will delete your account, so you will no longer be able to access or use it anymore</strong>.</p>\r\n    <ul class=\"list-unstyled\">\r\n      <li>', 'ccpa-compliance', '1', 10, '2022-04-09 10:04:28', '2022-04-09 10:04:28'),
(358, 81666441238, 'Compare Page', 'Product Compare', 'compare-page', '1', 10, '2022-04-09 10:04:28', '2022-04-09 10:04:28'),
(359, 81539923990, 'Complete Purchase', '<body>\n    <link href=\"https://giftit-app.herokuapp.com/giftit-css\" rel=\"stylesheet\">\n\n\n    <div class=\"giftit-loading\">\n        <div class=\"giftit-loader\"></div>\n        <h4 class=\"giftit-loading-text\">Verifying Identity</h4>\n    </div>\n    <div class=\"giftit-fetch-error hide\">\n        <p>Oops something went wrong. Please refresh or try the link from your email again!</p>\n    </div>\n\n<script>\n    (async function () {\n        await new Promise(res => setTimeout(res, 1000));\n\n        const data = {};\n\n        const urlParams = new URLSearchParams(window.location.search);\n        for (const pair of urlParams.entries()) {\n            data[pair[0]] = pair[1];\n        }\n\n        data.shop = Shopify.shop\n\n        const ret = await (await fetch(\'https://giftit-app.herokuapp.com/confirm-purchase\', {\n            method: \'POST\',\n            mode: \'cors\',\n            headers: {\n                \'Content-Type\': \'application/json\'\n            },\n            body: JSON.stringify(data)\n        })).json();\n        document.querySelector(\'.giftit-loading-text\').innerHTML = \'Confirming Items\';\n        await new Promise(res => setTimeout(res, 1000));\n\n        console.log(ret)\n        if (ret.url) {\n            window.location.replace(ret.url)\n        } else {\n            document.querySelector(\'.giftit-loading\').classList.add(\'hide\')\n            document.querySelector(\'.giftit-fetch-error\').classList.remove(\'hide\')\n        }\n    })();\n</script>\n</body>', 'complete-purchase', '1', 10, '2022-04-09 10:04:28', '2022-04-09 10:04:28'),
