(361, 81644748822, 'CrowdFunder Signup', '<div id=\"message\"></div><p style=\"text-align:center\"><strong>One-Step Signup.<br>\r\nIt\'s Free, So Signup &amp; Take A Look...</strong></p>\r\n\r\n<div class=\"col-sm-12\" id=\"signup_form_v\">\r\n<div id=\"account\">\r\n<form action=\"\" enctype=\"multipart/form-data\" method=\"post\">\r\n<div class=\"form-group required\">First Name\r\n<div class=\"col-sm-4\"><input name=\"firstname\" required=\"\" type=\"text\" value=\"\"></div>\r\n</div>\r\n\r\n<div class=\"form-group required\">Last Name\r\n<div class=\"col-sm-4\"><input name=\"lastname\" required=\"\" type=\"text\" value=\"\"></div>\r\n</div>\r\n\r\n<div class=\"form-group required\">Username\r\n<div class=\"col-sm-4\"><input name=\"username\" required=\"\" type=\"text\" value=\"\"></div>\r\n</div>\r\n\r\n<div class=\"form-group required\">E-Mail\r\n<div class=\"col-sm-4\"><input name=\"email\" required=\"\" type=\"text\" value=\"\"></div>\r\n</div>\r\n\r\n<div class=\"form-group required\">Password\r\n<div class=\"col-sm-4\"><input name=\"password\" required=\"\" type=\"password\" value=\"\"></div>\r\n</div>\r\n\r\n<div class=\"col-sm-4 col-sm-offset-4\">\n<br>\r\n<input name=\"termscondition\" required=\"required\" type=\"checkbox\" value=\"1\"> I agree to <a href=\"https://www.gofishmarketplace.com/Terms\" target=\"_blank\">Terms &amp; Conditions.</a>\n</div>\r\n\r\n<div class=\"col-sm-4 col-sm-offset-4\"> </div>\r\n\r\n<div class=\"form-group required\">\r\n<div class=\"col-sm-4 col-sm-offset-4\">\r\n<div class=\"buttons sdd\">\r\n<div class=\"text-center\"><input name=\"submit-cf-form\" type=\"submit\" value=\"Log Me Into My System\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</form>\r\n\r\n<p style=\"text-align:center\"> <br>\r\n<strong><span style=\"font-size:16px\"><em>We Offer The Very Best Free Reseller/Affiliate Program On The Internet.<br>\r\nWe Also <u>Guarantee</u> Visitors Via Our Optional Ad Tool.<br>\r\nResell Products From Multiple eCommerce Sites At The Same Time, Ranging From Gucci Handbags, To Electric Scooters &amp; Bikes.</em></span></strong></p>\r\n\r\n<p><span style=\"font-size:24px\">O</span><span style=\"font-size:16px\">ur award winning reseller/affiliate program is free, and it allows you to resell/promote products from multiple revenue generating, high-growth eCommerce sites at once. We provide many pieces of information about each eCommerce site that allows you to choose which eCommerce sites you wish to promote.</span><br>\r\n<br>\r\n<span style=\"font-size:24px\">Y</span><span style=\"font-size:16px\">ou just need to signup customers to any eComemrce site, and you then will own the revenue share rights to those customers for their entire customer lifetime, which typically equals 10 years. You get the benefit of the eCommerce site\'s high profit without having to create or manage the actual eCommerce site or pay the expenses that they need to pay, such as overhead &amp; inventory - you just get the benefit of the business model where the money is made.</span></p>\r\n\r\n<p> </p>\r\n\r\n<h5><span style=\"font-size:16px\"><strong><u><span style=\"color:#000000\">Recent Results:</span></u></strong></span></h5>\r\n\r\n<p><span style=\"font-size:16px\">We are truthfully very proud that the system works very well, and we have so many improvements planned. Some resellers/affiliates have signed up Customer Assets, which then immediately upon signup, purchased big ticket orders such as pro fishing reels for $280.00 yielding $84 in profit to the reseller/affilaite in just a couple hours. That crowdfunder also will get the total remaining benefit each time that customer makes a purchase for the next 10 years.</span></p>\r\n\r\n<p> </p>\r\n\r\n<h5><span style=\"font-size:16px\"><strong><u><span style=\"color:#000000\">System Overview:</span></u></strong></span></h5>\r\n\r\n<p><span style=\"font-size:16px\">After You Signup via Our One Step Quick Signup, You Can Choose From A Menu Of Multiple eCommerce Sites To Build Your Cash-Producing-Asset Portfolio of Customers (Assets).</span></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:left\"><span style=\"font-size:16px\"><span style=\"color:#000000\">We Don\'t Ask For A Credit Card At Signup. </span></span></li>\r\n	<li style=\"text-align:left\"><span style=\"font-size:16px\"><span style=\"color:#000000\">You Get An Admin Panel To See Your Customer Asset Portfolio, And Your Balance. </span></span></li>\r\n	<li style=\"text-align:left\"><span style=\"font-size:16px\"><span style=\"color:#000000\">No Setup Needed At All. </span></span></li>\r\n	<li style=\"text-align:left\"><span style=\"font-size:16px\"><span style=\"color:#000000\">You Do Not Communicate With The Customers; You Just Sign Them Up. </span></span></li>\r\n	<li style=\"text-align:left\"><span style=\"font-size:16px\"><span style=\"color:#000000\">You Can Either Promote The Entire eCommerce Sites Or An Individual Product</span></span></li>\r\n</ul>\r\n\r\n<p> </p>\r\n\r\n<h5><span style=\"font-size:16px\"><strong><u><span style=\"color:#000000\">The System Works In Two Ways:</span></u></strong></span></h5>\r\n\r\n<p><span style=\"font-size:16px\"><strong><u><span style=\"color:#000000\">1. Free/Promote-Manually</span></u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">To Signup Customers (Cash Producing Assets), Just Copy The \"Link\" That Is All The Way To The Right On Each eCommerce Site\'s Row.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">Paste That Link In Your Social Media, Give To Your Friends, Or Paste It Anywhere On The Internet</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">To Promote An Individual Product Just Add Your Reseller/Affiliate Tag To The End Of Any eCommerce Site\'s URL</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">When A Visitor Lands On The eCommerce Site That You Are Promoting, That Visitor Is Assigned To You.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">When They Sign Up As A Customer, They Become Your Asset And You Will See Their Name In Your Admin Panel.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">The Customers Do Not Know Who You Are.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">Every Time Your Customer Assets Make A Purchase For The Next 10 Years, You Get 10% to 50% of The Revenue.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">You Can Build A Large, Long Term, High ROI Cash Producing Asset Portfolio.</span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:16px\"><strong><u><span style=\"color:#000000\">2. Automatic (Via Our Optional Paid Ad Tool)</span></u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">Select \"Add To Portfolio\" For Each eCommerce Site You Wish To Crowdfund.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">The Crowdfunding Activates The eCommerce Site\'s Google Campaign On Our Master Google Account.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">When A Visitor Lands On The eCommerce Site That You Are Crowdfunding, That Visitor Is Assigned To You.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">When They Sign Up As A Customer, They Become Your Asset And You Will See Their Name In Your Admin Panel.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">The Customers Do Not Know Who You Are.</span></span></li>\r\n	<li><span style=\"font-size:16px\"><span style=\"color:#000000\">Every Time Your Customer Assets Make A Purchase For The Next 10 Years, You Get 10% to 50% of The Revenue.</span></span></li>\r\n	<li><span style=\"font-siz