(397, 81513152534, 'Request Personal Data', '<div class=\"EG-request-personal-data\">\n    <div class=\"EG-container-small\">\n        <p>You can request your personal data by filling this form. </p>\n        <p>\n            <label for=\"request_email\">Email:</label>\n            <input type=\"email\" name=\"request_email\" id=\"request_email\" required=\"\">\n        </p>\n        <p class=\"gdpr_request_description\">\n            I also consent to having cambridgetestshop collect my email so that they can send me my requested info. For more info check our privacy policy where you\'ll get more info on where, how and why we store your data.\n        </p>\n        <div>\n            <button class=\"button btn btn--regular btn--color btn--fill\" onclick=\"return sendDataRequest()\">Submit</button>\n        </div>\n        <div class=\"EG-loader\" id=\"EG-loader\" style=\"display: none;\"></div>\n    </div>\n</div>', 'request-personal-data', '1', 10, '2022-04-09 10:04:28', '2022-04-09 10:04:28'),
