(409, 87190601897, 'Size chart', '<p>All measurements are in inches                                                                               </p>\n<table width=\"100%\">\n<tbody>\n<tr>\n<td></td>\n<td> small</td>\n<td>Medium</td>\n<td>Large</td>\n</tr>\n<tr>\n<td>Chest</td>\n<td>42</td>\n<td>44</td>\n<td>46</td>\n</tr>\n<tr>\n<td>Length shoulder  back</td>\n<td>28</td>\n<td>28.5</td>\n<td>29</td>\n</tr>\n<tr>\n<td>Shoulder</td>\n<td>20</td>\n<td>21</td>\n<td>22</td>\n</tr>\n<tr>\n<td>sleeve Length</td>\n<td>8.5</td>\n<td>9</td>\n<td>9.5</td>\n</tr>\n<tr>\n<td>sleeve opening </td>\n<td>14</td>\n<td>15</td>\n<td>16</td>\n</tr>\n</tbody>\n</table>', 'size-chart', '1', 11, '2022-05-30 05:48:27', '2022-05-30 05:48:27'),
(410, 79408234665, 'testing', '<p>Your About Us page should be:</p>\n<ul>\n<li>Informative. It doesn’t always have to tell your whole story, but it should at least provide people with an idea of .</li>\n<li>Contain social proof, testimonials, and some personal information that visitors can relate to, such as education, family, etc.</li>\n<li>Useful.</li>\n<li>Engaging.</li>\n<li>Easy to navigate.</li>\n<li>Accessible on any device.</li>\n</ul>\n<p>Does that all sound complicated?</p>\n<p>It really isn’t.</p>\n<p>The main purpose of your About Us page is to give your visitors a glimpse into who you are as a person or a business (or sometimes both).</p>\n<p>As users discover your brand, they need to distinguish what sets you apart and makes you… you.</p>\n<p>This often requires finding the right balance between compelling content and a design carefully planned to look the part.</p>\n<p>Conveying your identity in a fun and approachable – but also reliable and informative – way is challenging.</p>\n<p>If you know who you are and your goal for your site, the About Us page should come naturally.</p>\n<p>However, if you’re looking for some inspiration, you can always check out the following 25 awesome examples of About Us pages.</p>\n<div data-total=\"4\" class=\"content-unit  sss_slot\">\n<div class=\"av-label\"><span>ADVERTISEMENT</span></div>\n</div>', 'about-us', '1', 11, '2022-05-30 05:48:27', '2022-05-30 05:48:27'),
