(418, 98262188251, 'icons', '<style>\n  .custom-col {\n  	padding-right: 10px;\n    padding-left: 10px;\n  }\n  .custom-col svg,.custom-icon {\n    width: 30px;\n    height: 30px;\n    line-height: 40px;\n    color: #fd7685;\n    fill: #fd7685;\n    font-size: 35px;\n  }\n  .trust_seal-main-div{\n  	width: auto;\n    text-align: center;\n    margin-right: 0px;\n    margin-left: 0px;\n    margin-top:0px;\n  }\n  .custom-title-product {\n  	margin:0px;\n    font-size:10px;\n  }\n  @media (min-width: 1025px){\n	.trust_seal-main-div{\n  	width: auto;\n    max-width: 338px;\n   }\n  }\n</style>\n<div class=\"trust_seal-main-div row\">\n<div class=\"col-4 custom-col\">\n<i class=\"las la-shipping-fast custom-icon\"></i>\n<h4 class=\"custom-title-product\">Fast &amp; Free Shipping</h4>\n</div>\n<div class=\"col-4 custom-col\">\n<i class=\"las la-rupee-sign custom-icon\"></i>\n<h4 class=\"custom-title-product\">COD &amp; Secure Payment</h4>\n</div>\n<div class=\"col-4 custom-col\">\n<i class=\"las la-undo-alt custom-icon\"></i>\n<h4 class=\"custom-title-product\">7 Days Return Policy</h4>\n</div>\n</div>', 'icons', '1', 12, '2022-06-18 06:05:49', '2022-06-18 06:05:49'),
(419, 98262548699, 'SIZE GUIDE', '<div class=\"mfp-content\"><div class=\"mfp-with-anim white-popup ajax_pp_popup ps_ajax_pp_js\">\n<div class=\"sp-tab-content\">\n<div class=\"row row_des_6\">\n<div class=\"col-12 col-md-12 tc\">\n<h3 class=\"size_chart_heading_margin\">FIND YOUR SIZE</h3>\n<div class=\"table-responsive\">\n<table class=\"table table-condensed\">\n<thead>\n<tr>\n<th class=\"td-min-width\">Size</th>\n<th class=\"td-min-width\">Bust (Inch)</th>\n<th class=\"td-min-width\">Waist (Inch)</th>\n<th class=\"td-min-width\">Low Hip (Inch)</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>XS</td>\n<td>32</td>\n<td>24 - 25</td>\n<td>33 - 34</td>\n</tr>\n<tr>\n<td>S</td>\n<td>34 - 35</td>\n<td>26 - 27</td>\n<td>35 - 36</td>\n</tr>\n<tr>\n<td>M</td>\n<td>36 - 37</td>\n<td>28 - 29</td>\n<td>38 - 40</td>\n</tr>\n<tr>\n<td>L</td>\n<td>38 - 39</td>\n<td>30 - 31</td>\n<td>42 - 44</td>\n</tr>\n<tr>\n<td>XL</td>\n<td>40 - 41</td>\n<td>32 - 33</td>\n<td>45 - 47</td>\n</tr>\n<tr>\n<td>2XL</td>\n<td>42 - 43</td>\n<td>34 - 35</td>\n<td>48 - 50</td>\n</tr>\n<tr>\n<td>3XL</td>\n<td>44 - 45</td>\n<td>36 - 37</td>\n<td>52 - 54</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n</div>\n<div class=\"row row_des_6\">\n<div class=\"col-12 col-md-6 tc\">\n<h4 class=\"sub-head\">Measuring Tips</h4>\n<p>A visual aid to help you understand how to measure your body</p>\n<h5 class=\"headings\">Bust</h5>\n<p>Measure around the fullest part of your bust.</p>\n<h5 class=\"headings\">Waist</h5>\n<p>Measure around the narrowest part of your torso.</p>\n<h5 class=\"headings\">Low Hip</h5>\n<p>With your feet together measure around the fullest part of your hips/rear.</p>\n</div>\n<div class=\"col-12 col-md-6 tc\"><img src=\"https://cdn.shopify.com/s/files/1/0541/1789/2281/files/size_chart1.webp?v=1614945798\" alt=\"sizechart cloveralley\"></div>\n</div>\n</div>\n<button title=\"Close (Esc)\" type=\"button\" class=\"mfp-close\">×</button>\n</div></div>', 'size-guide', '1', 12, '2022-06-18 06:05:49', '2022-06-18 06:05:49'),
(420, 98262450395, 'Why Buy Form us', '<div class=\"sp-tab-content\">\n   <strong>4 Reasons To Be Our Customer:</strong>\n   <table>\n      <tbody>\n         <tr>\n            <th style=\"width: 72px;\"><img src=\"https://cdn.shopify.com/s/files/1/0011/9521/2866/files/reasons_1.png?15737560157770889133\" alt=\"reasons_1\"></th>\n            <td>\n               <p><strong>Exceptional Support</strong> Our friendly support staff are available all the time to help customers with any questions or concerns. We want our products to deliver the most joy and value with zero hassle. That’s why we insist on being available to assist when the need arises.</p>\n            </td>\n         </tr>\n         <tr>\n            <th style=\"width: 72px;\"><img src=\"https://cdn.shopify.com/s/files/1/0011/9521/2866/files/reasons_3.png?15737560157770889133\" alt=\"reasons_3\"></th>\n            <td>\n               <p><strong>Quality and Affordable</strong> We believe in combining both quality and affordability in our products. There’s no reason to pay exorbitant prices when our products do more for less. You won\'t find better price to quality ratio.</p>\n            </td>\n         </tr>\n         <tr>\n            <th style=\"width: 72px;\"><img src=\"https://cdn.shopify.com/s/files/1/0011/9521/2866/files/reasons_4.png?15737560157770889133\" alt=\"reasons_4\"></th>\n            <td>\n               <p><strong>Unbeatable Price</strong> - Years of expiriences in pet clothing and accessories industry gives us uniqe position to work directly with factories to ensure quality control and the best price possible.</p>\n            </td>\n         </tr>\n         <tr>\n            <th style=\"width: 72px;\"><img src=\"https://cdn.shopify.com/s/files/1/0011/9521/2866/files/reasons_5.png?15737560157770889133\" alt=\"reasons_5\"></th>\n            <td>\n               <p><strong>Secure, Easy Ordering</strong> - Orders can be placed online using either a credit/debit card or PayPal. All transactions are SSL-secured and guarantee your privacy.</p>\n            </td>\n         </tr>\n      </tbody>\n   </table>\n</div>', 'why-buy-form-us', '1', 12, '2022-06-18 06:05:49', '2022-06-18 06:05:49'),
(421, 86909255702, 'Advance FAQ', '<div class=\"advanced_faq\" id=\"ze0xtxZYN7Qjw\"></div>', 'advance-faq', '1', 10, '2022-06-18 06:13:12', '2022-06-18 06:13:12'),
