(469, 87010443286, 'Brands', '<script type=\"text/javascript\" src=\"https://cdn.jsdelivr.net/npm/lozad/dist/lozad.min.js\"></script>\r\n                                <div class=\"brandPage_Root\"></div><a href=\"https://apps.shopify.com/product-smart-sync\"></a> <script>function httpGetAsync(theUrl, callback) { \r\n                               var xmlHttp = new XMLHttpRequest(); \r\n                               xmlHttp.onreadystatechange = function() {\r\n                               if (xmlHttp.readyState  ===4) {  \r\n                               var divElement = document.querySelector(\'.brandPage_Root\'); \r\n                               divElement.innerHTML = xmlHttp.status === 200? xmlHttp.response:\'\'; \r\n                                const observer = lozad();\r\n                                observer.observe();}\r\n                               };\r\n                               xmlHttp.open(\'GET\', theUrl, true);\r\n                                            xmlHttp.send(null); }  httpGetAsync(\'https://vertibrix.com/productsync/data/brandPage/1710.html\')</script> <div style=\"display:none\"></div>', 'brands', '1', 15, '2022-09-17 09:51:52', '2022-09-17 09:51:52'),
(470, 87005429782, 'BSP Order Confirmation Page', '<main class=\"main-content js-focus-hidden\" id=\"MainContent\" role=\"main\" tabindex=\"-1\">\n					    <div class=\"page-width\">\n						  	<div class=\"grid\">\n						    	<div class=\"grid__item medium-up--five-sixths medium-up--push-one-twelfth\">\n						      		<div class=\"section-header text-center\">\n						        		<h1>Order Confirmation Page</h1>\n						      		</div>\n\n							    	<div class=\"rte\">\n							        	<div class=\"section-title desktop-9 mobile-3 center-title\">\n							    			<h1>Confirmation Page</h1>\n										</div>\n\n										<div class=\"desktop-11 tablet-6 mobile-3 center-page\">\n									    	<div class=\"custom-class-page\">\n										        <style>\n										           \n										            .text-confirmation {\n										                width: 100%;\n										                max-width: 500px;\n										                margin: auto;\n										                text-align: center;\n										                padding: 20px;\n										                border-radius: 4px;\n										            }\n\n										            .text-confirmation a {\n										                background-color: black;\n										                color: white;\n										                padding-top: 7px;\n										                padding-bottom: 7px !important;\n										                padding-left: 9px;\n										                padding-right: 9px;\n										                border-radius: 2px;\n										                margin: auto;\n										                display: block;\n										                text-align: center;\n										                width: 100%;\n										                max-width: 200px;\n										            }\n\n										            h1 {\n										                display: none;\n										            }\n\n										           \n										        </style>\n										        <div class=\"text-confirmation\">\n										            <h2>Order Verified</h2>\n										            <p>Your Order has been verified successfully and will be dispatched shortly!</p>\n										            <p></p>\n										            <a href=\"/\" style=\"color: #fff;\"> Continue Shopping </a>\n										        </div>\n									    	</div>\n										</div>\n							      	</div>\n							    </div>\n						  	</div>\n						</div>\n\n					</main>', 'bsp-order-confirmation-page', '1', 15, '2022-09-17 09:51:52', '2022-09-17 09:51:52'),
