(484, 91039334422, 'CCPA Compliance', '<style>\n    #form-ccpa-edit-account-request,\n    #form-ccpa-data-account-request,\n    #form-ccpa-personal-data-report-request,\n    #form-ccpa-delete-account-request ,\n    #form-ccpa-do-not-sell-request {\n        display: none;\n    }\n    #ccpa_page button {\n      background-color: transparent;\n      border: 0;\n      border-bottom: 1px solid black;\n      padding: 0px;\n    }\n\n    /* Modal background */\n    #data-verification-background {\n      display: none;\n      position: fixed;\n      z-index: 1;\n      padding-top: calc(50vh - 83px);\n      left: 0;\n      top: 0;\n      width: 100%;\n      height: 100%;\n      overflow: auto;\n      background-color: rgb(0,0,0);\n      background-color: rgba(0,0,0,0.4);\n      opacity: unset;\n      z-index: 9999;\n    }\n    /* Modal Content */\n    #data-verification-modal {\n      background-color: #fefefe;\n      margin: auto;\n      padding: 16px;\n      border: 1px solid #888;\n      width: 38%;\n    }\n    /* Modal Close Button */\n    .data-verification-close {\n      color: #aaaaaa;\n      float: right;\n      font-size: 28px;\n      font-weight: bold;\n      line-height: 17px;\n    }\n    .data-verification-close:hover,\n    .data-verification-close:focus {\n      color: #000;\n      text-decoration: none;\n      cursor: pointer;\n    }\n    /* Checkbox Text */\n    #data-verification-container p{\n      display: inline-block;\n      padding: 0;\n      margin: 0;\n      line-height: 24px;\n      padding-left: 10px;\n      vertical-align: top;\n      width: calc(100% - 45px);\n    }\n    #data-verification-container a, #data-verification-container a:hover{\n      text-decoration: underline!important;\n      color: #4285f4;\n    }\n    /* Checkbox Icon */\n    #data-verification-icon {\n      cursor: pointer;\n      position: relative;\n      margin: auto;\n      width: 18px;\n      height: 18px;\n      -webkit-tap-highlight-color: transparent;\n      transform: translate3d(0, 0, 0);\n      margin-top: 2px;\n    }\n    #data-verification-icon:before {\n      content: \"\";\n      position: absolute;\n      top: -7px;\n      left: -7px;\n      width: 32px;\n      height: 32px;\n      border-radius: 50%;\n      background: rgba(34,50,84,0.03);\n      opacity: 0;\n      transition: opacity 0.2s ease;\n    }\n    #data-verification-icon svg {\n      position: relative;\n      z-index: 1;\n      fill: none;\n      stroke-linecap: round;\n      stroke-linejoin: round;\n      stroke: #c8ccd4;\n      stroke-width: 1.5;\n      transform: translate3d(0, 0, 0);\n      transition: all 0.2s ease;\n    }\n    #data-verification-icon svg path {\n      stroke-dasharray: 60;\n      stroke-dashoffset: 0;\n    }\n    #data-verification-icon svg polyline {\n      stroke-dasharray: 22;\n      stroke-dashoffset: 66;\n    }\n    #data-verification-icon:hover:before {\n      opacity: 1;\n    }\n    #data-verification-container:hover #data-verification-icon svg {\n      stroke: #4285f4;\n    }\n    #data-verification-icon.clicked svg {\n      stroke: #4285f4;\n    }\n    #data-verification-icon.clicked svg path {\n      stroke-dashoffset: 60;\n      transition: all 0.3s linear;\n    }\n    #data-verification-icon.clicked svg polyline {\n      stroke-dashoffset: 42;\n      transition: all 0.2s linear;\n      transition-delay: 0.15s;\n    }\n    #ccpa_page .list-unstyled li button {\n      cursor: pointer;\n    }\n    .show-isense {\n      transition: opacity 400ms !important;\n    }\n    .hide-isense {\n      opacity: 0 !important;\n      transition: 0.4s ease-out;\n    }\n\n    /* Modal changes on mobile resolution*/\n    @media only screen and (max-width: 600px) {\n      #data-verification-modal {\n        width: 90%;\n      }\n    }\n\n    /* Loading Element */\n    .loading {\n        display: none;\n        top:50vh;\n        left:50vw;\n        position:fixed;\n    }\n    .loading:not(:required):after {\n      content: \'\';\n      display: block;\n      font-size: 10px;\n      width: 1em;\n      height: 1em;\n      margin-top: -0.5em;\n      -webkit-animation: spinner 1500ms infinite linear;\n      -moz-animation: spinner 1500ms infinite linear;\n      -ms-animation: spinner 1500ms infinite linear;\n      -o-animation: spinner 1500ms infinite linear;\n      animation: spinner 1500ms infinite linear;\n      border-radius: 0.5em;\n      -webkit-box-shadow: rgba(255,255,255, 1) 1.5em 0 0 0, rgba(255,255,255, 1) 1.1em 1.1em 0 0, rgba(255,255,255, 1) 0 1.5em 0 0, rgba(255,255,255, 1) -1.1em 1.1em 0 0, rgba(255,255,255, 1) -1.5em 0 0 0, rgba(255,255,255, 1) -1.1em -1.1em 0 0, rgba(255,255,255, 1) 0 -1.5em 0 0, rgba(255,255,255, 1) 1.1em -1.1em 0 0;\n      box-shadow: rgba(255,255,255, 1) 1.5em 0 0 0, rgba(255,255,255, 1) 1.1em 1.1em 0 0, rgba(255,255,255, 1) 0 1.5em 0 0, rgba(255,255,255, 1) -1.1em 1.1em 0 0, rgba(255,255,255, 1) -1.5em 0 0 0, rgba(255,255,255, 1) -1.1em -1.1em 0 0, rgba(255,255,255, 1) 0 -1.5em 0 0, rgba(255,255,255, 1) 1.1em -1.1em 0 0;\n    }\n\n    /* Animation */\n    @-webkit-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @-moz-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @-o-keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n    @keyframes spinner {\n      0% {\n        -webkit-transform: rotate(0deg);\n        -moz-transform: rotate(0deg);\n        -ms-transform: rotate(0deg);\n        -o-transform: rotate(0deg);\n        transform: rotate(0deg);\n      }\n      100% {\n        -webkit-transform: rotate(360deg);\n        -moz-transform: rotate(360deg);\n        -ms-transform: rotate(360deg);\n        -o-transform: rotate(360deg);\n        transform: rotate(360deg);\n      }\n    }\n</style>\r\n<div id=\"ccpa_page\" class=\"col-sm-12\">\r\n    <div class=\"text-center\">\r\n        The app used for assuring the GDPR/CCPA/APPI/PIPEDA compliance of this site, collects your IP and the email address in order to process the data. For more check <a href=\"https://gdprcdn.b-cdn.net/pages/privacy_policy\" target=\"_blank\"> Privacy Policy &amp; Terms of Service</a><a>\r\n    </a>\n</div>\r\n    <h2>Data Rectification</h2>\r\n    <p>You can use the link below to update your account data if it is not accurate.</p>\r\n    <ul class=\"list-unstyled\">\r\n        <li><button id=\"btn-ccpa-edit-account-request\" aria-label=\"edit your account information\" aria-controls=\"form-ccpa-edit-account-request\" aria-expanded=\"false\">Edit your account information</button></li>\r\n    </ul>\r\n    <div id=\"form-ccpa-edit-account-request\">\r\n        <form>\r\n          <label for=\"form-ccpa-edit-account-request-email\">Enter your email to confirm your identity</label>\r\n          <input type=\"email\" name=\"email\" id=\"form-ccpa-edit-account-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\r\n          <input type=\"submit\" class=\"btn\" id=\"form-ccpa-edit-account-request-submit\" value=\"Submit\">\r\n        </form>\r\n    </div>\r\n    <h2>Data Portability</h2>\r\n    <p>You can use the links below to download all the data we store and use for a better experience in our store.</p>\r\n    <ul class=\"list-unstyled\">\r\n        <li><button id=\"btn-ccpa-requests-request\" aria-label=\"CCPA requests\" aria-controls=\"form-ccpa-data-account-request\" aria-expanded=\"false\">CCPA requests</button></li>\r\n        <li><button id=\"btn-ccpa-personal-information-request\" aria-label=\"personal information\" aria-controls=\"form-ccpa-data-account-request\" aria-expanded=\"false\">Personal information</button></li>\r\n        <li><button id=\"btn-ccpa-orders-request\" aria-label=\"orders\" aria-controls=\"form-ccpa-data-account-request\" aria-expanded=\"false\">Orders</button></li>\r\n    </ul>\r\n    <div id=\"form-ccpa-data-account-request\">\r\n        <form>\r\n            <label for=\"form-ccpa-data-account-request-email\">Enter your email to confirm your identity</label>\r\n            <input type=\"email\" name=\"email\" id=\"form-ccpa-data-account-request-email\" placeholder=\"example@email.com\" autocomplete=\"email\" autocorrect=\"off\" autocapitalize=\"off\" autofocus=\"\">\r\n            <input type=\"submit\" class=\"btn\" id=\"form-ccpa-data-account-request-submit\" value=\"Submit\">\r\n            <input type=\"hidden\" name=\"request_type\" id=\"form-ccpa-data-account-request-request-type\" value=\"\">\r\n        </form>\r\n    </div>\r\n    <h2>Access to Personal Data</h2>\r\n    <p>You can use the link below to request a report which will contain all personal information that we store for you.</p>\r\n    <ul class=\"list-unstyled\">\r\n      <li><button id=\"btn-ccpa-personal-data-report-request\" aria-label=\"request a report\" aria-controls=\"form-ccpa-personal-data-report-request\" aria-expanded=\"false\">Request a report</button></li>\r\n    </ul>\r\n    <div id=\"form-ccpa-personal-data-report-request\">\r\n        <form>\r\n            <label for=\"form-ccpa-personal-data-report-request-email\">Enter your email to confirm your identity</label>\r\n            <input type=\"email\" name=\"email\" id=\"form-ccpa-personal-data-report-request-email\" placeholder=\"example@email.com\" ', 'ccpa-compliance-4', '1', 15, '2022-09-17 09:51:52', '2022-09-17 09:51:52'),
(485, 91042742294, 'CCPA Privacy Policy', '<p><strong>Privacy Policy</strong></p>\n        <p>Our Privacy Policy was last updated on September 9, 2022.</p>\n        <p>This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.</p>\n        <p>We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy. This Privacy Policy was generated by <a href=\"https://www.termsfeed.com/blog/sample-ccpa-privacy-policy-template/\">TermsFeed CCPA Privacy Policy Template</a>.</p>\n        <p><strong>Interpretation and Definitions</strong></p>\n        <p><strong>Interpretation</strong></p>\n        <p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\n        <p><strong>Definitions</strong></p>\n        <p>For the purposes of this Privacy Policy:</p>\n        <ul>\n        <li>\n        <p><strong>\"Account\"</strong> means a unique account created for You to access our Service or parts of our Service.</p>\n        </li>\n        <li>\n        <p><strong>\"Business\"</strong>, for the purpose of the CCPA (California Consumer Privacy Act), refers to the Company as the legal entity that collects Consumers\' personal information and determines the purposes and means of the processing of Consumers\' personal information, or on behalf of which such information is collected and that alone, or jointly with others, determines the purposes and means of the processing of consumers\' personal information, that does business in the State of California.</p>\n        </li>\n        <li>\n        <p><strong>\"Company\"</strong> (referred to as either \"the Company\", \"We\", \"Us\" or \"Our\" in this Agreement) refers to app-security</p>\n        </li>\n        <li>\n        <p><strong>\"Country\"</strong> refers to Canada.</p>\n        </li>\n        <li>\n        <p><strong>\"Consumer\"</strong>, for the purpose of the CCPA (California Consumer Privacy Act), means a natural person who is a California resident. A resident, as defined in the law, includes (1) every individual who is in the USA for other than a temporary or transitory purpose, and (2) every individual who is domiciled in the USA who is outside the USA for a temporary or transitory purpose.</p>\n        </li>\n        <li>\n        <p><strong>\"Cookies\"</strong> are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</p>\n        </li>\n        <li>\n        <p><strong>\"Data Controller\"</strong>, for the purposes of the GDPR (General Data Protection Regulation), refers to the Company as the legal person which alone or jointly with others determines the purposes and means of the processing of Personal Data.</p>\n        </li>\n        <li>\n        <p><strong>\"Device\"</strong> means any device that can access the Service such as a computer, a cellphone or a digital tablet.</p>\n        </li>\n        <li>\n        <p><strong>\"Do Not Track\"</strong> (DNT) is a concept that has been promoted by US regulatory authorities, in particular the U.S. Federal Trade Commission (FTC), for the Internet industry to develop and implement a mechanism for allowing internet users to control the tracking of their online activities across websites.</p>\n        </li>\n        <li>\n        <p><strong>\"Personal Data\"</strong> is any information that relates to an identified or identifiable individual.</p>\n        <p>For the purposes of the CCPA, Personal Data means any information that identifies, relates to, describes or is capable of being associated with, or could reasonably be linked, directly or indirectly, with You.</p>\n        </li>\n        <li>\n        <p><strong>\"Sale\"</strong>, for the purpose of the CCPA (California Consumer Privacy Act), means selling, renting, releasing, disclosing, disseminating, making available, transferring, or otherwise communicating orally, in writing, or by electronic or other means, a Consumer\'s personal information to another business or a third party for monetary or other valuable consideration.</p>\n        </li>\n        <li>\n        <p><strong>\"Service\"</strong> refers to the Website.</p>\n        </li>\n        <li>\n        <p><strong>\"Service Provider\"</strong> means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</p>\n        </li>\n        <li>\n        <p><strong>\"Usage Data\"</strong> refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p>\n        </li>\n        <li>\n        <p><strong>\"Website\"</strong> refers to app-security , accessible from https://app-security.myshopify.com</p>\n        </li>\n        <li>\n        <p><strong>\"You\"</strong> means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p>\n        </li>\n        </ul>\n        <p><strong>Collecting and Using Your Personal Data</strong></p>\n        <p><strong>Types of Data Collected</strong></p>\n        <p><strong>Personal Data</strong></p>\n        <p>While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p>\n        <ul>\n        <li>\n        <p>Email address</p>\n        </li>\n        <li>\n        <p>First name and last name</p>\n        </li>\n        <li>\n        <p>Phone number</p>\n        </li>\n        <li>\n        <p>Address, State, Province, ZIP/Postal code, City</p>\n        </li>\n        <li>\n        <p>Usage Data</p>\n        </li>\n        </ul>\n        <p><strong>Usage Data</strong></p>\n        <p>Usage Data is collected automatically when using the Service.</p>\n        <p>Usage Data may include information such as Your Device\'s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\n        <p>When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p>\n        <p>We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p>\n        <p><strong>Tracking Technologies and Cookies</strong></p>\n        <p>We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:</p>\n        <ul>\n        <li>\n<strong>Cookies or Browser Cookies.</strong> A cookie is a small file placed on Your Device. You can instruct Your browser to refuse all Cookies or to indicate when a Cookie is being sent. However, if You do not accept Cookies, You may not be able to use some parts of our Service. Unless you have adjusted Your browser setting so that it will refuse Cookies, our Service may use Cookies.</li>\n        <li>\n<strong>Web Beacons.</strong> Certain sections of our Service and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or opened an email and for other related website statistics (for example, recording the popularity of a certain section and verifying system and server integrity).</li>\n        </ul>\n        <p>Cookies can be \"Persistent\" or \"Session\" Cookies. Persistent Cookies remain on Your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close Your web browser.</p>\n        <p>We use both Session and Persistent Cookies for the purposes set out below:</p>\n        <ul>\n        <li>\n        <p><strong>Necessary / Essential Cookies</strong></p>\n        <p>Type: Session Cookies</p>\n        <p>Administered by: Us</p>\n        <p>Purpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</p>\n        </li>\n        <li>\n        <p><strong>Cookies Policy / Notice Acceptance Cookies</strong></p>\n        <p>Type: Persistent Cookies</p>\n        <p>Administered by: Us</p>\n        <p>Purpose: These Cookies identify if users have accepted the use of cookies on the Website.</p>\n        </li>\n        <li>\n        <p><strong>Functionality Cookies</strong></p>\n        <p>Type: Persistent Cookies</p>\n        <p>Administered by: Us</p>\n        <p>Purpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language pref', 'cppa-privacy-policy', '1', 15, '2022-09-17 09:51:52', '2022-09-17 09:51:52'),
