(608, 91029897238, 'Banked Payment Error', '<script>\n    document.addEventListener(\"DOMContentLoaded\", function(){\n        let replaceContent = function (elId, content) {\n            let el = document.getElementById(elId);\n            if (el !== null){\n                el.innerText = content\n            }\n        };\n\n        let url_string = window.location.href;\n        let url = new URL(url_string);\n        let errorMessage = url.searchParams.get(\"errMessage\");\n\n        replaceContent(\"error_message\", errorMessage);\n    });\n</script>\n<div class=\"page-head\">\n    <h3>An error has occurred while processing your payment</h3>\n</div>\n<p> <span id=\"error_message\"></span> </p>\n<p>please contact us if you require any further assistance.</p>', 'banked-payment-error', '1', 22, '2022-09-21 13:02:01', '2022-09-21 13:02:01'),
