bel=\"request a report\" aria-controls=\"form-ccpa-personal-data-report-request\" aria-expanded=\"false\">Request a report</button></li>\r\n    </ul>\r\n    <div id=\"form-ccpa-personal-data-report-request\">\r\n        <form>\r\n            <label for=\"form-ccpa-personal-data-report-request-email\">Enter your email to confirm your identity</label>\r\n            <input type=\"email\" name=\"email\" id=\"form-ccpa-personal-data-report-request-email\" placeholder=\"example@email.com\" ', 'ccpa-compliance-3', '1', 22, '2022-09-21 13:02:01', '2022-09-21 13:02:01');
