(679, 107168268310, 'Ask a Friend', '<style>\n  body {\n    margin: 0px;\n    padding: 0px;\n    overflow-x: hidden;\n    font-family: \'Montserrat\', sans-serif;\n  }\n  h1,\n  h2,\n  h3,\n  h4,\n  h5,\n  h6,\n  p {\n    margin: 0px;\n    padding: 0px;\n  }\n  * {\n    margin: 0;\n    padding: 0;\n    box-sizing: border-box;\n  }\n\n  #MainContent {\n    display: flex;\n    justify-content: center;\n  }\n\n  .page-width .page-width--narrow {\n    max-width: unset !important;\n  }\n\n  .page-width--narrow {\n    max-width: unset !important;\n  }\n\n  .main-page-title {\n    display: none;\n  }\n\n  @media screen and (max-width: 767px) {\n    .ask-a-friend-section {\n      position: fixed;\n      bottom: 20px;\n      right: 20px;\n      background: #475572;\n      box-shadow: 0px 0px 20px rgba(0, 0, 0, 0.25);\n      border-radius: 30px;\n      color: #fff;\n      padding: 10px 20px;\n      cursor: pointer;\n      border: none;\n      display: flex;\n      align-items: center;\n    }\n    .ask-a-friend-section img {\n      width: 20px;\n      margin-right: 12px;\n    }\n    .ask-a-friend-section {\n      margin: 10px;\n      border: 0.5px solid black;\n      position: absolute;\n      left: 0;\n      right: 0;\n      bottom: 0;\n      top: 0;\n      width: auto;\n      height: 989.75px;\n      background-color: #fff;\n      /* border-radius: 5px; */\n      padding: 0px;\n      z-index: 101;\n    }\n\n    .ask-friend-section-first-div {\n      padding: 21px 20px 60px 20px;\n    }\n    .ask-friend-section-copy-inner-button {\n      background-color: #f26f70;\n      border: none;\n      border-radius: 24px;\n      width: 100%;\n      height: 48px;\n      text-align: center;\n      font-family: \'Inter\', sans-serif;\n      font-style: normal;\n      font-weight: 700;\n      font-size: 19.2px;\n      line-height: 130%;\n      /* identical to box height, or 25px */\n\n      color: #fcfcfc;\n    }\n    .ask-friend-section-second-div {\n      display: flex;\n      justify-co