(681, 107114627094, 'BSP Order Confirmation Page', '<main class=\"main-content js-focus-hidden\" id=\"MainContent\" role=\"main\" tabindex=\"-1\">\n					    <div class=\"page-width\">\n						  	<div class=\"grid\">\n						    	<div class=\"grid__item medium-up--five-sixths medium-up--push-one-twelfth\">\n						      		<div class=\"section-header text-center\">\n						        		<h1>Order Confirmation Page</h1>\n						      		</div>\n\n							    	<div class=\"rte\">\n							        	<div class=\"section-title desktop-9 mobile-3 center-title\">\n							    			<h1>Confirmation Page</h1>\n										</div>\n\n										<div class=\"desktop-11 tablet-6 mobile-3 center-page\">\n									    	<div class=\"custom-class-page\">\n										        <style>\n										           \n										            .text-confirmation {\n										                width: 100%;\n										                max-width: 500px;\n										                margin: auto;\n										                text-align: center;\n										                padding: 20px;\n										                border-radius: 4px;\n										            }\n\n										            .text-confirmation a {\n										                background-color: black;\n										                color: white;\n										                padding-top: 7px;\n										                padding-bottom: 7px !important;\n										                padding-left: 9px;\n										                padding-right: 9px;\n										                border-radius: 2px;\n										                margin: auto;\n										                display: block;\n										                text-align: center;\n										                width: 100%;\n										                max-width: 200px;\n										            }\n\n										            h1 {\n										                display: none;\n										            }\n\n										           \n										        </style>\n										        <div class=\"text-confirmation\">\n										            <h2>Order Verified</h2>\n										            <p>Your Order has been verified successfully and will be dispatched shortly!</p>\n										            <p></p>\n										            <a href=\"/\" style=\"color: #fff;\"> Continue Shopping </a>\n										        </div>\n									    	</div>\n										</div>\n							      	</div>\n							    </div>\n						  	</div>\n						</div>\n\n					</main>', 'bsp-order-confirmation-page', '1', 30, '2023-06-21 16:50:25', '2023-06-21 16:50:25'),
