(683, 107109384214, 'Coming Soon', '<!-- Coming Soon -->\n        <div class=\"coming-soon eosh-template-font\">\n            <div class=\"inner-bg\">\n                <div class=\"container\">\n                    <div class=\"row\">\n                        <div class=\"col-sm-12\">\n                            <div class=\"logo wow fadeInDown\">\n                                <h1>\n                                    <a href=\"#\" style=\"background: url(https://cdn.shopify.com/s/files/1/0691/6194/3062/t/1/assets/eosh-logo-logo.png?v=1685682367) center center no-repeat;\"></a>\n                                </h1>\n                            </div>\n                            <h2 class=\"wow fadeInDown\">We will be back<strong> SOON!</strong>\n</h2>\n                            <div class=\"timer wow fadeInUp\">\n                                <div class=\"days-wrapper\">\n                                    <span class=\"days\"></span> <br>Days\n                                </div> \n                                <div class=\"hours-wrapper\">\n                                    <span class=\"hours\"></span> <br>Hours\n                                </div> \n                                <div class=\"minutes-wrapper\">\n                                    <span class=\"minutes\"></span> <br>Minutes\n                                </div> \n                                <div class=\"seconds-wrapper\">\n                                    <span class=\"seconds\"></span> <br>Seconds\n                                </div>\n                            </div>\n                            <div class=\"wow fadeInDown\">\n                                <p>\n                                    To get updated sign up to our newsletter.\n                                </p>\n                            </div>\n                            <div class=\"subscribe wow fadeInDown\">\n                                <form class=\"form-inline\" action=\"\" method=\"post\">\n                                    <input type=\"email\" name=\"email\" placeholder=\"Enter Your Email\" class=\"subscribe-email eosh-template-font\">\n                                    <input type=\"hidden\" name=\"shop\" class=\"subscribe-shop\" value=\"app-security-02.myshopify.com\">\n                                    <button type=\"submit\" class=\"btn eosh-template-font\">Subscribe</button>\n                                </form>\n                                <div class=\"success-message\"></div>\n                                <div class=\"error-message\"></div>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n        \n        <!-- Footer -->\n        <footer>\n            <div class=\"container\">\n                <div class=\"row\">\n                    <div class=\"col-sm-7 footer-copyright eosh-template-font\">\n                        <p>Copyright 2020 | All Rights Reserved</p>\n                    </div>\n                    <div class=\"col-sm-5 footer-social pull-right\">\n                        <ul class=\"social-icon\">\n                            <li><a href=\"javascript:\"><i class=\"fa fa-facebook-square\"></i></a></li>\n                    <li><a href=\"javascript:\"><i class=\"fa fa-instagram\"></i></a></li>\n                    <li><a href=\"javascript:\"><i class=\"fa fa-youtube-square\"></i></a></li>\n                    <li><a href=\"javascript:\"><i class=\"fa fa-twitter-square\"></i></a></li>\n                        </ul> \n                    </div>\n                </div>\n            </div>\n        </footer>\n\n        <!-- Javascript -->\n        <script src=\"https://cdnjs.cloudflare.com/ajax/libs/jquery/3.5.1/jquery.min.js\"></script>\n        <script src=\"https://cdnjs.cloudflare.com/ajax/libs/jquery-backstretch/2.0.4/jquery.backstretch.min.js\"></script>\n        <script src=\"https://cdnjs.cloudflare.com/ajax/libs/jquery.countdown/2.0.2/jquery.countdown.min.js\"></script>\n        <script src=\"https://cdnjs.cloudflare.com/ajax/libs/wow/0.1.9/wow.min.js\"></script>\n\n        <script type=\"text/javascript\">\n            $(document).ready(function() {\n                /*\n                    Fullscreen background slider\n                */\n                $.backstretch([\n                  \"https://cdn.shopify.com/s/files/1/0691/6194/3062/t/1/assets/eosh-logo-background1.jpg?v=1685682363\",\"https://cdn.shopify.com/s/files/1/0691/6194/3062/t/1/assets/eosh-logo-background2.jpg?v=1685682365\",\"https://cdn.shopify.com/s/files/1/0691/6194/3062/t/1/assets/eosh-logo-background3.jpg?v=1685682366\"\n              ], {duration: 3000, fade: 1250});\n\n                /*\n                    Wow\n                */\n                new WOW().init();\n\n                /*\n                    Countdown initializer\n                */\n                var now = new Date();\n                var countTo = 1 * 24 * 60 * 60 * 1000 + now.valueOf();    \n                $(\".timer\").countdown(countTo, function(event) {\n                    $(this).find(\".days\").text(event.offset.totalDays);\n                    $(this).find(\".hours\").text(event.offset.hours);\n                    $(this).find(\".minutes\").text(event.offset.minutes);\n                    $(this).find(\".seconds\").text(event.offset.seconds);\n                });\n\n                /*\n                    Subscription form\n                */\n                $(\".success-message\").hide();\n                $(\".error-message\").hide();\n                \n                $(\".subscribe form\").submit(function(e) {\n                    e.preventDefault();\n                    var postdata = $(\".subscribe form\").serialize();\n                    var baseUrl = \"https://sf-comingsoonpage.extendons.com/api/submit/subscription\";\n                    $.ajax({\n                        type: \"POST\",\n                        url: baseUrl,\n                        data: postdata,\n                        dataType: \"json\",\n                        success: function(json) {\n                            $(\"input[name=email]\").val(\"\");\n                            if(json.message == \"success\") {\n                                $(\".error-message\").hide();\n                                $(\".success-message\").hide();\n                                $(\".success-message\").html(\"You have subscribed successfully\");\n                                $(\".success-message\").fadeIn();\n                            }else if(json.message == \"exist\"){\n                                $(\".success-message\").hide();\n                                $(\".error-message\").hide();\n                                $(\".error-message\").html(\"Already subscribed\");\n                                $(\".error-message\").fadeIn();\n                            }else {\n                                $(\".success-message\").hide();\n                                $(\".error-message\").hide();\n                                $(\".error-message\").html(\"Some thing went wrong\");\n                                $(\".error-message\").fadeIn();\n                            }\n                        }\n                    });\n                });\n\n            });\n            $(\".eosh-password, .eosh-close\").on(\"click\", function(){\n                $(\".wrap\").toggleClass(\"active\");\n                if($(this).attr(\"class\")==\"eosh-close\"){   \n                    $(\".content\").hide();        \n                }else{   \n                    $(\".content\").show(); \n                }\n                $(\"html\").toggleClass(\"overflow-hidden\");\n                return false;\n            });\n        </script> \n\n        ', 'coming-soon', '1', 30, '2023-06-21 16:50:25', '2023-06-21 16:50:25'),
