(691, 107122032662, 'Create a Wholesale Account', '<span class=\"wsg-hide\"><p style=\"text-align: center;\"><strong>Do not delete this page.</strong></p>\n      <p>Wholesale Gorilla uses this page to help render your Create a Wholesale Account page, so be careful when modifying this page. </p>\n      <p><em>Allowed modifications</em>:</p>\n      <p>Changes to the \"Title\" - You can edit the page title</p>\n      <p>Changes to the \"Content\" - You can delete and replace the Content of this message. Select all text in this box, and delete this message.\n      Anything you add to this content box will appear as the page description.</p>\n      <p><em>Do not modify anything other than the Title and Content</em>, doing so can cause wholesale functions to stop working on your store.</p>\n      <p>Note: This page is excluded from your store SEO, so the <em>Search engine listing preview</em> below will not appear in google searches.</p></span>', 'ws-account-create', '1', 30, '2023-06-21 16:50:25', '2023-06-21 16:50:25'),
(692, 107126292502, 'Design Idea', '\n<div class=\"idi_loader\" id=\"INKYBAY_DESIGN_IDEA_LOADER_HOLDER\"><span id=\"INKYBAY_DESIGN_IDEA_LOADER\" class=\"idi_loader_c\"></span></div>\n<div class=\"idi_body\">\n    <div class=\"idi_category\" id=\"INKYBAY_DESIGN_IDEA_CATEGORY_HOLDER\">\n        <div id=\"INKYBAY_DESIGN_IDEA_CATEGORY_HIDE_H\" class=\"idi_category_close\"><span id=\"INKYBAY_DESIGN_IDEA_CATEGORY_HIDE\">X</span></div>\n        <h2 class=\"idi_category_title\">Design Category</h2>\n        <div id=\"INKYBAY_DESIGN_IDEA_CATEGORY\"></div>\n    </div>\n    <div class=\"idi_category_mobile\">\n        <button type=\"button\" id=\"INKYBAY_DESIGN_IDEA_CATEGORY_SHOW\" title=\"Design Idea Category\" class=\"ib_customize_button\"><span>Choose Category</span></button>\n    </div>\n\n\n    <div class=\"idi_icon_panel\">\n        <h2 id=\"INKYBAY_DESIGN_IDEA_ICONS_TITLE\"></h2>\n        <div style=\"clear: both;\"></div>\n        <div id=\"INKYBAY_DESIGN_IDEA_ICONS\"></div>\n        <div style=\"clear: both;\"></div>\n        <div id=\"INKYBAY_DESIGN_IDEA_ICONS_PAGING\" class=\"idi_paging_holder\"></div>\n    </div>\n</div>\n\n<!--STRUCTURES START-->\n<div id=\"INKYBAY_DESIGN_IDEA_ICONS_STRUCTURE\" style=\"display: none;\"><a class=\"idi_icon_holder\" href=\"__INKYBAY_DESIGN_IDEA_ICON_LINK__\">\n<div class=\"idi_icon_image\">\n<!--<img src=\"__INKYBAY_DESIGN_IDEA_DESIGN_ICON_IMAGE__\" /> --> <img src=\"__INKYBAY_DESIGN_IDEA_WITH_PRODUCT_ICON_IMAGE__\">\n</div>\n<div class=\"idi_icon_title\">__INKYBAY_DESIGN_IDEA_ICON_TITLE__</div>\n<button type=\"button\" title=\"Customize It\" class=\"ib_customize_button\"><span>Customize It</span></button> </a></div>\n<div id=\"INKYBAY_DESIGN_IDEA_ICONS_PAGING_STRUCTURE\" style=\"display: none;\"><span class=\"__INKYBAY_DESIGN_IDEA_PAGE_NO_CLASS__\" onclick=\"__INKYBAY_DESIGN_IDEA_PAGE_NO_ACTION__\">__INKYBAY_DESIGN_IDEA_PAGE_NO__</span></div>\n<!--STRUCTURES END--> \n\n<!--CONSTANTS START-->\n<div style=\"display: none;\">\n<div id=\"INKYBAY_PAGING_SIZE\">12</div>\n<div id=\"INKYBAY_NO_DESIGN_FOUND_MSG\"><span>No Design in this category !</span></div>\n</div>\n<!--CONSTANTS END-->\n\n<style>\n.idi_loader{position: fixed;left: 0px;top: 0px;width: 100%;height: 100%;text-align: center;z-index: 1;background: #fff;opacity: 0.5;}\n.idi_loader_c{position:relative;left:50%;top:50%;}\n.idi_body{display : flex;}\n.idi_category{flex:1 1 0px;padding: 0.8rem;box-shadow: 4px 0px 2px -3px #ccc;}\n.idi_category_mobile{display: none;}\n.idi_category_close{display: none;}\n#INKYBAY_DESIGN_IDEA_CATEGORY_HIDE_H{display: none;}\n.idi_category_title{}\n\n\n.idi_icon_panel{flex:1 1 0px;min-width:70%;padding: 0.8rem;}\n\n.idi_icon_holder{float:left;width:33%;min-width:200px;max-width:250px;height:200px;text-align: center;margin-bottom: 100px;padding:0px 0.4rem;}\n.idi_hide_category_mbl{display:block;}\n.idi_icon_image{position: relative;height:calc(100% - 2rem);padding:0.8rem;border: 1px solid #eee;background: #f6f6f6;border-radius: 6px;}\n.idi_icon_image:hover{background:#eee;border:1px solid #ccc;}\n.idi_icon_image img{position: relative;max-width:100%;max-height:100%;top: 50%;transform: translate(0,-50%);}\n.idi_icon_title{height: 2rem;overflow: hidden;color: #666;font-size: 1.2rem;line-height: 2rem;}\n.idi_paging_holder{position:relative;}\n.idi_page_no{text-align: center;border: 1px solid #eee;border-radius: 20px;margin: 2px;cursor: pointer;width: 30px;height: 30px;line-height: 28px;background: #f6f6f6;float: left;}\n.idi_page_no:hover{color: #f6f6f6;background: #666;border: 1px solid #666;}\n.idi_page_no_selected{color: #eee;background: #666;border: 1px solid #999;}\n.idi_page_no_selected:hover{color: #eee;background: #666;border: 1px solid #999;}\n\n.ib_catlist_a{color:#444;}\n.ib_catlist_a:hover,focus{color:#000;}\n.ib_catlist_selected{color:#449;}\n.ib_catlist_selected:hover,focus{color:#449;}\n.ib_catlist_close_mark{cursor:pointer;}\n.ib_catlist_open_mark{cursor:pointer;}\n.ib_catlist_close_mark:after{content:\'►\';color:#999;font-size:14px}\n.ib_catlist_open_mark:after{content:\'■\';color:#999;font-size:30px}\n.ib_catlist_child{border-left:1px dotted #ccc;margin-left:30px;}\n.ib_customize_button{font-size: 16px; font-weight: bold; color: #ffffff; text-decoration: none; border-radius: 6px; padding: 15px 30px; display: inline-block; margin-top: 20px; background-color: #00adef; border: 1px solid #00adef; mso-border-alt: 10px solid #00adef; cursor:pointer;}\n\n@media (max-width: 500px) {\n    .idi_category{width: 100%; height: 100%;box-shadow:none;}\n    .idi_category_mobile{display: block; width: 100%; text-align: center;}\n    #idi_category_cont_mobile{width: 100%; height: 100%;}\n    .idi_category_close{display: block; font-size: 16px; font-weight: bold; text-align: right;cursor: pointer;}\n    #INKYBAY_DESIGN_IDEA_CATEGORY_HIDE_H{display: block;}\n    .idi_icon_panel{flex:1 1 0px;width:100%;padding: 0.8rem;}\n    .idi_body{display : block;}\n    .idi_icon_holder{width:100%;}\n    .idi_hide_category_mbl{display:none;}\n}\n</style>\n\n<script src=\"https://inkybay.com/shopify/js/inkybay.js?shop=app-security-02.myshopify.com\"></script>', 'designidea', '1', 30, '2023-06-21 16:50:25', '2023-06-21 16:50:25'),
