(712, 107107483670, 'Order lookup', '\n<script>// <![CDATA[\n	window.Manufactory = {\n		appUrl: \'https://app.manufactory.konzeptfabrik.dev\',\n		shop: \'app-security-02.myshopify.com\',\n		orderNumberLabel: \'Order number\',\n		emailAddressLabel: \'Email address\',\n		findOrderButtonText: \'Find order\',\n		noOrderFoundError: \'No order found.\',\n		dateLabel: \'Order date\',\n		orderStatusLabel: \'Order status\',\n		paymentStatusLabel: \'Payment status\',\n		fulfillmentStatusLabeL: \'Fulfillment status\',\n		publicNoteLabel: \'Note\',\n	};\n// ]]></script>\n<style>\n	:root {\n		--mf-border-radius: 0px;\n		--mf-border-color:#d3d3d3;\n		--mf-accent-color: #000000;\n		--mf-button-text-color: #ffffff;\n	}\n</style>\n<link rel=\"stylesheet\" href=\"https://manufactory-order-lookup.konzeptfabrik.workers.dev/assets/mf-order-lookup-styles.css\">\n<script type=\"module\" crossorigin=\"\" src=\"https://manufactory-order-lookup.konzeptfabrik.workers.dev/assets/mf-order-lookup-script.js\"></script>\n<div id=\"manufactory-order-lookup\"></div>\n	', 'order-lookup', '1', 30, '2023-06-21 16:50:25', '2023-06-21 16:50:25');
