px 0;\n	color: #34658e;\n	font-size: 18px;\n  }\n  .storepickup-data .store-list .store-list-item p {\n	margin: 0;\n	padding: 0;\n	font-size: 12px;\n	font-weight: 400;\n	color: #333;\n  }\n  .storepickup-data .store-list .store-list-item .store-office {\n	display: inline-block;\n	font-size: 12px;\n	font-weight: 500;\n	margin-right: 8px;\n	color: #333;\n  }\n  .storepickup-data .store-list .store-list-item .store-office:last-child {\n	margin-right: 0;\n	margin-top: 5px;\n  }\n  .storepickup-data .google-map-holder {\n	height: 500px;\n	position: relative;\n  }\n  .storepickup-data .google-map-holder #currency_widget_map {\n	display: inline-block;\n	position: absolute;\n	top: 0;\n	left: 0;\n	right: 0;\n	bottom: 0;\n	border: 1px solid #DBDBDB;\n	-webkit-border-radius: 3px;\n	-moz-border-radius: 3px;\n	border-radius: 3px;\n	-moz-background-clip: padding;\n	-webkit-background-clip: padding-box;\n	background-clip: padding-box;\n	-webkit-box-sizing: border-box;\n	-moz-box-sizing: border-box;\n	box-sizing: border-box;\n  }\n  .storepickup-data .gm-style img {\n	max-width: initial;\n	margin: auto;\n  }\n  .storepickup-data {\n      width:100%!important;\n      max-width:100%!important;\n  }\n  #infowindow-content {\n      display: none;\n    }\n    #currency_widget_map #infowindow-content {\n      display: inline;\n    }\n  @media (min-width: 320px) and (max-width: 480px) {\n	  .map-index {\n		  display:block!important;\n	  }\n      .storepickup-content {\n          max-height: 269px!important;\n      }\n	  .storepickup-content,.loaded-map  {\n			display: block;\n			float: left;\n			width: 100%;\n			padding: 10px;\n		  }\n	  .storepickup-data .store-list {\n		  margin: 0;\n	  }\n      #myInput {\n          width:100%!important;\n      }\n      .autocomplete-items {\n          width:100%!important;\n          left:0!important;\n      }\n  }\n  .store-office img {\n      margin-bottom: -5px;\n  }\n  @media (min-width: 1025px) {\n      .storepickup-content,.loaded-map  {\n          padding-right: 15px!important;\n      }\n  }\n  .storepickup-content {\n      overflow-y: scroll;\n      max-height: 550px;\n  }\n\n  .autocomplete {\n    position: relative;\n    display: inline-block;\n  }\n\n    input {\n      border: 1px solid transparent;\n      background-color: #f1f1f1;\n      padding: 10px;\n      font-size: 16px;\n    }\n\n    #myInput {\n      background-color: #f1f1f1;\n      width: 50%;\n    }\n\n    input[type=submit] {\n      background-color: DodgerBlue;\n      color: #fff;\n      cursor: pointer;\n    }\n\n    .autocomplete-items {\n      position: absolute;\n      border: 1px solid #d4d4d4;\n      border-bottom: none;\n      border-top: none;\n      z-index: 99;\n      /*position the autocomplete items to be the same width as the container:*/\n      top: 100%;\n      left: 25%;\n      right: 0;\n      text-align:left;\n      max-height: 540px;\n      overflow-y: scroll;\n      overflow: auto;\n      width: 50%;\n    }\n\n    .autocomplete-items div {\n      padding: 10px;\n      cursor: pointer;\n      background-color: #fff;\n      border-bottom: 1px solid #d4d4d4;\n      margin: 0 auto;\n    }\n\n    .store-locator-form {\n        overflow: visible;\n    }\n\n    /*when hovering an item:*/\n    .autocomplete-items div:hover {\n      background-color: #e9e9e9;\n    }\n    .gm-bundled-control-on-bottom {\n        visibility:visible !important;\n    }\n    @media only screen and (max-width: 989px)\n                       and (orientation: landscape) {\n\n                           #myInput {\n                               width:100%!important;\n                           }\n                           .autocomplete-items {\n                               width:100%!important;\n                               left:0!important;\n                           }\n                       }\n    /*when navigating through the items using the arrow keys:*/\n    .autocomplete-active {\n      background-color: DodgerBlue !important;\n      color: #ffffff;\n    }\n    .working_hours, .store-office {\n        align-items: center;\n        display: flex;\n        color: #000;\n    }\n    .storepickup-data>a, .site_url {\n        font-size: 12px!important;\n    }\n    .page-description:empty {\n      padding: 0px!important;\n    }\n    .page-description {\n      text-align: center;\n      padding: 0px 25% 10px 25%;\n      word-wrap: break-word;\n    }\n--></style>\r\n<style name=\"isense-storepickup\" type=\"text/css\"></style>\r\n<p class=\"page-description\"></p>\r\n<form class=\"store-locator-form\" autocomplete=\"off\">\r\n<div class=\"autocomplete\" style=\"text-align: center; width: 100%; margin: 0 auto;\"><input id=\"myInput\" type=\"text\" name=\"searchByName\"></div>\r\n</form>\r\n<div class=\"map-index row\">\r\n<div class=\"storepickup-content\"></div>\r\n<div class=\"loaded-map\">\r\n<div class=\"widget-map-holder\">\r\n<div id=\"currency_widget_map\"></div>\r\n<div id=\"infowindow-content\">\r\n<span id=\"store-name\" class=\"title\">test</span><br> <span id=\"store-address\" class=\"title\">test</span><br> <span id=\"store-phone\" class=\"title\">test</span><br> <span id=\"store-email\" class=\"title\">test</span>\r\n</div>\r\n</div>\r\n</div>\r\n<script type=\"text/map-styles\" id=\"store-map-styles\">// <![CDATA[\r\n[]\r\n// ]]></script>\r\n<script type=\"text/javascript\">\r\nvar initStoreLocator = function() {\r\n	  var stores = {}\r\n	  var defaultStore = null;\r\n	  var offices_map = null;\r\n      var detect_markers = false;\r\n      var detect_location = false;\r\n      var infowindow = null;\r\n      var marker = null;\r\n      var working_hour_text = (Shopify.locale == \'es\') ? \'Horas Laborales\': \'Working hours\';\r\n     // var search_placeholder_text = (Shopify.locale == \'es\') ? \'Buscar nuestras tiendas\': \'Search our stores\';\r\n      if(Shopify.locale == \'es\') {\r\n          var search_placeholder_text = \'Buscar nuestras tiendas\';\r\n      } else if(Shopify.locale == \'fr\') {\r\n          var search_placeholder_text = \'Trouver nos points de vente\';\r\n      } else if(Shopify.shop == \'jack-jill-dog-diapers.myshopify.com\') {\r\n        var search_placeholder_text = \'Search for a store near you enter city\';\r\n      }  else if(Shopify.shop == \'kevin-orthopedic.myshopify.com\') {\r\n        var search_placeholder_text = \'Search clinics or doctors\';\r\n      } else if(Shopify.shop == \'renolit-artyard.myshopify.com\') {\r\n        var search_placeholder_text = \'Finden Sie jetzt einen Partner in Ihrer Nähe\';\r\n      } ', 'our-stores-2', '1', 30, '2023-06-21 16:50:25', '2023-06-21 16:50:25'),
(718, 107110334486, 'Privacy Policy', '<h1 class=\"ql-align-center\">\n  <strong>Shopify Customer Privacy Policy Template</strong>\n</h1>\n<p><br></p>\n<p>\n  This Privacy Policy describes how [<em>INSERT SHOPIFY STORE URL</em>] (the\n  “Site” or “we”) collects, uses, and discloses your Personal Information when\n  you visit or make a purchase from the Site or register with the Site by\n  creating a pet profile and/or subscribing to receive email notifications from\n  us.\n</p>\n<p><br></p>\n<h2>\n  <strong><u>Collecting Personal Information</u></strong>\n</h2>\n<p><br></p>\n<p>\n  When you visit the Site, we collect certain information about your device,\n  your interaction with the Site, and information necessary to process your\n  purchases. We also collect additional information voluntarily provided by\n  you when subscribing to our email list, creating a pet profile or otherwise\n  registering with the Site. We may also collect additional information if\n  you contact us for customer support. In this Privacy Policy, we refer to\n  any information that can uniquely identify an individual (including the\n  information below) as “Personal Information.” See the list below for more\n  information about what Personal Information we collect and why.\n</p>\n<p><br></p>\n<h3>\n  <strong><u>Device information</u></strong>\n</h3>\n<p><br></p>\n<ul>\n  <li>\n    <strong>Examples of Personal Information collected: </strong>version of\n    web browser, IP address, time zone, cookie information, what sites or\n    products you view, search terms, and how you interact with the Site.\n  </li>\n  <li>\n    <strong>Purpose of collection: </strong>to load the Site accurately for\n    you, to perform analytics on Site usage to optimize our Site, to provide you\n    with information and advertising of interest to you, to communicate with you\n    more effectively, to assist us in effectively managing any purchases you\n    make from us and to effectively manage any account you have with us.\n  </li>\n  <li>\n    <strong>Source of collection: </strong>Collected automatically when you\n    access our Site using cookies, log files, web beacons, tags, or pixels;\n    collected automatically when you subscribe to our email list, create a pet\n    profile concerning your pet, or otherwise register with us <em>[ADD OR SUBTRACT ANY OTHER TRACKING TECHNOLOGIES USED]</em>.\n  </li>\n  <li>\n    <strong>Disclosure for a business purpose: </strong>shared with our\n    processor Shopify; shared with our processor/controller Good Boy Studios,\n    Inc.; shared with various third-party processor marketing agencies and\n    advertisers <em>[ADD ANY OTHER VENDORS WITH WHOM YOU SHARE THIS INFORMATION]</em>.\n  </li>\n</ul>\n<p><br></p>\n<h3>\n  <strong><u>Order information</u></strong>\n</h3>\n<p><br></p>\n<ul>\n  <li>\n    <strong>Examples of Personal Information collected: </strong>name,\n    billing address, shipping address, payment information (including credit\n    card numbers <em>[INSERT ANY OTHER PAYMENT TYPES ACCEPTED]</em>), email\n    address, and phone number.\n  </li>\n  <li>\n    <strong>Purpose of collection: </strong>to provide products or services\n    to you to fulfill our contract, to process your payment information, arrange\n    for shipping, and provide you with invoices and/or order confirmations,\n    communicate with you, screen our orders for potential risk or fraud, and\n    when in line with the preferences you have shared with us, provide you with\n    information or advertising relating to our products or services.\n  </li>\n  <li>\n<strong>Source of collection: </strong>collected from you.</li>\n  <li>\n    <strong>Disclosure for a business purpose: </strong>shared with our\n    processor Shopify <em>[ADD ANY OTHER VENDORS WITH WHOM YOU SHARE THIS INFORMATION. FOR EXAMPLE,\n      SALES CHANNELS, PAYMENT GATEWAYS, SHIPPING AND FULFILLMENT APPS]</em>.\n  </li>\n</ul>\n<p><br></p>\n<h3>\n  <strong><u>Customer support information</u></strong>\n</h3>\n<p><br></p>\n<ul>\n  <li>\n    <strong>Examples of Personal Information collected: </strong><em>[MODIFICATIONS TO THE INFORMATION LISTED ABOVE OR ADDITIONAL INFORMATION\n      AS NEEDED]</em>\n  </li>\n  <li>\n    <strong>Purpose of collection: </strong>to provide customer support.\n  </li>\n  <li>\n<strong>Source of collection: </strong>collected from you.</li>\n  <li>\n    <strong>Disclosure for a business purpose: </strong><em>[ADD ANY VENDORS USED TO PROVIDE CUSTOMER SUPPORT]</em>\n  </li>\n</ul>\n<p><br></p>\n<h3>\n  <strong><u>Email subscriber and profile information</u></strong>\n</h3>\n<p><br></p>\n<ul>\n  <li>\n    <strong>Examples of Personal Information collected: </strong>email\n    address, various non-Personal Information voluntarily provided by you when\n    subscribing to our opt-in email list or creating a profile for your\n    pet. You may opt out of your email subscription and pet profile at any\n    time.\n  </li>\n  <li>\n    <strong>Purpose of collection: </strong>to provide you with information\n    and advertising of interest to you, to communicate with you more\n    effectively, to assist us in effectively managing any purchases you make\n    from us, to effectively manage any account you have with us, and for general\n    marketing and demographic analysis.\n  </li>\n  <li>\n    <strong>Source of collection: </strong>Collected automatically when you\n    subscribe to our email list, create a pet profile concerning your pet, or\n    otherwise register with the site.\n  </li>\n  <li>\n    <strong>Disclosure for a business purpose: </strong>shared with our\n    processor/controller, Good Boy Studios, Inc.; shared with various\n    third-party processor marketing agencies and advertisers.\n  </li>\n</ul>\n<p><br></p>\n<p>\n  <em>[INSERT ANY OTHER INFORMATION YOU COLLECT: OFFLINE DATA, PURCHASED\n    MARKETING DATA/LISTS]</em>\n</p>\n<p><br></p>\n<p><em>[INSERT FOLLOWING SECTION IF AGE RESTRICTION IS REQUIRED]</em></p>\n<p><br></p>\n<h3>\n  <strong><u>Minors</u></strong>\n</h3>\n<p><br></p>\n<p>\n  The Site is not intended for individuals under the age of <em>[INSERT AGE]</em>. We do not intentionally collect Personal Information from\n  children. If you are the parent or guardian and believe your child has\n  provided us with Personal Information, please contact us at the address below\n  to request deletion.\n</p>\n<p><br></p>\n<h2>\n  <strong><u>Sharing Personal Information</u></strong>\n</h2>\n<p><br></p>\n<p>\n  We share your Personal Information with service providers to help us provide\n  our services and fulfill our contracts with you, as described above. For\n  example:\n</p>\n<ul>\n  <li>\n    We use Shopify to power our online store. You can read more about how\n    Shopify uses your Personal Information here:<a href=\"https://www.google.com/url?q=https://www.shopify.com/legal/privacy&amp;sa=D&amp;source=editors&amp;ust=1629104037311000&amp;usg=AOvVaw3Dt_EDcMAX2mMBujjOIV1n\" target=\"_blank\" style=\"color: inherit\"> https://www.shopify.com/legal/privacy</a>.\n  </li>\n  <li>\n    We may share your Personal Information to comply with applicable laws and\n    regulations, to respond to a subpoena, search warrant or other lawful\n    request for information we receive, or to otherwise protect our rights.\n  </li>\n  <li>\n    We may share various non-Personal Information with third party data\n    processors for analytics purposes.\n  </li>\n  <li>\n    We may share various non-Personal Information (pet profile information) that\n    is voluntarily provided by you with our processor/controller, Good Boy\n    Studios, Inc. that is then shared with various third-party data analysis\n    processors.\n  </li>\n  <li>\n    Our processor/controller, Good Boy Studios, Inc., may also associate various\n    non-Personal Information (pet profile information) that is voluntarily\n    provide by you with the web cookie received by your device when you\n    voluntarily subscribe to our email list, create a pet profile concerning\n    your pet, or otherwise register with the site, and share that information\n    with third party processor agencies and advertisers to provide you with\n    targeted advertisements on third party websites you may visit.\n  </li>\n  <li><em>[INSERT INFORMATION ABOUT OTHER SERVICE PROVIDERS]</em></li>\n</ul>\n<p><br></p>\n<p>\n  <em>[INCLUDE FOLLOWING SECTION IF USING REMARKETING OR TARGETED\n    ADVERTISING]</em>\n</p>\n<p><br></p>\n<h3>\n  <strong><u>Behavioural Advertising</u></strong>\n</h3>\n<p><br></p>\n<p>\n  As described above, we use your Personal Information (solely or in combination\n  with non-Personal Information) to provide you with targeted advertisements or\n  marketing communications we believe may be of interest to you. For\n  example:\n</p>\n<ul>\n  <li>\n    <em>[INSERT IF APPLICABLE]</em> We use Google Analytics to help us\n    understand how our customers use the Site. You can read more about how\n    Google uses your Personal Information here:<a href=\"https://www.google.com/url?q=https://policies.google.com/privacy?hl%3Den&amp;sa=D&amp;source=editors&amp;ust=1629104037312000&amp;usg=AOvVaw2slI0wm8RDWJsLWhBY5-jO\" target=\"_blank\" style=\"color: inherit\"> https://policies.google.com/privacy?hl=en</a>. You can also opt-out of Google Analytics here:<a href=\"https://www.google.com/url?q=https://tools.google.com/dlpage/gaoptout&amp;sa=D&amp;source=editors&amp;ust=1629104037313000&amp;usg=AOvVaw0SFwXArxe7uRSmCeL4aSj1\" target=\"_blank\" style=\"color: inherit\"> https://tools.google.com/dlpage/gaoptout</a>.\n  </li>\n  <li>\n    <em>[INSERT IF YOU USE A THIRD-PARTY MARKETING APP THAT COLLECTS INFORMATION\n      ABOUT BUYER ACTIVITY ON YOUR SITE]</em> We share information about your use of the Site, your purchases, and\n    your interaction with our ads on other websites with our advertising\n    partners. We collect and share some of this information directly with\n    our advertising partners, and in some cases through the use of cookies or\n    other similar technologies (which you may consent to, depending on your\n    location).\n  </li>\n  <li>\n    We share various non-Personal Information (pet profile information) that is\n    voluntary provided by you when subscribing to our ema', 'privacy-policy', '1', 30, '2023-06-21 16:50:25', '2023-06-21 16:50:25'),
