(723, 107122262038, 'Quest Vault', '<div id=\"wrapper\">\n    <style>\n        #wrapper{\n            display: none;\n        }\n        .quest-wrap .chest-section .heading-legend ul {\n            margin: 0;\n            padding: 0;\n            list-style: none;\n        }\n\n        .clearfix:after {\n            content: \"\";\n            display: block;\n            clear: both;\n        }\n\n        .ellipsis {\n            white-space: nowrap; /* 1 */\n            text-overflow: ellipsis; /* 2 */\n            overflow: hidden;\n        }\n\n        .quest-wrap {\n            font-size: 16px;\n            line-height: 1.2;\n            font-family: \"Roboto\", \"Arial\", \"Helvetica Neue\", \"Helvetica\", sans-serif;\n            color: #030303;\n            box-sizing: border-box;\n        }\n\n        .quest-wrap * {\n            box-sizing: border-box;\n        }\n\n        .quest-wrap img {\n            max-width: 100%;\n            height: auto;\n            vertical-align: top;\n        }\n\n        .quest-wrap .container {\n            max-width: 1200px;\n            margin: 0 auto;\n            padding: 0 15px;\n        }\n\n        .quest-wrap h1,\n        .quest-wrap .h1,\n        .quest-wrap h2,\n        .quest-wrap .h2,\n        .quest-wrap h3,\n        .quest-wrap .h3,\n        .quest-wrap h4,\n        .quest-wrap .h4,\n        .quest-wrap h5,\n        .quest-wrap .h5,\n        .quest-wrap h6,\n        .quest-wrap .h6,\n        .quest-wrap .h {\n            font-family: \"Montserrat\", \"Arial\", \"Helvetica Neue\", \"Helvetica\", sans-serif;\n            font-weight: normal;\n            margin: 0 0 .5em;\n            color: inherit;\n        }\n\n        .quest-wrap h1,\n        .quest-wrap .h1 {\n            font-size: 36px;\n            line-height: .83;\n        }\n\n        .quest-wrap h2,\n        .quest-wrap .h2 {\n            font-size: 30px;\n            line-height: 1.23;\n        }\n\n        .quest-wrap h3,\n        .quest-wrap .h3 {\n            font-size: 22px;\n        }\n\n        .quest-wrap h4,\n        .quest-wrap .h4 {\n            font-size: 14px;\n            font-weight: 300;\n            line-height: 1.2;\n        }\n\n        .quest-wrap p {\n            margin: 0 0 1em;\n        }\n\n        .quest-wrap a {\n            color: #39f;\n        }\n\n        .quest-wrap a:hover,\n        .quest-wrap a:focus {\n            text-decoration: none;\n        }\n\n        .quest-wrap .quest-heading {\n            background: #fff;\n            padding: 10px 0;\n            box-shadow: 0 5px 20px 0 rgba(51, 51, 51, .05);\n        }\n\n        .quest-wrap .quest-heading .logo-quest {\n            width: 70px;\n        }\n\n        .quest-wrap .chest-section {\n            padding: 43px 0;\n            font-size: 16px;\n            line-height: 1.75;\n            font-family: \"Roboto\", \"Arial\", \"Helvetica Neue\", \"Helvetica\", sans-serif;\n            color: #030303;\n            overflow: hidden;\n        }\n\n        .quest-wrap .chest-section .chest-heading {\n            display: -webkit-box;\n            display: -ms-flexbox;\n            display: flex;\n            -webkit-box-align: center;\n            -ms-flex-align: center;\n            align-items: center;\n            -webkit-box-pack: justify;\n            -ms-flex-pack: justify;\n            justify-content: center;\n            border-bottom: 2px solid #f9f8f6;\n            padding-bottom: 15px;\n        }\n\n        .quest-wrap .chest-section .heading-legend {\n            display: -webkit-box;\n            display: -ms-flexbox;\n            display: flex;\n            -webkit-box-align: center;\n            -ms-flex-align: center;\n            align-items: center;\n        }\n\n        .quest-wrap .chest-section .heading-legend .title {\n            font-size: 16px;\n            line-height: 1.25;\n            font-weight: bold;\n        }\n\n        .quest-wrap .chest-section .heading-legend ul {\n            display: -