(769, 115406700851, 'About Us', '<p>Im Marcomenis a quintessentially Indian brand and shirt connoisseur specialising in fine tailoring and accessories for men and women. Founded in 2019 by two Brothers, the brand continues to deliver the promise of exceptional quality, innovation and outstanding value. In 2021 Im marcomen launched its website, offering entire collections to a global audience and bringing to the world. The brand currently has serving more than 20 countries with online stores.</p>\n<p>Im Darji gives you the opportunity to leave a legacy in the contemporary times. With functionality and minimalism at our core, we aim to become the choice for a guy hustling his way in the start-up space, a gentleman at the helm of governance or a boy making his way to grad school.</p>', 'about-us', '1', 37, '2023-07-05 14:28:26', '2023-07-05 14:28:26'),
(770, 115405488435, 'An update about COVID-19', '<p>With the ongoing situation around COVID-19, we wanted to share an update with you. These are uncertain times, but we are sure about one thing: putting the health and safety of our team and our customers first is key.</p>\n<p>We are doing everything we can to ensure the continued sanitization of all our products and facilities. Our team is committed to staying healthy, and helping our customers stay healthy, too.</p>\n<p>We apologize for any delays in getting your order to you. Production or shipping may be impacted by global issues beyond our control, and cause a bit of a wait.</p>\n<p>We hope to maintain regular order shipments as best we can, and we appreciate your patience.</p>\n<p>Stay well!</p>', 'an-update-about-covid-19', '1', 37, '2023-07-05 14:28:26', '2023-07-05 14:28:26'),
(771, 114951487795, 'Contact Us', '', 'contact', '1', 37, '2023-07-05 14:28:26', '2023-07-05 14:28:26'),
(772, 115405062451, 'Privacy policy', '<p><strong>At Marcomen,</strong> We are committed to protecting your privacy. This privacy policy explains how we collect, use, and protect your personal information when you use our website.</p>\n<p><strong> Information We Collect:</strong> When you visit our website, we may collect certain information about your device, including your IP address, browser type, and operating system. We may also collect information about your browsing behavior, such as the pages you visit and the time you spend on our website. If you make a purchase on our website, we may collect your name, email address, shipping address, and payment information.</p>\n<p><strong> Use of Information:</strong> We use the information we collect to provide and improve our website and services. Specifically, we may use your information to:</p>\n<p>Process and fulfill your orders</p>\n<p>Respond to your inquiries and requests</p>\n<p>Send you marketing communications</p>\n<p>Analyze and improve our website and services</p>\n<p>Comply with legal obligations</p>\n<p>We may also share your information with third-party service providers who help us operate our website and services, such as payment processors and shipping companies.</p>\n<p><strong>Cookies:</strong> We use cookies and similar technologies to collect information about your browsing behavior and preferences. Cookies are small files that are stored on your device and allow us to remember your preferences and provide a more personalized experience. You can choose to disable cookies in your browser settings, but this may limit your ability to use certain features of our website.</p>\n<p><strong> Security:</strong> We take reasonable measures to protect your personal information from unauthorized access, use, or disclosure. However, no method of transmission over the Internet or electronic storage is 100% secure, and we cannot guarantee the absolute security of your information.</p>\n<p><strong> Data Retention:</strong> We will retain your personal information for as long as necessary to fulfill the purposes for which it was collected, unless a longer retention period is required by law.</p>\n<p><strong>Your Rights:</strong> You have the right to access, correct, or delete your personal information. You may also have the right to restrict or object to certain processing of your information. To exercise these rights, please contact us at the email address below.</p>\n<p><strong> Children\'s Privacy:</strong> Our website is not intended for children under the age of 13, and we do not knowingly collect personal information from children under 13. If we become aware that we have collected personal information from a child under 13, we will take steps to delete the information as soon as possible.</p>\n<p><strong> Changes to Privacy Policy:</strong> We reserve the right to modify or amend this privacy policy at any time. Any changes will be effective immediately upon posting on the website. Your continued use of the website following the posting of changes constitutes your acceptance of the new privacy policy. If you have any questions or concerns about this privacy policy, please contact us at mailto:marcomen304@gmail.com</p>', 'privacy-policy', '1', 37, '2023-07-05 14:28:26', '2023-07-05 14:28:26'),
(773, 115405390131, 'Refund policy', '<p><strong>Return and Exchange Policy</strong></p>\n<p>Thank you for shopping with us! We want to make sure you\'re completely satisfied with your purchase. If for any reason you\'re not happy with your order, we offer a 3-day return and exchange policy.</p>\n<p><strong>Eligibility for Return and Exchange</strong></p>\n<p>To be eligible for a return or exchange, your item must be unused and in the same condition that you received it. It must also be in the original packaging and with all tags still attached. Any items that are damaged or missing parts for reasons not due to our error will not be eligible for a return or exchange.</p>\n<p><strong>Process for Return and Exchange</strong></p>\n<p>If you need to return or exchange an item, please contact us within 3 days of receiving your order. We will provide you with a return shipping label and instructions for returning the item. Once we receive the returned item and verify that it meets the eligibility requirements, we will process the return or exchange.</p>\n<p><strong>Refunds</strong></p>\n<p>If you\'re returning an item for a refund, we will initiate a refund to your original payment method. You will receive the refund within a certain amount of days, depending on your card issuer\'s policies.</p>\n<p><strong>Exchanges</strong></p>\n<p>If you\'re exchanging an item, we will ship the new item to you once we receive the returned item and verify that it meets the eligibility requirements.</p>\n<p><strong>Shipping</strong></p>\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<p><strong>Contact Us</strong></p>\n<p>If you have any questions about our return and exchange policy, please contact us at   <strong>+918238481304.</strong></p>\n<hr>\n<p>Feel free to adjust the policy to your specific needs and requirements.</p>', 'refund-policy', '1', 37, '2023-07-05 14:28:26', '2023-07-05 14:28:26'),
(774, 115405193523, 'Shipping policy', '<p><span>We know how important is to receive your order on time, so we have the Best Courier Partners to deliver your product to you as soon as we can.</span></p>\n<p>We have a standard delivery option in which, the product will be dispatched within 24-48 hours of the order.</p>\n<p>Depending upon the location, the product will be delivered to you, The ETA  will be made available to you along with your  Tracking Details.</p>\n<p><span>*If you don\'t receive your order in 7-10 Days, please email us with all the details. we will get back to you at the earliest. </span></p>', 'shipping-policy', '1', 37, '2023-07-05 14:28:26', '2023-07-05 14:28:26'),
(775, 115407520051, 'Size Chart', '<main id=\"PageContainer\" class=\"main-content page\" role=\"main\">\n<div id=\"shopify-section-template--17872368533791__page\" class=\"shopify-section\" style=\"text-align: center;\">\n<div class=\"pageCnt page-width\">\n<div class=\"rte\">\n<p><img src=\"https://cdn.shopify.com/s/files/1/0558/5164/7027/files/Size-Chart-REGULAR-FIT_1024x1024.png?v=1677731751\" alt=\"Men\'s Shirt Regular Fit Size Guide - Im Darji\"></p>\n<p> </p>\n<p><img src=\"https://cdn.shopify.com/s/files/1/0558/5164/7027/files/Trim-Size-Chart_480x480.jpg?v=1649137513\" alt=\"Men\'s Regular Fir Shirt Size Chart\"></p>\n<p> </p>\n<p> </p>\n<p> </p>\n<p> </p>\n<h2></h2>\n<p> </p>\n</div>\n</div>\n</div>\n</main>\n<div id=\"shopify-section-footer\" class=\"shopify-section\" style=\"text-align: center;\"><footer class=\"site-footer style1\" role=\"contentinfo\">\n<div class=\"page-width\">\n<div class=\"footer-top footer-block\">\n<div id=\"text-eacfba66-c4ca-4f5e-98d8-55bed9f0b148\" class=\"footer-block__item one-whole newsletter text-center\">\n<div class=\"wrap-newsletter\">\n<h4 class=\"h4\" style=\"text-align: center;\"></h4>\n</div>\n</div>\n</div>\n</div>\n</footer></div>', 'size-chart', '1', 37, '2023-07-05 14:28:26', '2023-07-05 14:28:26'),
(776, 115405127987, 'Terms of service', '<p><strong>Welcome to Marcoman,</strong> an online store for men\'s shirts. By accessing and using our website, you agree to be bound by the following terms and conditions:</p>\n<p><strong> Use of the Website:</strong> You agree to use the website only for lawful purposes and in a manner that does not infringe on the rights of, or restrict or inhibit the use and enjoyment of the website by any third party.</p>\n<p><strong> Privacy Policy:</strong> Please refer to our Privacy Policy to understand how we collect, use, and protect your personal information.</p>\n<p><strong> Product Information:</strong> We make every effort to ensure that the information on our website is accurate and up-to-date. However, we do not guarantee that the product descriptions, prices, and availability are error-free, complete, or current. We reserve the right to correct any errors, inaccuracies, or omissions and to change or update information at any time without prior notice.</p>\n<p><strong> Orders and Payment:</strong> All orders are subject to acceptance and availability. We reserve the right to refuse or cancel an order for any reason, including but not limited to the unavailability of a product or errors in pricing. We accept payment through Shopify\'s secure payment gateway and do not store any payment information.</p>\n<p><strong>Shipping and Delivery:</strong> We ship to most countries worldwide. Please refer to our Shipping Policy for more information on shipping rates, delivery times, and restrictions.</p>\n<p><strong>Returns and Refunds:</strong> We want you to be completely satisfied with your purchase. If you are not satisfied, you may return the product within 3 days of receipt for a refund or exchange. Please refer to our Returns and Refunds Policy for more information on the return process.</p>\n<p><strong> Intellectual Property:</strong> All content on the website, including but not limited to text, graphics, logos, images, and soft