(491, 6486321987753, 'https://cdn.shopify.com/s/files/1/0544/9754/2313/products/T4-3004.png?v=1613974944', 'Premium Vinyl Tape', 'This popular supply is your go-to multipurpose label stock for any labeling task, indoors and out. This flexible yet durable material produces labels that hold strong in a variety of environments. It’s ideal for general safety and facility labeling, pipe marking, and 5S labeling.<br>Our most popular supply is designed to provide lasting durability for a variety of labeling and signage applications. The flexible material allows for easy application and maximum durability in harsh industry environments. Premium Vinyl is perfect for general safety and facility labeling, pipe marking, 5S/6S labeling and more. This material is available in a wide variety of colours to meet your specific needs. Custom colours are also available, simply contact us to order.<br><ul>\n<li>\n<strong>Durable:</strong> a combination of calendered vinyl, acrylic adhesive, and a clay-coated liner allows for flexible application and superior strength</li>\n<li>\n<strong>Heavy Duty:</strong> resistant to UV light, moisture, and most chemicals</li>\n<li>\n<strong>Adaptable:</strong> can endure both indoor and outdoor environments</li>\n<li>\n<strong>Outdoor Life:</strong> up to 5-6 years</li>\n<li>\n<strong>Min Service Temperature:</strong> -40°C</li>\n<li>\n<strong>Max Service Temperature:</strong> 93°C</li>\n<li>\n<strong>Application Temperature:</strong> 4°C</li>\n<li>\n<strong>Shelf Life:</strong> 1 year</li>\n<li>\n<strong>Film Thickness:</strong> 0.07mm</li>\n<li>\n<strong>Adhesive Thickness:</strong> 0.03mm</li>\n</ul>', 'premium-vinyl-tape', 460, 'vendor-unknown', 199, '1', '2022-02-01 11:02:13', '2022-02-01 11:02:13'),
