(698, 6700811256007, 'https://cdn.shopify.com/s/files/1/0545/1605/6263/products/sk056bkwh_1_20eb8afa_720x_e20992ea-7e33-4f29-a54e-66782aa7a93b.jpg?v=1619961053', 'Black Checks Skirt', '<span data-mce-fragment=\"1\">This black and white, check, pencil skirt has elastic on the back and hook &amp; zip for closure. Made from Cotton Twill Lycra, it is stretchable, breathable and comfortable. The hem of the skirt is intended to fall according to the image on a height of 5\'3\" to 5\'5\". Colour may vary slightly according to screen settings and resolution. SKU: SK056BKWH</span>', 'black-checks-skirt', 0, 'juliedashboard', 8, '1', '2022-03-02 06:58:32', '2022-03-02 06:58:32'),
