(703, 6700860866759, 'https://cdn.shopify.com/s/files/1/0545/1605/6263/products/6020-6_1_720x_636e4b7b-b29c-44d0-b929-c9a504383a50.jpg?v=1619963533', 'Black Pleated Layered Mini Skirt', '<span data-mce-fragment=\"1\">This dress is made in pleated fabric with satin finish. It has four layers and falls till above knee. The waist is regular and looks good on all body types. Style with- tube top and platform wedges.</span>', 'black-pleated-layered-mini-skirt', 0, 'juliedashboard', 8, '1', '2022-03-02 06:58:32', '2022-03-02 06:58:32');
