(1058, 7715024077019, 'https://cdn.shopify.com/s/files/1/0648/6133/9867/products/33_d055e943-5140-4708-b30b-2fd38541e884.webp?v=1654226937', 'Orange Pink Designer Saree In Satin Georgette', '<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Make a stunning addition to your Indian saree collection with this satin georgette party wear saree in orange and pink. The 6 meters long saree has been crafted on a viscose satin georgette fabric, shaded in dual tones that promise a graceful fall as you flaunt it. The pallu and the saree border displays floral embellishments that are hand embroidered with utmost precision reflecting its fine finish. This lovely designer saree wear comes with an unstitched blouse that showcases pleasing embellishments scattered across the fabric. Team it up with a pair of stilettos and simple gold jewellery for a subtle but elegant party look.</p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">For Customization, please click on WhatsApp icon and place order. We will contact you and guide you with the measurements. Please note, the customization option is only for sizing and not for design customization. To make Customization on design, please drop us message on WhatsApp.</p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Pack Contains:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">1 Saree,1 Blouse</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Brand:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">Omgee Fashions</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">SKU:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">R-010</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Color:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">Orange And Pink Shaded</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Handcrafted on<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">100% Viscose satin georgette fabric</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Care:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">Dry Clean</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Made in India</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Product is eligible for a return, you may write to us at<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">support@cloveralley.com</b><span data-mce-fragment=\"1\"> </span>within 7 days of delivery to request a return and refund.</p>', 'orange-pink-designer-saree-in-satin-georgette', 0, 'satvikcls', 12, '1', '2022-06-18 06:05:49', '2022-06-18 06:05:49'),
(1059, 7714388934875, 'https://cdn.shopify.com/s/files/1/0648/6133/9867/products/20_13959d40-d32e-4e72-b751-c1ae1dfbcc38.webp?v=1654173579', 'Orange Wedding Gathered Gown', '<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Our orange wedding gown with applique work is expertly hand embroidered to make you look glamorous at your wedding. The hand embroidery is done with zardoshi , katdana , pearl , sequence and in the ancient applique embroidery style. It features an exquisite sweetheart neckline and small delicate pleats on the sleeves hemline. The gown comes with heavy hand embroidery applique work on the yoke and sleeves with heavy gathered flare which is uplifted by cancan and canvas attached to the linning. This beautiful wedding gown is simple yet eye-catching for all your wedding needs. This beautiful orange gown is perfect for outdoor summer weddings, religious ceremonies, traditional style wedding, fall weddings, winter weddings and spring weddings.</p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Pack Contains:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">1 Gown</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Brand:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">Omgee Fashions</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">SKU:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">R-052</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Color:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">Orange</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Handcrafted on<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">100% Viscose Jute Georgette Fabric</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\">Care:<span data-mce-fragment=\"1\"> </span><b data-mce-fragment=\"1\">Dry Clean</b></p>\n<p class=\"margin-bottom-p\" data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Made in India</b></p>\n<p class=\"margin-bottom-