(9252, 8078777680104, 'https://cdn.shopify.com/s/files/1/0604/7311/4856/products/M-115.jpg?v=1671078376', 'HAND & FACE CREAM', '<span data-mce-fragment=\"1\">A blend of natural cocoa butter, Shea butter, olive oil and jojoba oil. Cleans your skin, help</span><span class=\"morecontent\" data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">s restore and control essential moisture. Balances dry ski. Our ancient African formula has been fortified with the botanical ingredients.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">INGREDIENTS: PURIFIED WATER; MINERAL OIL; PROPYLENE GLYCOL; FRAGRANCE; CETYL PHOSPHATE; DIMETHICONE; GLYCERIN; BUTYROSPERMUM PARKII (SHEA BUTTER); THEOBROMA CACAO (COCOA) SEED BUTTER; TRIETHANOLAMINE; CARBOMER; ALOE BARBADENSIS LEAF JUICE; OLEA EUROPAEA (OLIVE) FRUIT OIL; PRUNUS AMYGDALUS DULCIS (SWEET ALMOND) OIL; TOCOPHERYL ACETATE (VITAMIN E ACETATE); MACADAMIA TERNIFOLIA SEED OIL; SIMMONDSIA CHINENSIS (JOJOBA) SEED OIL; GERANIUM MACULATUM OIL; DISODIUM EDTA; METHYLPARABEN; PHENOXYETHANOL; PROPYLPARABEN.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">WARNING: FOR EXTERNAL USE ONLY. DO NOT GET INTO EYES.</span></span>', 'hand-face-cream', 800, 'dharacls', 0, '1', '2022-12-15 04:26:17', '2022-12-15 04:26:17'),
