(9254, 8078778958056, 'https://cdn.shopify.com/s/files/1/0604/7311/4856/products/tad228-pink.jpg?v=1680767653', 'Organza Meenakari Jaal Pattern Saree With Heavily', '<span data-mce-fragment=\"1\">BAMBOO LOTION replenishes moisture, providing rich hydration and leaving the skin fresh,cool and relaxed. This daily lo</span><span class=\"morecontent\" data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">tion protects your skin against the signs of aging with its firming formula<br data-mce-fragment=\"1\">containing Bamboo, Green Tea and Aloe Extracts. Skin is instantly soothed and hydrated for up to 24 hours.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">HOW TO USE: Apply liberally all over body, ideally after bathing. Massage into skin until absorbed, paying particular attention to dry areas. Reapply throughout the day as needed.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">INGREDIENTS: Aqua, Cetyl alcohol, Stearic acid, Stearyl Alcohol, Glycerin, Isopropyl Palmitate, Glycol Stearate, Ceteareth-20, Glyceryl Stearate, PEG-100 Stearate, Vitamin E acetate, Bamboo Extract, Sodium Benzoate, Methylisothiazolinone, Chloroacetamide, Caprylic/Capric Triglyceride, Acrylates Copolymer, Triethanolamine, Fragrance, CI 77266.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">FREE OF: Parabens, Phthalates, Mineral Oil, DEA, Petroleum, Formaldehyde, Propylene<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">CAUTION: For external use only. Keep out of reach of</span></span>', 'bamboo-lotion-250ml', 0, 'dharacls', 0, '1', '2022-12-15 04:34:29', '2022-12-15 04:34:29'),
