(9340, 7663648112696, 'https://cdn.shopify.com/s/files/1/0612/0852/6904/products/Honjo.jpg?v=1674078055', 'Introducing Call of Duty HONJO Toys - Realistic Details and High-Quality Construction for the Ultimate Gaming Experience/test edit', '<body>\r\n\r\n\r\n\r\n\r\n<ul>\r\n<li>Experience the thrill of victory with the Call of Duty HONJO Toys - perfect for any fan of the hit video game series. These action-packed toys feature vibrant colors and realistic details that bring the intense battles of Call of Duty to life.</li>\r\n<li>Constructed with high-quality materials, these toys are built to last and withstand even the most intense play sessions. With their unique features and attention to detail, they\'re sure to be a hit with kids and collectors alike.</li>\r\n<li>Whether you\'re looking to recreate your favorite moments from the game or simply add to your collection, the Call of Duty HONJO Toys are the perfect choice. So gear up and get ready for the ultimate gaming experience!</li>\r\n<li>Expertly designed with key benefits in mind, these toys are sure to provide hours of entertainment and excitement for Call of Duty fans of all ages. So why wait? Add them to your collection today!</li>\r\n<li>With their expert tone and concise, keyword-rich titles, the Call of Duty HONJO Toys are the perfect addition to any gaming collection. So don\'t miss out - order yours today!</li>\r\n</ul>\r\n\r\n</body>', 'call-of-duty-honjo', 500, 'tstore1ruzz', 29, '1', '2023-06-06 15:51:34', '2023-06-06 15:51:34'),
(9341, 7663648047160, 'https://cdn.shopify.com/s/files/1/0612/0852/6904/products/mara.jpg?v=1674077944', 'Introducing Call of Duty MARA Toys - Action Figures and Playsets', '<ul>\n<li>Experience the thrill of the iconic Call of Duty video game series with the new line of MARA Toys. With detailed designs and realistic features, these action figures and playsets bring the world of Call of Duty to life.</li>\n<li>Perfect for any fan of the game, these toys provide hours of fun and excitement. Collect them all and join the fight!</li>\n<li>Expertly crafted with key benefits in mind, these toys highlight the unique features of the Call of Duty series. From intense battles to thrilling missions, these toys capture the essence of the game.</li>\n<li>With an expert tone and concise language, the optimized title and bullet points showcase the best of what Call of Duty MARA Toys have to offer.</li>\n<li>Don\'t miss out on the action - get your Call of Duty MARA Toys today!</li>\n</ul>', 'call-of-duty-mara', 500, 'tstore1ruzz', 29, '1', '2023-06-06 15:51:34', '2023-06-06 15:51:34'),
