(9452, 8118674424123, 'https://cdn.shopify.com/s/files/1/0675/0139/2187/products/Terra-image.png?v=1675330163', 'Pure Water Baby Wipes Travel Pack 24s - 100% biodegradable, Natural Wipes', '<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">TERRA baby Wipes. 100% Biodegradable bamboo fibre. 99.7% Pure New Zealand Water. Absolutely no harmful chemicals or unwanted ingredients, packed to the brim with moisture, and perfect for delicate, sensitive skin.</span></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">99.7% Water wipes</span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Made from plant-based material</span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">100% Biodegradable &amp; home compostable</span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Suitable from birth &amp; perfect for even sensitive skin</span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Dermatologically tested</span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Comes in recyclable P</span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">aper packaging</span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Absolutely no harmful chemicals, </span></strong></li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">No Parabens, No Alcohol </span></strong></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">We love babies.</strong></p>\n<p data-mce-fragment=\"1\">And we understand how important it is to keep baby\'s skin clean, while staying soft, supple and healthy.</p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">100% BIODEGRADABLE WIPES</strong></p>\n<p data-mce-fragment=\"1\">Every time you use TERRA wipes, you will feel proud that you’re helping the environment, as TERRA wipes are 100% biodegradable and packaged in recycled plastic</p>\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Our raw materials are tested by SGS and OEKO-TEX. Our products are tested or certified by the following organizations:</span></p>\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\"><img src=\"https://cdn.shopify.com/s/files/1/0675/0139/2187/files/Group_502_480x480_b4d2357a-1329-4dec-aff3-cb008844aaad_480x480.png?v=1674901133\" alt=\"description\"></span></p>\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Using crystal clear New Zealand water, our wipes provide a naturally simple yet nourishing cleanse for your baby. Complemented with soothing Aloe Vera and vitamin E, these wipes are perfect for sensitive skin. All our products go through intensive testing so that you can be sure that TERRA water wipes are one of the purest and most natural wipes you will ever use. <br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Super handy 20s Travel pack, easy to carry when either in the city or out exploring nature.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\"><strong>Ingredients:</strong><br data-mce-fragment=\"1\"> <br data-mce-fragment=\"1\">- Purified NZ Water<br data-mce-fragment=\"1\">- Japanese Natural Soybean Amino Acid<br data-mce-fragment=\"1\">- NZ Certified Organic Aloe Vera Extract<br data-mce-fragment=\"1\">- German Chamomile Essential Oil<br data-mce-fragment=\"1\">- Vitamin E on Bamboo Fibre</span></p>', 'pure-water-baby-wipes-travel-pack-24s-100-biodegradable-natural-wipes', 0, 'brinzacls', 32, '1', '2023-06-28 11:13:16', '2023-06-28 11:13:16'),
