(9574, 8250609926442, 'https://cdn.shopify.com/s/files/1/0746/3767/2746/files/photo_6195068262795031032_y.jpg?v=1684325164', 'Beautifully Embellished Butter Silk Lehenga Choli: Add a Touch of Luxury to Your Look!', '<p><span>Add a touch of luxury to your look with our beautifully embellished butter silk lehenga choli. This exquisite ensemble is designed to make you feel like a queen, exuding elegance and sophistication on any special occasion.</span></p>\n<p>Crafted from high-quality butter silk fabric, the lehenga drapes gracefully, exuding a luxurious and regal aura. The intricate embroidery work on the lehenga adds a touch of opulence, featuring delicate patterns and motifs that showcase the artistry of skilled craftsmen.</p>\n<p>The choli is beautifully adorned with matching embroidery, enhancing your feminine grace and highlighting your curves. It is designed to provide a comfortable and flattering fit, allowing you to move with ease while exuding confidence.</p>\n<p>Completing the ensemble is a matching dupatta that adds an extra layer of allure. The dupatta features subtle embroidery details, enhancing its overall beauty and creating a harmonious look when draped over the shoulders.</p>\n<p>Whether it\'s a wedding, festive celebration, or any special event, this gorgeous embroidered butter silk lehenga choli is sure to make a lasting impression. Embrace the beauty of Indian ethnic wear and create a fashion statement that reflects your impeccable style and sophisticated taste.</p>', 'beautifully-embellished-butter-silk-lehenga-choli-add-a-touch-of-luxury-to-your-look', 2400, 'indiansaries', 36, '1', '2023-07-05 14:24:42', '2023-07-05 14:24:42'),
(9575, 8233676734762, 'https://cdn.shopify.com/s/files/1/0746/3767/2746/files/photo_6242154770945127946_y.jpg?v=1683520905', 'Black Soft Silk Saree with Copper Rich Jari Pallu', '<p>Make a statement with our Black Soft Silk Saree with Copper Rich Jari Pallu. This saree is made from the finest quality soft silk, making it lightweight and comfortable to wear all day long. The saree features a stunning black color, which makes it perfect for any formal occasion or festive event.</p>\n<p>The highlight of this saree is the copper rich jari pallu that adds a touch of opulence and sophistication to its already mesmerizing design. The intricate jari work is expertly crafted by skilled artisans, making it a true work of art.</p>\n<p>This saree comes with a matching blouse piece that can be customized to your liking, giving you the freedom to create a look that is uniquely yours. Its versatility means that it can be styled to suit your preference, whether you prefer a traditional or modern look.</p>\n<p>Pair this saree with your favorite jewelry and accessories to complete the look and make a statement. Whether you\'re attending a wedding, a party, or a traditional event, this saree is sure to turn heads and make you feel like a true Indian beauty.</p>\n<p>Invest in this Black Soft Silk Saree with Copper Rich Jari Pallu today and add a touch of luxury to your wardrobe. Order now and experience the perfect blend of comfort, style, and elegance.</p>', 'black-soft-silk-saree-with-copper-rich-jari-pallu', 1250, 'indian-sarees', 36, '1', '2023-07-05 14:24:42', '2023-07-05 14:24:42'),
(9576, 8232543093034, 'https://cdn.shopify.com/s/files/1/0746/3767/2746/files/photo_6174495442461635431_y.jpg?v=1684324249', 'Black Soft Silk Saree with Gold Zari Border and Rich Pallu', '<p>Make a statement with our Black Soft Silk Saree with Gold Zari Border and Rich Pallu - a classic piece that is sure to turn heads. Crafted from the finest quality soft silk, this saree promises to make you feel comfortable and elegant all day long.</p>\n<p>The saree features a stunning gold zari border that adds a touch of sophistication to its already eye-catching design. The intricate details of the zari work are a testament to the skill and expertise of our skilled artisans, making it a true work of art.</p>\n<p>This saree is perfect for any special occasion or formal event. Its lightweight and breathable fabric makes it easy to drape, while the rich pallu adds a touch of opulence to your look. The matching blouse piece can be customized to your liking, giving you the freedom to create a look that is uniquely yours.</p>\n<p>Pair this saree with your favorite jewelry and accessories to complete the look and make a statement. Whether you\'re attending a wedding, a party, or a formal event, this saree is sure to turn heads and make you feel like a true queen.</p>\n<p>Invest in this Black Soft Silk Saree with Gold Zari Border and Rich Pallu today and add a touch of luxury to your wardrobe. Order now and experience the perfect blend of comfort, style, and elegance.</p>', 'black-soft-silk-saree-with-gold-zari-border-and-rich-pallu', 1400, 'indian-sarees', 36, '1', '2023-07-05 14:24:42', '2023-07-05 14:24:42'),
(9577, 8335900737834, 'https://cdn.shopify.com/s/files/1/0746/3767/2746/files/photo_6097976223511721604_y.jpg?v=1687868619', 'Breathable Banarasi Sarees: Add Elegance to Your Wedding Celebrations', 'Introducing our collection of Breathable Banarasi Sarees, the epitome of elegance and grace for your wedding celebrations. Crafted with utmost care and attention to detail, these sarees are designed to make you look and feel stunning on your special day.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Each saree in this collection is made from high-quality, breathable Banarasi silk fabric, ensuring maximum comfort even during long hours of festivities. The lightweight and breathable nature of the fabric allows for easy movement and ensures that you stay cool and comfortable throughout the event.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">The exquisite craftsmanship of these sarees is evident in the intricate Banarasi weaving and rich zari work. The intricate motifs and patterns, inspired by traditional Indian designs, add a touch of regal charm to the sarees. The shimmering zari work adds a luxurious and opulent feel, making you the center of attention wherever you go.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">These sarees are perfect for wedding celebrations, where you want to make a lasting impression. Whether you\'re the bride, a bridesmaid, or a guest, our Breathable Banarasi Sarees will enhance your beauty and elevate your style. The wide range of colors and designs available ensures that you find the perfect saree to match your personal style and taste.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Pair these sarees with statement jewelry and accessories to complete your bridal or festive look. The timeless elegance of Banarasi sarees never goes out of style and will make you the epitome of grace and sophistication.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Make a statement at your wedding celebrations with our collection of Breathable Banarasi Sarees. Experience the luxury, comfort, and elegance that these sarees have to offer. Shop now and add a touch of regal charm to your special day.', 'breathable-banarasi-sarees-add-elegance-to-your-wedding-celebrations', 1150, 'indiansaries', 36, '1', '2023-07-05 14:24:42', '2023-07-05 14:24:42'),
(9578, 8325791351082, 'https://cdn.shopify.com/s/files/1/0746/3767/2746/files/photo_6089293633590244635_y.jpg?v=1687428038', 'Breathable Banarasi Sarees: Exquisite Organic Fabrics for Your Wedding Celebrations', 'Introducing our Breathable Banarasi Sarees, a collection of exquisite organic fabrics that are perfect for your wedding celebrations. These sarees are crafted with utmost care using premium organic materials, ensuring breathability and comfort throughout the day.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Each saree in this collection features the timeless artistry of Banarasi weaving, known for its intricate designs and rich heritage. The intricate motifs and patterns are meticulously woven by skilled artisans, creating a masterpiece that reflects the true essence of Indian craftsmanship.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">The organic fabrics used in these sarees not only offer breathability but also provide a luxurious feel against your skin. You can dance, mingle, and enjoy every moment of your wedding celebrations with utmost comfort and style.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">With a wide range of colors and designs available, you can choose a Breathable Banarasi Saree that perfectly complements your personal style and preference. Whether you prefer a classic red or a contemporary pastel shade, you will find the perfect saree to enhance your beauty on your special day.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Accessorize these sarees with traditional jewelry and embellishments to complete your bridal ensemble. The exquisite organic fabrics and intricate weaving will make you feel like a true queen on your wedding day.<br data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">Shop now and experience the beauty and comfort of our Breathable Banarasi Sarees. Celebrate your wedding in style and make memories that will last a lifetime.', 'breathable-banarasi-sarees-exquisite-organic-fabrics-for-your-wedding-celebrations', 1050, 'indiansaries', 36, '1', '2023-07-05 14:24:42', '2023-07-05 14:24:42');
