(9636, 8221140320565, 'https://cdn.shopify.com/s/files/1/0713/0100/5621/products/1_bc1af736-f902-4838-b1d9-51c4e6a22612.png?v=1680679186', 'The Good Ritual Multivitamin For Women |Multi-mineral, Ginseng, Grape Seed Extract |Boost Immunity, Energy, and Skin Health- 60 Veg Tablets', '<p><span style=\"font-weight: 400;\">Introducing our Women\'s Multivitamin supplement - the perfect way to support your overall health and well-being! Our premium formula contains a powerful blend of essential vitamins, minerals, and antioxidants that are specifically formulated to meet the unique nutritional needs of women.</span></p>\n<p><span style=\"font-weight: 400;\">Our Women\'s Multivitamin supplement provides a wide range of benefits, including:</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Enhanced immune function: Our formula contains immune-boosting nutrients like vitamin C, vitamin D, and zinc to help support your body\'s natural defenses.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/1_1951fbeb-d9a8-4707-9a54-25df1311d6ce_480x480.png?v=1682020008\" style=\"display: block; margin-left: auto; margin-right: auto;\"></span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Improved bone health: Our supplement contains bone-building nutrients like calcium, vitamin D, and magnesium to support strong, healthy bones.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/2_aa108afc-ca6e-4b28-9499-f09005c66ebc_480x480.png?v=1682020058\" style=\"display: block; margin-left: auto; margin-right: auto;\"></span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Increased energy levels: Our formula contains B-vitamins and other energy-boosting nutrients to help you feel more alert and energized throughout the day.</span></li>\n</ul>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/3_d6a6814a-3e4e-4fb8-9ba4-9a7f317c0142_480x480.png?v=1682020082\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Promotes healthy skin, hair, and nails: Our formula contains key nutrients like biotin, vitamin E, and vitamin C that support healthy skin, hair, and nails.</span></li>\n</ul>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/4_d0028641-df5b-4fbc-8767-4b64755f9dc4_480x480.png?v=1682020110\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p><span style=\"font-weight: 400;\">Whether you\'re a busy woman looking to support your active lifestyle, or simply looking to maintain optimal health as you age, our Women\'s Multivitamin supplement is the perfect addition to your daily routine. Order now and experience the benefits for yourself!</span></p>', 'the-good-ritual-multivitamin-for-women-multi-mineral-ginseng-grape-seed-extract-boost-immunity-energy-and-skin-health-60-veg-tablets', 249, 'The Good Ritual', 38, '1', '2023-07-05 14:31:52', '2023-07-05 14:31:52'),
(9637, 8176304030005, 'https://cdn.shopify.com/s/files/1/0713/0100/5621/products/WhatsAppImage2023-03-14at16.24.21.jpg?v=1682030067', 'The Good Ritual Sleep Easy 3mg Melatonin Oral spray for effortless deep calm restful sleeping aid liquid drops Dr. formulated for men women, cranberry flavour 30ml, 240 Sprays 60 Days Supply', '<p><span style=\"font-weight: 400;\">Say hello to a good night\'s sleep with Melatonin oral spray! It\'s the sleep buddy you never knew you needed. Here\'s why:</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Faster Than a Speeding Bullet: No more counting sheep, Melatonin oral spray gets absorbed into your bloodstream faster than a speeding bullet! Also <meta charset=\"utf-8\">Don\'t get stuck with the one-size-fits-all approach of pills. Melatonin oral spray allows you to adjust your dosage, so you can sleep soundly every night.</span></li>\n</ul>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/1_14331045-58eb-4ab1-beba-42cd5bd8945f_480x480.png?v=1682020620\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">A Sprinkle of Sweet Dreams: Tired of bland pills? Melatonin oral spray comes with a pleasant taste of cranberry and aroma, making it a tasty way to sweeten your dreams.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/2_e508350c-42c9-420c-bda9-dd9b935df96e_480x480.png?v=1682020643\" style=\"display: block; margin-left: auto; margin-right: auto;\"></span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Take it on the Go: Traveling? No worries! Melatonin oral spray is compact and portable, so you can take it with you, wherever your adventures lead.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/3_b537517d-2bd1-4d29-9da5-1e34aafa8d39_480x480.png?v=1682020692\" style=\"display: block; margin-left: auto; margin-right: auto;\"></span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Safe and Sound: No need to worry about forming any bad habits. Melatonin oral spray is safe, non-habit forming, and a snooze-inducing solution to your sleep struggles.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0713/0100/5621/files/1_73be5b6f-b307-4ec3-91c5-06872893e370_480x480.png?v=1682020764\" style=\"display: block; margin-left: auto; margin-right: auto;\"></span></p>\n<p><span style=\"font-weight: 400;\">In conclusion, with Melatonin oral spray, your sleep will no longer be a thing of nightmares. It\'s a convenient, tasty, and safe way to ensure a good night\'s sleep every night!</span></p>\n<p> </p>', 'sleep-easy', 249, 'The Good Ritual', 38, '1', '2023-07-05 14:31:52', '2023-07-05 14:31:52');
